('DFFE0006', 'F', 'FE', 1, 'D', '希爾思-敏感胃腸與皮膚 雞肉特調食譜(小型及迷你成犬狗飼料)', '益生纖維可促進腸道益菌生長並維持微生物相平衡\r\n高消化性有助於良好營養吸收並形成方便清理的糞便\r\n維生素E與Omega-6 滋潤皮膚\r\n\r\n使用雞肉、釀造米、雞肉粉、黃豆、碎珍珠大麥、全穀粒高梁、蛋製品、雞肉脂肪、黃豆油、糙米、脱水甜菜漿、雞肝香料、乳酸、豬肝香料、氯化鉀、亞麻仁籽、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑、碘鹽、氯化膽鹼、牛磺酸、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、燕麥纖維、天然香料、B胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豆\r\n\r\n\r\n含有下列營養\r\n粗蛋白質不低於21%\r\n粗脂肪不低於12%\r\n粗纖維不高於4%\r\n水不高於10%\r\n維生素E 不低於400 IU/kg\r\n抗壞血酸(維生素C)不低於85 mg/kg\r\nOmega-6脂肪酸不低於3%', 'pro027.jpg', '2023-06-25 10:59:11', '2023-07-19 21:43:36', 1, 'Hills 希爾思', '3.5', '52'),
('DFFE0007', 'F', 'FE', 1, 'D', '希爾思-完美體重-雞肉與米特調食譜(小型及迷你成犬狗飼料)', 'Hills希爾思．小型及迷你成犬完美體重-雞肉與米特調食譜\r\n希爾思&amp;trade;寵物食品 小型及迷你成犬 完美體重提供突破性並美味的體重管理營養配方\r\n維持健康體重及長期持續控制體重\r\n維持精實肌肉\r\n\r\n使用雞肉、碎珍珠大麥、糙米、豌豆纖維、玉米筋質粉、雞肉粉、脫水番茄粕、燕麥纖維、雞肝香料、亞麻仁籽、脫水甜菜漿、椰子油、豬肉香料、乳酸、氯化鉀、左旋離胺酸、DL-蛋胺酸、胡蘿蔔、碘鹽、硫辛酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、氯化膽鹼、礦物質(硫酸錳、硫酸亞鐵、氧化鋅、硫酸銅、碘酸鈣、亞硒酸鈉)、牛磺酸、添加綜合維生素E類以保鮮、天然香料、左旋肉酸素、&amp;beta;-胡蘿蔔素、蘋果、青花菜、蔓越莓、綠豌豆\r\n\r\n含有蛋白質28.6%、脂肪11.2%、粗纖維10.4%、碳水化合物 (NFE)43.1%、鈣0.95%、磷0.74%、鈉0.38%、鉀0.99%、鎂0.142%、Omega-3脂肪酸總量0.76%、Omega-6脂肪酸總量2.22%', 'pro029.jpg', '2023-06-25 11:17:35', '2023-07-19 21:44:09', 1, 'Hills 希爾思', '4.5', '658'),
