('DFFE0014', 'F', 'FE', 1, 'D', '希爾思-羊肉與糙米食譜(成犬狗飼料)', 'Omega-6與維生素E有助於皮毛亮麗\r\n精實肌肉所需的優質蛋白質\r\n天然纖維促進消化健康\r\n\r\n使用羊肉粉、糙米、釀造米、全穀粒高粱、全穀粒小麥、玉米筋質粉、雞肉脂肪、碎珍珠大麥、雞肝香料、脫水甜菜漿、黃豆油、亞麻仁籽、乳酸、豬肝香料、氯化鉀、碘鹽、左旋離胺酸、氯化膽鹼、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素 來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、碳酸鈣、牛磺酸、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、天然香料、&amp;beta;-胡蘿蔔素\r\n\r\n含有粗蛋白質不低於19.5% \r\n粗脂肪不低於12.5% \r\n粗纖維不高於3%\r\n水不高於10%\r\n維生素E不低於400 IU/kg\r\n抗壞血酸(維生素C)不低於85 mg/kg \r\nOmega-6脂肪酸不低於2%', 'pro052.jpg', '2023-06-25 11:55:37', '2023-07-19 21:48:34', 1, 'Hills 希爾思', '4.0', '140'),
('DFFE0015', 'F', 'FE', 1, 'D', '希爾思-青春活力 雞肉與米特調食譜(7歲以上老狗飼料)', '專利混合營養配方，有助於增強腦部功能、互動能力、精力與活力 \r\nOmega-3 及 Omega-6 脂肪酸促進毛髮亮麗 \r\n易消化的成份促進消化健康 \r\n\r\n使用雞肉、釀造米、黃豌豆、碎珍珠大麥、全穀粒燕麥、全穀粒玉米、蛋製品、雞肉脂肪、玉米筋質粉、雞肝香料、豬肝香料、黃豆油、亞麻仁籽、乳酸、左旋離胺酸、氯化鉀、碳酸鈣、磷酸二鈣、胡蘿蔔、脫水番茄粕、脫水柑橘漿、菠菜、魚油、碘鹽、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、硫辛酸、氯化膽鹼、牛磺酸、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、天然香料、添加綜合維生素E類以保鮮、左旋色胺酸、左旋肉酸素、&amp;amp;Beta;-胡蘿蔔素', 'pro055.jpg', '2023-06-25 12:00:59', '2023-07-19 21:54:26', 1, 'Hills 希爾思', '4.2', '360'),
