('DFFE0017', 'F', 'FE', 1, 'D', '希爾思-雞肉與大麥食譜(大型成犬狗飼料)', '天然來源的葡萄糖胺與軟骨素可維持關節健康\r\nOmega-6 與維生素E有助於皮毛亮麗\r\n精實肌肉所需的優質蛋白質\r\n\r\n使用雞肉、全穀粒小麥、碎珍珠大麥、全穀粒高梁、全穀粒玉米、玉米筋質粉、雞肉粉、雞肉脂肪、雞肝香料、脫水甜菜漿、黃豆油、豬肉香料、乳酸、亞麻仁籽、氯化鉀、氯化膽鹼、碘鹽、碳酸鈣、維生素、維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、牛磺酸、燕麥纖維、添加綜合維生素E類以保鮮、天然香料、B-胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豌豆\r\n\r\n含有粗蛋白質不低於20.5%;\r\n粗脂肪不低於12%;\r\n粗纖維不高於3%;\r\n水不高於10%;\r\n維生素不低於400 IU/kg;\r\n抗壞血酸(維生素C)不低於85 mg/kg;\r\n硫化軟骨素不低於550ppm;\r\n葡萄糖胺不低於300ppm;\r\nOmega-6脂肪酸不低於2.5%', 'pro060.jpg', '2023-06-25 12:06:37', '2023-07-19 21:47:20', 1, 'Hills 希爾思', '4.6', '75'),
('DFFE0018', 'F', 'FE', 4, 'D', '極緻-挑嘴成犬 野牧鮮雞配方(成犬狗飼料)', '極緻成犬配方，專為１歲以上的愛狗精心調配，有別於其他一般狗飼料，極緻犬飼料含有高蛋白，低碳水化合物且不含糧食，無論幼犬的品種，極緻都能幫助提升愛犬的健康。豐富的雞肉蛋白質，符合成犬所需的營養。另外添加了天然抗氧化劑和植物化學物質和天然DHA及EPA，幫助形成細胞膜和保護皮毛。本產品絕不含人工防腐劑，最佳的嗜口性100 %滿意保證 。\r\n\r\n使用新鮮去骨雞肉，乾燥雞肉，新鮮雞肝，新鮮鯡魚，新鮮去骨火雞肉，乾燥火雞肉，新鮮火雞肝，新鮮全蛋，新鮮去骨鼓眼魚，新鮮鮭魚，新鮮雞心，雞軟骨，乾燥鯡魚，乾燥鮭魚，雞肝油，紅扁豆，豌豆，綠扁豆，乾紫花苜蓿，山藥，豌豆纖維，雞豆，南瓜，南冬瓜，波菜，蘿蔔，蘋果，巴梨，蔓越莓，藍莓，乾杏仁，海帶，甘草根，當歸根，胡蘆巴，金盞花，甜茴香，薄荷葉，洋甘菊，蒲公英，夏日香薄荷，迷迭香\r\n\r\n含有蛋白質38%\r\n脂肪20%\r\n纖維5%\r\n鈣1.3%\r\n磷1%\r\nOmega-6 3%\r\nOmega -3 1.1%\r\nDHA0.6%\r\nEPA0.3%\r\n葡萄胺1400 mg/kg\r\n軟骨素1200 mg/kg', 'pro096.jpg', '2023-06-25 16:17:11', '2023-07-19 21:47:43', 1, 'Orijen 極緻', '3.8', '1080'),
('DFFE0019', 'F', 'FE', 4, 'D', '極緻-野牧鮮雞配方(高齡犬老狗飼料)', '極緻高齡犬低卡配方，專為7歲以上的愛狗精心調配，有別於其他一般狗飼料，極緻犬飼料含有高蛋白，低碳水化合物且不含糧食，無論愛犬的品種，極緻都能幫助提升愛犬的健康。豐富的雞肉蛋白質，符合高齡犬所需的營養。另外添加了天然抗氧化劑和植物化學物質和天然DHA及EPA，幫助形成細胞膜和保護皮毛。本產品絕不含人工防腐劑最佳的嗜口性100 %滿意保證 。\r\n\r\n使用新鮮雞肉（13％）、新鮮全蛋（7％）、新鮮火雞肉（7％）、新鮮完整鯡魚（7％）、新鮮雞肝（6％）、新鮮完整比目魚（4％）、新鮮火雞肝（4％）、新鮮雞脖子（4％）、新鮮雞心（4％）、新鮮火雞心（4％）、雞肉（脫水，4％）、火雞肉（脫水，4％）、完整鯖魚（脫水，4％）、完整沙丁魚（脫水，4％）、完整鯡魚（脫水，4％）、完整紅扁豆、完整綠扁豆、完整綠豌豆、扁豆纖維、完整鷹嘴豆、完整黃豌豆、完整花豆、雞軟骨（1％）、完整白豆、鯡魚油（1％）、雞脂肪（1％）, 火雞軟骨（1％）, 雞肝（冷凍乾燥）, 火雞肝（冷凍乾燥）、新鮮完整南瓜、新鮮完整冬南瓜、新鮮完整櫛瓜、新鮮完整防風草、新鮮蘿蔔、新鮮完整五爪蘋果、新鮮完整巴特梨、新鮮甘藍菜、新鮮菠菜、新鮮甜菜、新鮮蘿蔔菜、棕海帶、完整蔓越莓、完整藍莓、完整薩斯卡頓莓、菊苣根、薑黃、水飛薊、牛蒡根、薰衣草、蜀葵根、玫瑰果.\r\n\r\n補充劑(每公斤)：營養添加劑：鋅蛋白：100mg. 畜產添加劑：屎腸球菌 NCIMB10415: 600x10^6 CFU.\r\n\r\n含有粗蛋白質38%\r\n脂肪含量15%\r\n粗灰分8%\r\n粗纖維8%\r\n水份12%\r\n鈣1.3%\r\n磷1.1%\r\nOmega-3 0.9%\r\nOmega-6 2.3%\r\nDHA0.3%\r\nEPA0.2%\r\n葡萄糖胺1400mg/kg\r\n軟骨素1200mg/kg', 'pro098.jpg', '2023-06-25 16:23:21', '2023-07-19 21:48:04', 1, 'Orijen 極緻', '3.6', '352'),
