('DFFE0021', 'F', 'FE', 4, 'D', '極緻-六種魚+海藻配方(成犬狗飼料)', '極緻成犬(六種鮮魚+海藻)配方，專為1歲以上的愛狗精心調配，有別於其他一般狗飼料，極緻犬飼料含有高蛋白，低碳水化合物且不含糧食，無論幼犬的品種，極緻都能幫助提升愛犬的健康。豐富的魚類蛋白質和DHA，符合高齡犬所需的營養。另外添加了天然抗氧化劑和植物化學物質和天然DHA及EPA，海藻成分幫助形成細胞膜和保護皮毛。本產品絕不含人工防腐劑最佳的嗜口性100 %滿意保證 。\r\n\r\n使用新鮮完整太平洋沙丁魚（18％）、新鮮完整太平洋鯖魚（13％）、新鮮完整太平洋鱈魚（12％）、新鮮完整太平洋比目魚（5％）、新鮮完整岩魚（5％）、新鮮完整蝶魚（5％）、完整鯖魚（脫水, 5％）、完整鯡魚（脫水，5％）、阿拉斯加鱈魚（脫水，4.5％）、完整沙丁魚（脫水，4.5％）、完整藍鱈（脫水，4％）、鯡魚油（4％）、完整紅扁豆、完整綠扁豆、完整綠豌豆、扁豆纖維、完整鷹嘴豆、完整黃豌豆、葵花油（冷壓）、完整花豆、鱈魚肝（冷凍乾燥）、新鮮完整南瓜、新鮮完整冬南瓜、新鮮完整櫛瓜、新鮮完整防風草、新鮮蘿蔔、新鮮完整五爪蘋果、新鮮完整巴特梨、新鮮甘藍菜、新鮮菠菜、新鮮甜菜、新鮮蘿蔔菜、棕海帶、完整蔓越莓、完整藍莓、完整薩斯卡頓莓、菊苣根、薑黃、水飛薊、牛蒡根、薰衣草、蜀葵根、玫瑰果.\r\n\r\n補充劑(每公斤)：營養添加劑：鋅蛋白：100mg; 銅蛋白: 11mg; 畜產添加劑：屎腸球菌 NCIMB10415: 600x10^6 CFU.\r\n\r\n含有粗蛋白質38%\r\n脂肪含量18%\r\n粗灰分8%\r\n粗纖維5%\r\n水份12%\r\n鈣1.5%\r\n磷1.1%\r\nOmega-3 2.2%\r\nOmega-6 2.2%\r\nDHA0.7%\r\nEPA0.5%\r\n葡萄糖胺1250mg/kg\r\n軟骨素1000mg/kg', 'pro106.jpg', '2023-06-25 16:36:11', '2023-07-19 21:49:43', 1, 'Orijen 極緻', '3.8', '1180'),
('DFFE0022', 'F', 'FE', 4, 'D', '極緻-挑嘴幼犬 野牧鮮雞配方(幼犬狗飼料)', '極緻幼犬配方，專為１歲以下的愛狗精心調配。符合幼犬在大自然下的飲食方式，適合成長中幼犬及長大的年輕犬食用。有別於其他一般狗飼料，極緻犬飼料含有高蛋白，低碳水化合物且不含糧食，採用了80%人類食用高等級的營養肉類、20%新鮮蔬果、0%穀物。無論任何品種的幼犬，極緻都能幫助提升愛犬的免疫力與健康。豐富的雞肉蛋白質，符合幼犬成長所需的營養。另外添加了天然抗氧化劑和植物化學物質和天然DHA及EPA，幫助形成細胞膜和保護皮毛。本產品絕不含人工防腐劑最佳的嗜口性100 %滿意保證 。\r\n\r\n使用新鮮去骨雞肉，乾燥雞肉，新鮮雞肝，新鮮鯡魚，新鮮去骨火雞肉，乾燥火雞肉，新鮮火雞肝，新鮮全蛋，新鮮去骨鼓眼魚，新鮮鮭魚，新鮮雞心，雞軟骨，乾燥鯡魚，乾燥鮭魚，雞肝油，雞肝脂肪，紅扁豆，豌豆，綠扁豆，乾紫花苜蓿，山藥，豌豆纖維，雞豆，南瓜，南冬瓜，波菜，蘿蔔，蘋果，巴梨，蔓越莓，藍莓，乾杏仁，海帶，甘草根，當歸根，胡蘆巴，金盞花，甜茴香，薄荷葉，洋甘菊，蒲公英，夏日香薄荷，迷迭香\r\n\r\n含有蛋白質38%\r\n脂肪20%\r\n纖維5%\r\n鈣1.3%\r\n磷1%\r\nOmega-6 3%\r\nOmega -3 1.2%\r\nDHA0.6%\r\nEPA0.3%\r\n葡萄胺1500 mg/kg\r\n軟骨素1200 mg/kg', 'pro114.jpg', '2023-06-25 16:44:46', '2023-07-19 21:50:03', 1, 'Orijen 極緻', '4.1', '867'),
('DFFE0023', 'F', 'FE', 7, 'D', '優格-經典系列成犬 毛髮柔亮(羊肉+米+小顆粒成犬狗飼料)', 'Omega3脂肪酸幫助強健細胞，毛髮柔亮\r\n添加蕬蘭精華減少便便臭味\r\n腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用乾燥羊肉，乾燥雞肉，研磨糙米，研磨釀造米，研磨高粱，研磨玉米，雞脂(以混合生育酚保存)，乾燥甜菜根，天然調味料，乾燥鮭魚，食鹽，氯化鉀，乾燥蕃茄粕，藜麥，釀造乾燥酵母，乾燥雞蛋，研磨亞麻仁，維生素(維生素E、菸鹼酸(維生素B3)、硫胺素(維生素B1)、泛酸鈣(維生素B5)、維生素A、鹽酸吡哆醇(維生素B6)、維生素B2、維生素D3、維生素B12、葉酸、生物素)，乾燥番茄，礦物質(硫酸鋅、硫酸鐵、硫酸銅、氧化錳、亞硒酸鈉、碘酸鈣)，氯化膽鹼，乾燥菊苣根(菊苣多醣、果寡糖來源)，鯡魚油(以混合生育酚保存)， DL-甲硫氨酸，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)， 啤酒酵母萃取物，益生菌(腸球菌，嗜酸乳桿菌，黑麴菌，長枝木黴菌，枯草芽孢桿菌)。\r\n\r\n含有粗蛋白質 最低量 23.00%、粗脂肪 最低量 14.00%、粗纖維 最高量  4.00%、水分 最高量 10.00%、*灰分 最高量  6.50%、鈣 最低量 0.50%、磷 最低量 0.40%、*茄紅素 最低量  8 mg/kg、*Omega3脂肪酸 最低量 0.30%、*Omega6脂肪酸 最低量 1.50%。', 'pro123.jpg', '2023-06-25 19:07:01', '2023-07-19 21:50:40', 1, 'Toma Pro 優格', '4.1', '1026'),
('DFFE0024', 'F', 'FE', 7, 'D', '優格-經典系列成犬 高適口性 (雞肉+米成犬狗飼料)', '左旋肉鹼幫助控制體重，促進代謝\r\n添加蕬蘭精華減少便便臭味\r\n腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用乾燥雞肉，研磨糙米，研磨玉米，雞脂(以混合生育酚保存)，研磨高粱，乾燥甜菜根，天然調味料，乾燥鮭魚，乾燥蕃茄粕，氯化鉀，食鹽，藜麥，乾燥雞蛋，釀造乾燥酵母，研磨亞麻仁，鮭魚油(以混合生育酚保存)，維生素(維生素E)、菸鹼酸(維生素B3)、硫胺素(維生素B1)、泛酸鈣(維生素B5)、維生素A、鹽酸吡哆醇(維生素B6)、維生素B2、維生素D3、維生素B12、葉酸、生物素)，乾燥番茄，礦物質(硫酸鋅、硫酸鐵、硫酸銅、氧化錳、亞硒酸鈉、碘酸鈣)，乾燥菊苣根(菊苣多醣、果寡糖來源)，氯化膽鹼，卵磷脂， DL-甲硫氨酸，蕬蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)， 左旋肉鹼，肌醇，啤酒酵母萃取物，益生菌(腸球菌，嗜酸乳桿菌，黑麴菌，長枝木黴菌，枯草芽孢桿菌)。\r\n\r\n含有粗蛋白質 最低量 26.00%、粗脂肪 最低量 16.00%、粗纖維 最高量  4.00%、水分 最高量 10.00%、*灰分 最高量 7.50%、鈣 最低量 0.50%、磷 最低量 0.40%、*茄紅素 最低量  8 mg/kg、*Omega3脂肪酸 最低量 0.35%、*Omega6脂肪酸 最低量 2.10%。', 'pro130.jpg', '2023-06-25 19:12:21', '2023-07-19 21:51:07', 1, 'Toma Pro 優格', '4.2', '396'),
('DFFE0025', 'F', 'FE', 7, 'D', '優格-0%零穀 晶亮護毛配方(成犬狗飼料)', '特選來自大西洋 5 種冷水魚，是優質Omega 3脂肪酸來源\r\n極致零穀配方，降低易敏毛孩過敏機率\r\n複合型動物性蛋白質提供完整胺基酸與蛋白質\r\n鮮採5種蔬果富含維生素、礦物質與抗氧化物，增強抵抗力\r\n添加腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用濃縮鮭魚，乾豌豆，乾鷹嘴豆，豌豆粉，雞脂(以混合生育酚保存)，勻相化鱒魚，馬鈴薯粉，濃縮油鯡魚，乾燥甜菜根，天然調味料，磷酸氫鈣，濃縮白肉魚，乾燥蕃茄粕，濃縮鯡魚，食鹽，乾燥雞蛋，研磨亞麻籽，啤酒酵母萃取物，鮭魚油(以混合生育酚保存)，碳酸鈣，氯化膽鹼，乾燥菊苣根(菊苣纖維與果寡糖之來源)，維生素(維生素E，維生素A，維生素D3，維生素B12，維生素C，維生素B2，硫胺素(維生素B1)，葉酸，生物素(維生素B7)，鹽酸吡哆醇(維生素B6)，菸鹼酸(維生素B3)，維生素K，胡蘿蔔素，泛酸鈣(維生素B5))，礦物質 (硫酸銅，碘酸鈣，硫酸亞鐵，氧化錳，氧化鋅，亞硒酸鈉，蛋白質螯合銅，蛋白質螯合鐵，蛋白質螯合鋅，蛋白質螯合錳)，DL-甲硫氨酸，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)，鹽酸鹽葡萄糖胺，左旋肉鹼，軟骨素，肌醇(維生素B8)，嗜酸乳酸桿菌，乾酪乳酸桿菌，比菲德氏菌，腸球F菌。\r\n\r\n具有粗蛋白 (最低量) 27％、粗脂肪 (最低量) 13％、粗纖維 (最高量) 5.5％、水分 (最高量) 10％、灰分 (最高量) 9.5％、Omega 3脂肪酸 (最低量) 0.8％、Omega 6 脂肪酸 (最低量) 2.4％。', 'pro133.jpg', '2023-06-25 19:22:50', '2023-07-19 21:51:32', 1, 'Toma Pro 優格', '3.9', '250'),
('DFFE0026', 'F', 'FE', 7, 'D', '優格-經典系列成犬 骨關節強化 (羊肉+米+大顆粒成犬狗飼料)', '添加葡萄糖胺/軟骨素幫助潤滑關節，維持軟骨組織\r\n大顆粒設計可咀嚼慢食幫助潔牙\r\n腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用乾燥羊肉，乾燥雞肉，研磨糙米，研磨釀造米，研磨高粱，研磨玉米，珍珠大麥，雞脂(以混合生育酚保存)，玉米麩粉，乾燥甜菜根，天然調味料，乾燥鮭魚，食鹽，氯化鉀，乾燥蕃茄粕，藜麥，乾燥雞蛋，釀造乾燥酵母，研磨亞麻仁，維生素(維生素E、菸鹼酸(維生素B3)、硫胺素(維生素B1)、泛酸鈣(維生素B5)、維生素A、鹽酸吡哆醇(維生素B6)、維生素B2、維生素D3、維生素B12、葉酸、生物素)，乾燥番茄，礦物質(硫酸鋅、硫酸鐵、硫酸銅、氧化錳、亞硒酸鈉、碘酸鈣)，氯化膽鹼，乾燥菊苣根(菊苣多醣、果寡糖來源)，鯡魚油(以混合生育酚保存)， DL-甲硫氨酸，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)， 鹽酸鹽葡萄糖胺，軟骨素，左旋肉鹼，肌醇， 啤酒酵母萃取物，益生菌(腸球菌，嗜酸乳桿菌，黑麴菌，長枝木黴菌，枯草芽孢桿菌)。\r\n\r\n含有粗蛋白質 最低量 23.00%、粗脂肪 最低量 14.00%、粗纖維 最高量 4.00%、水分 最高量 10.00%、*灰分 最高量  7.50%、鈣 最低量 0.50%、磷 最低量 0.40%、*茄紅素 最低量 8 mg/kg、*Omega3脂肪酸 最低量 0.30%、*Omega6脂肪酸 最低量 1.50%、*葡萄糖胺 最低量 210 mg/kg、*軟骨素 最低量 85 mg/kg。\r\n', 'pro137.jpg', '2023-06-25 19:27:23', '2023-07-19 21:51:56', 1, 'Toma Pro 優格', '4.1', '935'),
