('DFFE0029', 'F', 'FE', 7, 'D', '優格-熟齡養生 鮭魚+馬鈴薯配方(老狗飼料)', '茄紅素/VitE幫助抗氧化，調節免疫力\r\n添加葡萄糖胺/軟骨素幫助潤滑關節，維持軟骨組織\r\nOmega3脂肪酸 / DHA可使毛髮柔亮，增進腦健康\r\n\r\n使用乾燥鮭魚，研磨糙米，研磨釀造米，乾燥馬鈴薯，乾燥甜菜根，天然調味料，雞脂(以混合生育酚保存)，鮭魚油(以混合生育酚保存)，乾燥蕃茄粕，食鹽，氯化鉀，藜麥，維生素(維生素E、菸鹼酸(維生素B3)、硫胺素(維生素B1)、泛酸鈣(維生素B5)、維生素A、鹽酸吡哆醇(維生素B6)、維生素B2、維生素D3、維生素B12、葉酸、生物素)，乾燥番茄，乾燥菊苣根(菊苣多醣、果寡糖來源)，氯化膽鹼，礦物質(硫酸鋅、硫酸鐵、硫酸銅、氧化錳、亞硒酸鈉、碘酸鈣)， DL-甲硫氨酸，碳酸鈣，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)， 左旋肉鹼，肌醇，啤酒酵母萃取物，益生菌(腸球菌，嗜酸乳桿菌，黑麴菌，長枝木黴菌，枯草芽孢桿菌)。\r\n\r\n含有粗蛋白質 最低量 24.00%、粗脂肪 最低量 10.00%、粗纖維 最高量 4.50%、水分 最高量 10.00%、*灰分 最高量  7.00%、鈣 最低量 0.50%、磷 最低量 0.40%、*茄紅素 最低量  8 mg/kg、*Omega3脂肪酸 最低量 0.75%、*Omega6脂肪酸 最低量 2.55%、*葡萄糖胺 最低量 425 mg/kg、*軟骨素 最低量  125 mg/kg。', 'pro149.jpg', '2023-06-25 19:42:31', '2023-07-19 21:53:22', 1, 'Toma Pro 優格', '3.7', '126'),
('DFFE0030', 'F', 'FE', 7, 'D', '優格-0%零穀 室內成犬 體重管理 雞肉配方(狗飼料小顆粒)', '低熱量配方讓低活動量的狗狗有效控制體重\r\n極致零穀配方，降低易敏毛孩過敏機率\r\n複合型動物性蛋白質提供完整胺基酸與蛋白質\r\n鮮採5種蔬果富含維生素、礦物質與抗氧化物，增強抵抗力\r\n添加腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用濃縮雞肉，馬鈴薯粉，乾鷹嘴豆，豌豆粉，乾燥甜菜根，豌豆纖維，天然調味料，雞脂(以混合生育酚保存)，乾豌豆，濃縮鮭魚，濃縮火雞肉，鮭魚油(以混合生育酚保存)，食鹽，研磨亞麻籽，啤酒酵母萃取物，乾燥蕃茄粕，氯化膽鹼，乾燥菊苣根(菊苣纖維與果寡糖之來源)，乾燥雞蛋，維生素(維生素E，維生素A，維生素D3，維生素B12，維生素C，維生素B2，硫胺素(維生素B1)，葉酸，生物素(維生素B7)，鹽酸吡哆醇(維生素B6)，菸鹼酸(維生素B3)，維生素K，胡蘿蔔素，泛酸鈣(維生素B5))，礦物質 (硫酸銅，碘酸鈣，硫酸亞鐵，氧化錳，氧化鋅，亞硒酸鈉，蛋白質螯合銅，蛋白質螯合鐵，蛋白質螯合鋅，蛋白質螯合錳)，DL-甲硫氨酸，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)，鹽酸鹽葡萄糖胺，左旋肉鹼，肌醇(維生素B8)，軟骨素，嗜酸乳酸桿菌，乾酪乳酸桿菌，比菲德氏菌，腸球F菌。 \r\n\r\n含有粗蛋白 (最低量) 24％、粗脂肪 (最低量) 8％、粗纖維 (最高量) 8.5％、水分 (最高量) 10％、灰分 (最高量) 9％、Omega 3 脂肪酸 (最低量) 0.25％、Omega 6 脂肪酸 (最低量) 1.8％。', 'pro152.jpg', '2023-06-25 21:21:33', '2023-07-19 21:25:34', 1, 'Toma Pro 優格', '4.3', '175'),
('DFFE0031', 'F', 'FE', 7, 'D', '優格-經典聰明成長系列(幼犬狗飼料)', '提供豐富的鈣，滿足幼犬生長所需，強健骨骼\r\nDHA可增進腦神經健康\r\n添加腸益菌/益菌生整腸助消化，營養好吸收\r\n\r\n使用乾燥羊肉，乾燥雞肉，研磨糙米，研磨釀造米，玉米麩粉，研磨高梁，研磨玉米，雞脂(以混合生育酚保存)。乾燥甜菜根，天然調味料，乾燥鮭魚，鮭魚油，乾燥蕃茄粕，釀造乾燥酵母，乾燥雞蛋。研磨亞麻仁，氯化鉀，藜麥，食鹽，維生素(維生素E，菸鹼酸(維生素B3)、硫胺素(維生素B1)、泛酸鈣(維生素B5)、維生素A，鹽酸吡哆醇(維生素B6)、維生素B2、維生素D3、維生素B12、葉酸、生物素)，乾燥番茄，礦物質 (硫酸锌、硫酸鐵、硫酸銅、氧化錳、亞硒酸钠、碘酸鈣)，乾燥菊苣根(菊苣多醣、果寡糖來源)，氯化膽鹼，鮭魚油(以混合生育酚保存)， DL-甲硫氨酸，絲蘭萃取精華，L-抗壞血酸-2-聚磷酸鹽(維生素C活性來源)，啤酒酵母萃取物。益生菌(腸球菌，嗜酸乳桿菌，黑麴菌，長枝木徽菌，枯草芽孢桿菌)。\r\n\r\n含有粗蛋白質 最低量 27.00%、粗脂肪 最低量 15.00%、粗纖維 最高量 4.00%、水分 最高量 10.00%、*灰分 最高量  7.50%、鈣 最低量 1.20%、磷 最低量 1.00%、*茄紅素 最低量 8 mg/kg、*Omega3脂肪酸 最低量 0.35%、*Omega6脂肪酸 最低量 1.60%。', 'pro156.jpg', '2023-06-25 21:26:24', '2023-07-19 21:37:35', 1, 'Toma Pro 優格', '4.3', '1180'),
