('DFFE0033', 'F', 'FE', 8, 'D', '大成狗貓-成犬無穀美膚亮毛配方1.8公斤(狗飼料)', '由大成專業團隊精心研發，從#育種 到 #研發\r\n誕生全新機能升級的飼料\r\n給毛孩吃的美味・防護加倍！\r\n從頭到尾・給毛孩全方位呵護 \r\n\r\n✔ 水解低敏胜肽蛋白 \r\n獨家水解技術，打造健康好體質\r\n\r\n✔ 獨家專利複合益生菌 \r\n補充關鍵益菌，維持狗貓腸道平衡\r\n\r\n✔ 優質蛋白質\r\n可溯源鮮蛋，品質安全有保證\r\n\r\n✔ 茄紅素 ✔ 維生素A\r\n延緩愛寵老化，維持好視力\r\n\r\n✔ 高品質魚油 \r\n豐富DHA+維生素Ｄ，維持犬貓心血管健康\r\n\r\n皮膚毛色都亮麗！⠀\r\n我們堅持｜給飼主最安心的四大保證\r\n獨家自有原料，提供精準營養\r\n產地新鮮直送，溯源安全有保證\r\n專家團隊設計，健康全方位呵護\r\n國家認證品檢，為愛寵健康把關\r\n\r\n大成鹿野自由放養土雞、水解低敏胜肽蛋白、北大西洋鱈魚、北海道鯡魚、天然苜蓿、完整豌豆、法國亞麻籽、阿拉斯加深海魚油(使用天然維生素E保存)、澳洲優質牛肉粉、氯化膽鹼、氯化鈉(來自天然海鹽)、精胺酸、DL-蛋胺酸、複合益生菌(Ligilactobacillus salivarius, Lactobacillus reuteri, Bacillus amyloliquefaciens)、&beta;-葡聚糖、大成溯源鮮蛋、卵磷脂、寵物犬專用膳食礦物質(胺基酸螯合鋅、胺基酸螯合鐵、硫酸錳、胺基酸螯合銅、碘酸鉀、亞硒酸鈉)、寵物犬專用綜合維生素(維生素E（&alpha;-生育醇）、維生素B3（菸鹼酸）、維生素 B5（泛酸）、維生素B7（生物素）、維生素B2（核黃素）、維生素B1（噻胺）、維生素B12（氰鈷胺素）、維生素A（視黃醇）、維生素D（膽鈣化醇）、維生素B6（吡哆醇）、維生素K（葉醌）、維生素B9（葉酸）)、南美絲蘭萃取物。 \r\n\r\n含有粗蛋白質31.0%以上 、粗脂肪14.0% 以上、粗纖維5.0%以上、灰分9.0%以下、鈣1.2%以上、磷1.0%以上、水分10%以下、熱量、代謝能(計算值)3500kcal/kg ', 'pro197.jpg', '2023-07-11 21:10:46', '2023-07-11 21:10:46', 1, 'GoMo Pet Food 大成狗貓', '4.0', '14'),
