('DFSN0011', 'F', 'SN', 8, 'D', '大成狗貓-雞胗80克(狗零食)', '使用新鮮雞肉、羊肉粉、澱粉、己二烯酸鉀、海藻糖、亞硝酸鈉、甘油、香料、焦糖色素、食用色素\r\n含有水份20%以下、蛋白質50%以下、脂肪3%以下、纖維2%以下\r\n室溫保存，並存放於陰涼乾燥處，避免陽光直射\r\n\r\n保存方法\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.全齡犬專用，請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。\r\n', 'pro224.jpg', '2023-07-11 22:06:30', '2023-07-11 22:06:30', 1, 'GoMo Pet Food 大成狗貓', '3.7', '33'),
('DFSN0012', 'F', 'SN', 8, 'D', '大成狗貓-牛奶肉條捲6入(狗零食)', '使用新鮮雞肉、保久乳(牛奶)、澱粉、己二烯酸鉀、海藻糖、亞硝酸鈉、甘油、食用色素\r\n含有水份25%以下、蛋白質65%以上、脂肪3%以下、纖維2%以下\r\n室溫保存，並存放於陰涼乾燥處，避免陽光直射\r\n\r\n保存方法\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.全齡犬專用，請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。', 'pro220.jpg', '2023-07-11 21:59:55', '2023-07-18 09:09:18', 1, 'GoMo Pet Food 大成狗貓', '3.5', '14'),
('DFSN0013', 'F', 'SN', 13, 'D', '汪喵星球-養生食補 95% 雞肉餅 (狗零食)', '&bull; 95％純鮮肉製成！\r\n&bull; 不含任何人工香料、防腐劑\r\n&bull; 毛孩不僅愛吃，還吃得健康\r\n&bull; 酥酥脆脆，滿足毛孩想咬咬的咀嚼慾望\r\n\r\n明目護眼雞肉餅\r\n雞胸肉 + 枸杞 + 決明子\r\n營養分析\r\n熱量360.1kcal/100g\r\n粗蛋白77.9%\r\n粗脂肪4.5%\r\n飽和脂肪0.7%\r\n反式脂肪0%\r\n碳水化合物 6%\r\n鈉 0.2%\r\n灰份 3.6%\r\n水分  8%\r\n\r\n美膚爆毛雞肉餅\r\n雞胸肉 + 鱉蛋 + 卵磷脂 + 薏仁\r\n營養分析\r\n熱量367.6kcal/100g\r\n粗蛋白78.2%\r\n粗脂肪5.2%\r\n飽和脂肪0.9%\r\n反式脂肪 0%\r\n碳水化合物 5%\r\n鈉 0.2%\r\n灰份 3.9%\r\n水分 7.7%\r\n\r\n補氣養生雞肉餅\r\n雞胸肉 + 紅棗 + 紅豆\r\n營養分析\r\n熱量 355.1kcal/100g\r\n粗蛋白77.1%\r\n粗脂肪 4.3%\r\n飽和脂肪0.7%\r\n反式脂肪0%\r\n碳水化合物 6.6%\r\n鈉0.2%\r\n灰份3.8%\r\n水分 8.2%\r\n\r\n保存方式：置於室溫陰涼乾燥處，拆封後盡快食用完畢\r\n賞味期限：10個月，請見袋底標示\r\n製造產地：台灣\r\n', 'pro324.jpg', '2023-06-02 11:47:59', '2023-06-02 11:47:59', 1, 'DogCatStar 汪喵星球', '4.3', '1008'),
('DGDR0001', 'G', 'DR', 14, 'D', '貓與狗-寵物派對套裝(狗服飾)', '● 韓國超人氣品牌\r\n● 派對必備帽子套裝\r\n● 柔軟舒適 親膚面料\r\n● 帽子內置嗶嗶發聲器 還可作爲玩具\r\n● 帽子的下巴帶可調節尺寸\r\n注意事項\r\n溫水中性洗滌劑或寵物專用洗滌劑，建議手洗後自然乾燥\r\n含有塑料配件（嗶嗶、沙沙塑料）的產品建議用冷水清洗\r\n根據洗滌溫度及洗滌劑的不同可能會出現掉色或移染現象，建議單獨洗滌', 'pro330.jpg', '2023-08-02 15:04:13', '2023-08-02 15:04:13', 1, 'Mao&Kou 貓與狗', '3.7', '196'),
('DGDR0002', 'G', 'DR', 14, 'D', '貓與狗-TPU連帽雨衣(狗服飾)', '●雨天不煩悶 帥氣去逛街\r\n ●100%TPU環保耐磨 抗低溫 全新防護科技 \r\n●背部銀色包邊條\r\n ●可調節鬆緊繩扣設計 防止狗狗淋濕\r\n', 'pro338.jpg', '2023-08-02 15:19:09', '2023-08-02 15:19:09', 1, 'Mao&Kou 貓與狗', '4.3', '36'),
