('DGOT0001', 'G', 'OT', 14, 'D', '貓與狗-浴缸造型寵物窩(狗寢具)', '● 花灑逗貓棒 自助逗貓\r\n● 逗貓棒可整根取出 自由揮舞\r\n● 高回彈海綿 大大浴缸好好躺\r\n● 有頭巾又有浴巾 沈浸式泡澡\r\n● 蓬蓬內墊 可拆卸清洗\r\n● 贈發聲小鴨玩具*1\r\n\r\n尺寸 : 380x540x180mm\r\n重量 : 700g\r\n材質 : 短毛絨、PP棉、海綿\r\n浴缸運輸需折疊，需要一定的回彈時間，請等待它變圓圓\r\n如需清洗請輕柔手洗，請勿曝曬\r\n水花不玩請拆卸收納，避免毛孩誤食', 'pro403.jpg', '2023-08-04 10:43:10', '2023-08-04 10:43:10', 1, 'Mao&Kou 貓與狗', NULL, NULL),
('DGTO0001', 'G', 'TO', 14, 'D', '貓與狗-造型發聲玩具(狗玩具)', '型犬和大型犬們也可以享受，拉扯遊戲中帶來的樂趣啦！\r\n為大家隆重介紹 &mdash; BITE ME 達克鴨！\r\n堅韌的構造，搭配40公分大尺寸的達克鴨，\r\n裡面有大型的啾啾發聲器。\r\n在咬跟甩的過程中，2倍超大分貝啾啾聲，成功吸引寶貝的興趣！\r\n中、大型犬寶貝絕對不能錯過的可愛互動玩具。\r\n材質 : 聚酯纖維、安全填充棉、內置發響器\r\n尺寸 : 40x17cm\r\n根據材質的特性上和製造方法的不同，產品間有可能產生1-2公分的誤差\r\n根據填充物材質上的特性，啾啾聲的大小可能會有些許的差異\r\n請拆除包裝後再給毛小孩進行使用\r\n過度撕咬造成本產品破壞時，請將產品收回勿讓寵物吞食\r\n商品請遠離火源\r\n因內含塑膠部分(啾啾聲)，請使用冷水洗滌\r\n請注意勿讓毛小孩誤食撕咬或較小型的零件等\r\n根據螢幕種類、解析度和光線的差異，實際產品與圖片可能會有些許的色差\r\n', 'pro381.jpg', '2023-08-04 10:18:34', '2023-08-04 10:18:34', 1, 'Mao&Kou 貓與狗', '4.2', '234'),
('DGTO0002', 'G', 'TO', 14, 'D', '貓與狗-藏食發聲玩具(狗玩具)', '今晚，要不要來個美味的起士堡\r\n啾啾聲的麵包外皮、可以藏食和響紙聲的肉排和起士\r\n一個玩具滿足你，所有喜歡的一切\r\n寶貝也有專屬自己的漢堡，再也不會眼巴巴望著你了:-P\r\n\r\n毛孩使用時，請飼主陪同，避免誤食\r\n內含塑膠材質(啾啾聲)，建議以冷水洗滌\r\n產品因包裝不同，使用前請先將包裝撕去\r\n此為消耗性商品，嚴重撕咬導致產品破損時，請盡速將玩具收走，以免家中寶貝吞嚥內容物，若損壞應立即更換\r\n產品請勿靠近火源\r\n根據材質特性和測量方法的不同，會產生1-2cm的誤差\r\n商品顏色因電腦螢幕設定不同而有誤差，以實際商品顏色為主\r\n玩具屬接觸性商品，若非商品瑕疵(如:發聲器無法出聲、脫線等)，拆封後故無法退換貨及退款\r\n出貨前皆會測試發聲器，拆封後若發現無法按壓出聲音，請立即反應給客服', 'pro383.jpg', '2023-08-04 10:20:31', '2023-08-04 10:20:31', 1, 'Mao&Kou 貓與狗', '4.0', '64'),
('DGTO0003', 'G', 'TO', 13, 'D', '汪喵星球-玩具總動員 狗狗彈力球(狗玩具)', '● Disney 迪士尼正版授權\r\n● 耐咬材質，發聲完具，不易壞、玩更久\r\n● 安全布料，經SGS重金屬測試\r\n● 容易清潔，沖洗、曬乾超方便！\r\n\r\n材質：聚酯纖維、橡膠\r\n尺寸：直徑6.3公分\r\n淨重：58g/個\r\n請於毛孩玩耍時陪同在側，避免誤食\r\n玩具為消耗性產品，嚴重撕咬導致產品破損時，請儘速將玩具丟棄，以免毛孩吞嚥內容物\r\n手工測量會有些許誤差，實際尺寸以實物為主', 'pro387.jpg', '2023-08-04 10:25:44', '2023-08-04 10:25:44', 1, 'DogCatStar 汪喵星球', '3.5', '63'),
('DGTO0004', 'G', 'TO', 14, 'D', '貓與狗-磨牙咬咬玩具  番茄醬(狗玩具)', '● 讓毛孩也能體會番茄醬的美味\r\n● 增進人寵感情 共同玩樂\r\n● 天然材質 植物染色\r\n● 手工編織 結實耐磨\r\n● 立體設計 毛孩歡喜\r\n● 釋放壓力 磨牙潔齒\r\n\r\n尺寸 : 16x8cm\r\n材質 : 牛津布、響紙、再生棉繩\r\n和寵物進行遊戲和互動時，合理安排時間，防止毛孩過累\r\n為了防止寵物受傷，玩具損壞後請即時更換處理\r\n定期為玩具進行清洗和消毒\r\n請在家長監護下使用', 'pro393.jpg', '2023-08-04 10:31:44', '2023-08-04 10:31:44', 1, 'Mao&Kou 貓與狗', '4.0', '126'),
('DGTO0005', 'G', 'TO', 14, 'D', '貓與狗-臘辣Pizza 發聲玩具(狗玩具)', '厚實餅皮口感的臘辣Pizza，讓喜愛啃咬的小孩欲罷不能\r\n親膚觸感外還有沙沙跟啾啾聲，還可以咬咬，一次享受三種玩法\r\n各種年齡層的寶貝都很適合玩，讓臘辣Pizza代替你被咬壞的拖鞋吧 (淚)\r\n\r\n毛孩使用時，請飼主陪同，避免誤食\r\n內含塑膠材質(啾啾聲)，建議以冷水洗滌\r\n產品因包裝不同，使用前請先將包裝撕去\r\n此為消耗性商品，嚴重撕咬導致產品破損時，請盡速將玩具收走，以免家中寶貝吞嚥內容物，若損壞應立即更換\r\n產品請勿靠近火源\r\n根據材質特性和測量方法的不同，會產生1-2cm的誤差\r\n商品顏色因電腦螢幕設定不同而有誤差，以實際商品顏色為主\r\n玩具屬接觸性商品，若非商品瑕疵(如:發聲器無法出聲、脫線等)，拆封後故無法退換貨及退款\r\n出貨前皆會測試發聲器，拆封後若發現無法按壓出聲音，請立即反應給客服', 'pro394.jpg', '2023-08-04 10:33:22', '2023-08-04 10:33:22', 1, 'Mao&Kou 貓與狗', '4.5', '111'),
('DGTO0006', 'G', 'TO', 14, 'D', '貓與狗-香腸嘴咬繩玩具(狗玩具)', '探索宇宙星河 滿足日常好氣心\r\n\r\n●食品級矽膠 使用更安心\r\n●加厚外邊 防止溢出\r\n●質地柔軟 方便收納\r\n●尺寸夠大 貓狗通用\r\n●防滑耐磨 使用穩固\r\n●精緻細節 身臨其境\r\n\r\n尺寸 : 350x500x1.1mm\r\n重量 : 350g', 'pro396.jpg', '2023-08-04 10:35:15', '2023-08-04 10:35:15', 1, 'Mao&Kou 貓與狗', '3.8', '32'),
('DGTO0007', 'G', 'TO', 14, 'D', '貓與狗-寵物藏食發聲玩具 微笑花盆栽 (狗玩具)', '● 由三朵花組成的莖和花盆組成\r\n● 從花瓣到整個莖都沙沙作響的材質\r\n● 刺激寵毛孩朋友們的好奇心\r\n● 背面有可以隱藏零食的X字迷你口袋\r\n使用方法 : 請把零食藏在背面迷你口袋裡，毛孩熟悉後，可在花盆裡藏零食，種花玩耍。\r\n\r\n尺寸 : 24x13x32cm\r\n重量 : 180g\r\n材質 : Polyester 75%, Spandex27%\r\n產品的顏色根據顯示器的規格，可能與實際產品有差異\r\n尺寸根據測量方法和測量位置可能會有誤差\r\n該產品是寵物玩具。 請勿在產品的基本用途以外使用\r\n請勿避開火器、熱氣、高溫或靠近\r\n爲了安全起見，請勿分解、破損，不要使用變形玩具\r\n嚴重咬傷產品破損時，請注意不要讓寵物狗吞嚥內容物\r\n因佩戴及使用商品痕跡導致商品損壞時，不可換貨/退款\r\n在溫水中加入中性洗滌劑或寵物專用洗滌劑，建議手洗後自然乾燥\r\n含有塑料附件（嗶嗶、嗶嗶塑料）的產品建議用冷水洗淨\r\n根據洗滌溫度及洗滌劑不同，可能會掉色或易染，建議單獨洗滌\r\n清洗注意事項 : 涼水手洗、不要用力擰、陰涼地方晾乾、禁止使用漂白劑', 'pro407.jpg', '2023-08-04 10:47:15', '2023-08-04 10:47:15', 1, 'Mao&Kou 貓與狗', '4.3', '30');

