INSERT INTO `activity_info` (`activity_sid`, `activity_type_sid`, `name`, `content`, `schedule`, `policy`, `must_know`, `city`, `area`, `address`, `activity_pic`, `pet_type`, `Initiated_by`, `avg_rating`, `purchase_count`) VALUES
(1, 2, '夏日水樂園', '今夏最大「毛小孩都市水樂園」活動即將在圓山花博公園盛大登場！覺得海太遠？本次活動將舉辦一場夏日水樂園派對，讓您的毛孩一起來玩水濺濕。活動中有泳池派對、水槍大戰和水上滑梯等多項水上活動，讓您和您的寶貝一同嬉戲，消暑解熱！幫你搬過來不用跑到墾丁衝到離島，就在台北圓山捷運站1號出口。歡迎帶毛小孩來參加圓山花博廣場的台北海洋水樂園 現場免費開放寵物游泳池、玩SUP、寵物義剪服務，盡情享受美好午後時光。請自備毛巾，捷運圓山站1號出口世界海洋日台北海洋水樂園、寵物義剪、寵物水上活動、寵物水中跑步、寵物趣味闖關遊戲、寵物自助洗吹體驗現場還有寵物市集～前所未有的都市海洋驚艷 ，歡迎大家一起來共襄盛舉。', '泳池派對--水槍大戰--水上滑梯--寵物泡泡洗澡區--寵物嘉年華攤位', '請攜帶毛巾、換洗衣物，並注意寵物在水中的活動是否安全。特別是對於不擅長游泳或初次接觸水的寵物，更需要小心留意。對於不擅長游泳的寵物，請配戴適合的浮具，如救生衣或浮板。確保活動場所的水深適合您的狗狗和貓咪。對於初次接觸水的寵物，可以提供較淺的水池或濺水區，逐漸讓牠們適應水中活動。在水上活動後，確保給予寵物適當的清潔，同時注意清理耳朵、爪子和其他潛在的感染部位。', '報名前請詳閱活動詳情並確認活動時間。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台北市', '中山區', '玉門街1號', '1.jpg,2.jpg,3.jpg,4.jpg,5.jpg,6.jpg', 2, 0, '4.5', 40),
(2, 3, '大型市集嘉年華', '寵物大型市集嘉年華是一個令人期待的盛大活動，為寵物主人和寵物們帶來了一個絕佳的購物和娛樂體驗。這場市集展覽匯集了各種各樣的寵物用品和產品，提供了一個豐富多樣的選擇，讓您的毛孩們在這個天堂般的場所中享受無盡的樂趣。市集內有各式各樣的攤位，陳列著精美的寵物用品，包括寵物食品、玩具、服飾、床墊、牽繩等等。您可以輕鬆地尋找到符合寵物需求的物品，同時欣賞這些設計獨特且具有高品質的商品。此外，市集還提供了一個交流的平台，讓寵物主人們能夠分享彼此的寵物經驗和建議，豐富彼此的寵物養育知識。', '寵物用品展示和買賣--寵物服裝秀--寵物才藝表演--寵物美容DIY--寵物交流趣', '為了確保寵物大型市集嘉年華的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台北市', '信義區', '信義路五段5號', '50.jpg,51.jpg,52.jpg,53.jpg,54.jpg,55.jpg', 2, 0, '3.0', 15),
(3, 5, '寵物訓練營', '寵物訓練營是一個充滿學習與互動的活動，我們致力於幫助寵物主人建立與毛孩之間的良好關係。在這個訓練課程中，我們將提供一系列的課程內容，包括基本指令訓練、社交技巧培養和問題行為矯正等方面的教學。我們的專業教練團隊將指導您如何溝通與訓練您的寵物，使其成為一個社會化的好夥伴。透過互動遊戲和實踐環節，您將學會如何建立信任、建立良好的行為模式，並與您的毛孩建立深厚的情感連結。這是一個豐富而有趣的學習經驗，讓您和您的寵物共同成長和享受互動的快樂時光。', '基本指令訓練--社交技巧培養--問題行為矯正--互動遊戲及成果驗收', '在寵物訓練營中，我們致力於提供一個安全、愉快和專業的環境，讓您和您的毛孩能夠充分參與和享受訓練活動。為了確保活動的順利進行和所有參與者的安全，請遵守以下活動規範：請攜帶您的寵物的狗繩，以確保寵物的安全。請遵守訓練師的指示，並積極參與訓練活動。請確保您的寵物的疫苗接種和健康狀態符合要求，也請遵守活動時間和地點的安排，準時參加活動。我們希望每一位參與者都能夠享受到有益的訓練體驗，與您的毛孩建立更深的連結和增進彼此之間的理解與溝通。', '報名前請詳閱活動詳情並確認活動時間。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台中市', '西屯區', '文心路789號', '56.jpg,57.jpg,58.jpg,59.jpg,60.jpg,61.jpg', 2, 0, '3.5', 36),
(4, 4, '養護知多少', '在這場養護知多少的講座中，我們將帶您深入了解寵物的健康和養護知識。這場講座專為寵物主人而設，旨在提供有關飲食養生、日常護理、常見疾病和預防措施等方面的寶貴資訊。我們將探討寵物的營養需求，提供飲食建議和養生方法，以確保您的毛孩健康成長。此外，我們將分享日常護理技巧，包括潔毛、牙齒護理和定期檢查等，以維持寵物的整體健康。同時，我們還將介紹常見的寵物疾病和預防措施，以幫助您提前識別和處理可能的健康問題。透過這場講座，您將更深入地了解如何全面照顧您的毛孩，讓他們過上健康、快樂的生活。', '飲食建議和養生方法--日常護理技巧分享--常見疾病和預防措施探討--問答時間', '我們希望為參與者提供一個舒適、專業且互動的環境，為了確保講座的順利進行，請參與者遵守以下規範：請尊重其他參與者和講者，在講座進行期間保持安靜。為了保護講者和其他參與者的隱私權，若要錄音或攝影請事先詢問講師或主辦方。講座內容受到版權保護，請勿未經授權地複製、散佈或公開分享。我們期待與您共同享受這場有益的養護知識講座！', '報名前請詳閱活動詳情並確認活動時間。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '高雄市', '苓雅區', '建國北路987號', '44.jpg,45.jpg,46.jpg,47.jpg,48.jpg,49.jpg', 2, 0, '3.5', 17),
(5, 2, '探索城市奇趣', '在活動中，您將帶著您的毛孩一起展開一場城市探險之旅。我們將帶您遊覽當地的公園、景點和美食地點，讓您和您的毛孩共同體驗城市生活的樂趣！活動中，您將有機會欣賞自然風光，遊覽名勝古蹟，品味當地美食，並與其他寵物主人分享您的寵物寶貝的喜悅。請攜帶足夠的寵物食物和水，並隨時清理寵物排泄物，確保環境的整潔和安全。我們鼓勵您與您的毛孩互動、拍照留念，並一同創造美好的回憶。讓我們一起探索城市的奇趣，與您的毛孩一同享受愉快的時光！', '報到--大會服務處領取手冊--公園漫遊--景點導覽--美食體驗--寵物攝影', '請攜帶足夠的寵物食物和水，確保您的寵物在活動期間能夠得到充足的營養和水分。隨時清理寵物排泄物，保持環境的整潔和衛生。請保持寵物牽繩，確保其在公共場所的安全和控制。盡量避免寵物與其他不認識的寵物接觸，以減少可能的衝突和意外情況。請尊重其他參與者和市民的權益，避免寵物對他人造成不便或困擾。請準時參與活動，遵守活動組織者的安排和指示。如有無法參與活動的情況，請提前通知活動組織者，以便進行調整。', '報名前請詳閱活動詳情並確認活動時間。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '中西區', '府前路321號', '32.jpg,33.jpg,34.jpg,35.jpg,36.jpg,37.jpg', 2, 1, '3.5', 47),
(6, 6, '毛孩瑜珈', '毛孩瑜珈對於飼主以及毛孩的身心靈都是非常有幫助的，可以短時間的增進彼此的感情，在進行瑜珈的動作的同時，飼主有了仰視毛孩或是平視的機會，從而可以培養出互相的尊重以及感情。寵物瑜珈可以改善狗狗待在室內的壓力、情緒不穩…等問題外，主人也可與寵物們一起活動伸展肢體，同時也能夠放鬆身心活動筋骨。大小毛孩都可以參加，課程內容小狗都可以跟著做，但大狗因為體重原因大部分只能在旁邊陪伴，除非主人想試試看也是沒問題的唷！', '熱身--毛孩瑜珈--點心時光--毛孩互動時光', '場地為半戶外，請大家做好防曬。有關節問題或是有攻擊性的毛孩不適合此活動。主人請一定要準備牽繩，禮貌帶不強制，但請隨手清理大小便。毛孩主人應善盡管理之責，狗狗間應保持適當距離互動；任何情況下，飼主都應看顧好愛犬，在活動內所發生之事情由陪同人及飼主自行負責。請毛孩主人在參加活動前先帶狗狗上廁所跟散步一下，避免狗狗直接到現場過度興奮。活動前1-2日建議可以帶去洗澡美容，拍攝時可準備毛孩喜愛的零食與玩具。\r\n', '活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '峨眉鄉', '安平路二段', '24.jpg,27.jpg,28.jpg,29.jpg,25.jpg,26.jpg', 2, 0, '3.8', 12),
(7, 2, '毛孩運動趣', '在這個運動會中，您的寵物將能參加各種有趣的競賽和活動，包括跑步比賽、障礙賽、飛盤接力賽和智力遊戲等。這是一個讓您的毛孩們展示他們的能力和才華的絕佳機會。您可以與其他寵物飼主一起享受社交互動的時刻，交流寵物養育的經驗和知識。這個活動將提供專業的裁判和安全監督，確保所有參與者的安全。請攜帶足夠的飲用水和寵物食物，並注意寵物的行為和安全。我們鼓勵您與您的寵物一同參加這個盛大的寵物運動會，共同創造美好的回憶和難忘的時刻！', '跑步比賽--障礙賽--飛盤接力賽--智力遊戲--頒獎典禮', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '東區', '建國路123號', '57.jpg,58.jpg,59.jpg,60.jpg,61.jpg,62.jpg', 2, 0, '3.0', 16),
(8, 6, '歡樂fun一下', '在公園玩耍的活動內容豐富多樣，您可以帶著毛孩們盡情奔跑、嬉戲和探索。可以進行跑步遊戲，讓您和毛孩一同奔跑在綠茵場地上；也可以玩撲獵遊戲，讓毛孩們追逐飛盤或球玩具；另外，還可以設置障礙物讓毛孩們進行躲避或跳躍，增加遊戲的刺激性和互動性。在公園中，還可以組織小型聚會，讓毛孩們相互交流，並和其他寵物主人分享寵物養育心得和經驗。無論是遊戲、訓練還是社交，公園是一個理想的場所，讓您和毛孩們共同度過愉快而健康的時光。', '跑步遊戲--撲獵遊戲--障礙賽--養育心得和經驗分--歡樂回家趣', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '忠義路456號', '58.jpg,59.jpg,60.jpg,61.jpg,62.jpg,63.jpg', 2, 0, '3.5', 17),
(9, 6, '毛孩水世界', '我們為您的寵物準備了豪華的泳池、水槍大戰、水上滑梯和水中遊戲等多種水上活動，讓您的毛孩可以暢快玩樂、消暑解熱。除了水上活動，毛孩水世界還提供寵物泡泡洗澡區和各種攤位，讓您的寵物能夠享受放鬆和社交的時光。我們重視寵物的安全和健康，請攜帶毛巾、換洗衣物，並注意寵物的行為和安全。在毛孩水世界中，您和您的毛孩將共同度過愉快的時光，創造美好的回憶。這是一個讓您和您的寵物一同嬉戲、享受夏日水樂的絕佳機會。不要錯過這個精彩的活動，讓您的毛孩在毛孩水世界中盡情暢遊！', '泳池派對--水槍大戰--水上滑梯--寵物泡泡洗澡區--寵物嘉年華攤位', '請攜帶毛巾、換洗衣物，並注意寵物在水中的活動是否安全。特別是對於不擅長游泳或初次接觸水的寵物，更需要小心留意。對於不擅長游泳的寵物，請配戴適合的浮具，如救生衣或浮板。確保活動場所的水深適合您的狗狗和貓咪。對於初次接觸水的寵物，可以提供較淺的水池或濺水區，逐漸讓牠們適應水中活動。在水上活動後，確保給予寵物適當的清潔，同時注意清理耳朵、爪子和其他潛在的感染部位。', '報名前請詳閱活動詳情並確認活動時間。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '南區', '和平路789號', '2.jpg,3.jpg,4.jpg,5.jpg,6.jpg,1.jpg', 2, 0, '3.5', 26),
(10, 2, '寵物樂園玩耍場', '寵物樂園玩耍場是一個專為寵物和飼主們設計的活動場所，讓您的毛孩可以盡情奔跑、嬉戲和交流。這個活動提供了各種遊戲和設施，包括寵物溜冰場、障礙挑戰場、球池和迷宮。您可以帶著您的寵物一同參與這些有趣的活動，與其他寵物及飼主建立友誼。活動場地寬敞安全，並提供專業的監控和照顧人員，確保您和您的毛孩的安全與樂趣。不管是小型犬、大型犬還是貓咪，寵物樂園玩耍場都是他們展現活力和享受社交的理想場所。快來和您的毛孩一同體驗這個寵物天堂吧！', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '安平路256號', '59.jpg,60.jpg,61.jpg,62.jpg,63.jpg,64.jpg', 2, 0, '3.5', 19),
(11, 6, '毛孩聚樂日', '您的毛孩可以盡情奔跑、嬉戲和交流。這個活動提供了各種遊戲和設施，活動場地寬敞安全，並提供專業的監控和照顧人員，確保您和您的毛孩的安全與樂趣。不管是小型犬、大型犬還是貓咪，寵物樂園玩耍場都是他們展現活力和享受社交的理想場所。快來和您的毛孩一同體驗這個寵物天堂吧！', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '中正路456號', '60.jpg,61.jpg,62.jpg,63.jpg,64.jpg,65.jpg', 2, 0, '4.5', 19),
