(13, 6, '毛孩Dance起來', '家中寵物是否在家悶壞了？全台哪裡有推薦寵物友善景點可以一起帶狗一日遊呢？是時候一起帶著毛小孩外出放電，來場與寵物旅行吧！防疫期間部分店家或設施營業時間更新，提醒您，若需前往請先與店家或設施管理者詢問，以免抵達之後敗興而歸喔！可以享受無牽繩待遇，正因為如此，前往渡假的朋友不僅要懂得尊重他人，也要懂得禮讓以及尊重其他狗狗，讓狗兒可以和平愉快的享受喔！', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '雙春路551號', '62.jpg,63.jpg,64.jpg,65.jpg,66.jpg,67.jpg', 2, 0, '3.5', 20),
