(15, 2, '一齊來逗陣', '專門為狗兒打造的樂園，有大草原可以讓狗兒自由奔跑，也有專為狗兒設計的戲水池以及狗狗點心，讓狗兒奔跑完還能吃點心補充體力！我們也時常舉辦同種類的狗兒聚會派對，讓狗兒可以在聚會場上找朋友，主人們也可以藉此交流，這裡真的可以稱之為毛小孩的天堂啊！有許多專門為毛小孩設計的設施，像是七星級寵物旅館、寵物美容中心、寵物溫泉游泳池、寵物泡湯池等，餐飲的部分也有推出全家歡套餐，像是兩大一小加一寵的方案等，完全就是狗兒打造的玩耍飽食樂園！', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '林安路二段', '34.jpg,35.jpg,36.jpg,37.jpg,32.jpg,33.jpg', 2, 0, '3.0', 31),
(16, 2, '寵物潮流fun玩', '為友善寵物、響應國際寵物日，特地企劃「寵物專車」活動，寵物全程佩戴胸背帶及牽引繩，可與飼主一起在車廂內自由探索；提醒大家，參加活動前，須完成寵物登記及疾病預防注射(如狂犬病等)，並事先施以除蚤預防藥物；報名截止後，臺北市動保處將審核報名資格，確保乘車寵物健康安全。「寵物專車」活動結束後，將進行列車全面清潔，才會重返線上提供載客服務。為維護車內秩序，犬、貓將分乘不同車廂，每節車廂間安裝寵物柵欄，飼主須全程將寵物繫上胸背帶、牽引繩，寵物專車配有獸醫及寵物行為訓練師隨行，提供必要協助。', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '北園街100號', '35.jpg,36.jpg,37.jpg,32.jpg,33.jpg,34.jpg', 2, 0, '4.5', 26),
(17, 2, '尋寶遊戲', '主人跟狗兒能一起玩的最有趣的遊戲之一就是尋寶遊戲，這個遊戲跟你丟我撿有點像，但狗狗無法先看到球跑去哪裡。讓狗狗先在原地等著，自己先帶著玩具球或零食走開。同樣的，如果狗狗還不太進入狀況想跟著你走，重複「在這裡等！」的指令並忽略牠，直到牠懂得指令的意思—主人要牠先在原地等著。一開始先走開幾公尺就好，放下球後告訴狗兒：可以開始找了！，當狗狗找到時大力稱讚牠，幾次之後增加難度---藏到更難找到的地方，讓狗狗應用牠的靈敏嗅覺找到目標。每次牠成功找到時都該適時給予牠獎勵或讚美，如果還想增加難度，可以在牠沒注意到的時候偷偷弄掉目標物並藏在其他地方，或多藏一些讓牠慢慢找。', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '正覺街', '36.jpg,37.jpg,32.jpg,33.jpg,34.jpg,35.jpg', 2, 0, '3.5', 27),
(18, 2, '2023作伙寵物遊', '當狗狗拿到玩具，等牠視線自然地看向玩具箱時，在箱上拍幾下並稱讚牠，持續幾次後牠會了解「原來這樣做主人就會稱讚我，那我要常常這樣！」往後幾次的訓練引導牠漸漸靠近玩具箱，直到牠會將玩具帶到箱旁。接下來，最難的部分就是如何讓牠學會自己把玩具放進箱子裡，這很需要耐心。重複「做得對就給予稱讚」的方式慢慢地引導牠，狗狗很快就能學會自動自發收拾玩具了。', '寵物交流--主人分享時間--歡樂點心時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '民德路', '37.jpg,32.jpg,33.jpg,34.jpg,35.jpg,36.jpg', 2, 0, '3.5', 7),
(19, 6, '動物森友會', '本次活動包含了許多跟動物保護相關的特技、劇場表演、寵物行為訓練師及寵物鮮食知識講座，也特別規劃了三場的寵物趣味競賽，歡迎市民朋友帶著毛小孩們一同共襄盛舉。提醒您，若需前往請先與店家或設施管理者詢問，以免抵達之後敗興而歸喔！可以享受無牽繩待遇，正因為如此，前往渡假的毛孩們要懂得禮讓以及尊重其他狗狗，讓狗兒可以和平愉快的享受喔！', '劇場表演--寵物行為訓練師經驗談--寵物鮮食知識講座--寵物趣味競賽', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '中華北路一段', '17.jpg,18.jpg,19.jpg,20.jpg,21.jpg,22.jpg', 2, 0, '3.5', 22),
(20, 2, '一起GO歡樂', '本次活動將舉辦一場毛孩聚樂日，讓您的毛孩和其他寵物一起度過愉快的時光。活動包括毛孩社交遊戲、寵物表演和有趣的互動活動。您可以與其他寵物主人交流心得，同時讓您的毛孩享受社交和遊戲的樂趣。請攜帶寵物必需品，並確保寵物的安全和健康。活動現場提供飲料和輕食，讓您在舒適的環境中與毛孩一同度過愉快的時光。報名前請詳閱活動詳情並確認活動時間。如有取消參加需求，請提前24小時通知。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '海安路三段', '18.jpg,19.jpg,20.jpg,21.jpg,22.jpg,17.jpg', 2, 0, '3.5', 14),
(21, 2, '寵愛大聯盟', '歡迎您和您的毛孩參加貓狗同樂會，這是一個讓貓咪和狗狗一起享受樂趣的活動。活動中有貓狗互動遊戲、寵物美容展示和時尚寵物服裝秀等精彩節目。您可以和其他寵物主人分享寵物飼養心得，同時讓您的毛孩在友善的環境中社交和嬉戲。請攜帶寵物必需品，並注意寵物的安全和衛生。活動現場提供寵物餐點和飲品，讓您和您的毛孩在舒適的環境中度過愉快的時光。報名前請詳閱活動詳情並確認活動時間。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '國華街四段', '19.jpg,20.jpg,21.jpg,22.jpg,17.jpg,18.jpg', 2, 0, '4.5', 9),
