(23, 2, '2023吼哩跑跳季', '活動現場特別規畫狗狗行為訓練講座、寵物文創、在地美食、公益宣導等特色市集，增添不同風采樂趣，陪伴民眾與寵物共享美好時光。設置狗狗闖關遊戲區，凡參與比賽都可獲得精美參加好禮，更有機會獲得寵物推車、寵物餵食器、寵物飲水機等多項大獎和現場加碼抽獎的神秘禮品，期待飼主與狗狗們一同把獎項帶回家喔！', '寵物文創--在地美食--公益宣導等特色市集--毛孩fun電時光', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '成功路203號', '21.jpg,22.jpg,17.jpg,18.jpg,19.jpg,20.jpg', 2, 0, '3.5', 12),
