(25, 2, '毛起來玩樂！', '這場活動以寵物公園概念，設置狗狗闖關遊戲區，凡參與比賽都可獲得精美參加好禮，更有機會獲得寵物推車、寵物餵食器、寵物飲水機等多項大獎和現場加碼抽獎的神秘禮品，期待飼主與狗狗們一同把獎項帶回家喔！同時，活動現場特別規畫狗狗行為訓練講座、寵物文創、在地美食、公益宣導等特色市集，增添不同風采樂趣，陪伴民眾與寵物共享美好時光。最後，特別提醒闖關活動需飼主與狗狗一同事先報名，參加犬隻必須已經完成寵物登記、狂犬病疫苗注射及已絕育符合法律犬隻，以及現場飼主也需要自備牽繩確保彼此參與活動安全無虞。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '北區', '公園南路', '43.jpg,41.jpg,42.jpg,38.jpg,39.jpg,40.jpg', 2, 0, '4.5', 8),
(26, 1, '毛孩瘋派對', '讓您的寵物和其他毛孩一起參加這個歡樂的寵物派對！我們將舉辦一系列有趣的活動，讓您和您的寵物度過一個愉快的時光。活動中包括寵物遊戲競賽、寵物服裝秀、食物品嚐和社交互動等節目。您可以觀察到不同品種的寵物，並與其他寵物主人交流分享寵物養育的經驗和故事。請攜帶您的寵物的玩具和食物，並注意寵物的舒適和安全。活動現場提供特別的寵物餐點和小禮物，讓您和您的寵物一同享受派對的快樂氛圍。報名前請詳閱活動詳情並確認活動時間。', '遊戲競賽--寵物服裝秀--食物品嚐--社交互動等節目--主人交流分享', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台北市', '信義區', '光復南路123號', '78.jpg,79.jpg,80.jpg,81.jpg,82.jpg,83.jpg', 2, 0, '3.5', 9),
(27, 3, '夏季寵物用品展', '您將有機會探索各種精彩的寵物用品和產品，讓您的毛孩擁有一個愉快和舒適的夏季。展覽中將展示各種寵物食品、玩具、衣物、美容用品和醫療保健產品，您可以選購最適合您的毛孩的物品。除了買賣展示，我們還將舉辦寵物服裝秀、寵物才藝表演和寵物美容DIY活動，讓您和您的毛孩一同參與。您還可以與其他寵物主人分享寵物養育心得，交流寵物護理技巧。', '寵物服裝秀--寵物才藝表演--寵物美容DIY活動--寵物養育心得交流', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '新北市', '板橋區', '文化路456號', '51.jpg,52.jpg,53.jpg,54.jpg,55.jpg,50.jpg', 2, 0, '3.7', 10),
(28, 1, '瘋狂殭屍PARTY', '歡迎您和您的寵物參加這個獨特的僵屍派對！我們將為您和您的寵物創造一個令人毛骨悚然的派對體驗。活動中包括寵物僵屍裝扮比賽、僵屍遊行和恐怖迷宮探險等刺激有趣的節目。您可以與其他寵物主人分享恐怖體驗，同時讓您的寵物展現可愛的僵屍造型。請攜帶寵物的僵屍裝扮和玩具，並注意寵物的舒適和安全。活動現場提供特殊的寵物餐點和恐怖飲品，讓您和您的寵物在恐怖的氛圍中度過一個令人難忘的夜晚。', '僵屍裝扮比賽--僵屍遊行--恐怖迷宮探險--點心時間--頒獎時間', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台中市', '西屯區', '文心路789號', '79.jpg,80.jpg,81.jpg,82.jpg,83.jpg,78.jpg', 2, 0, '3.5', 7),
(29, 4, '毛孩護理分享會', '我們將分享寵物護理的專業知識和實用技巧，讓您更了解如何照顧和呵護您的毛孩。在這個分享會中，我們將深入探討寵物的飲食養生、日常護理和健康管理等方面的重要主題。您將有機會學習到如何選擇適合的寵物食品、培養良好的日常護理習慣，以及掌握預防常見疾病的方法和技巧。此外，我們還將提供實際案例分享和Q&A時間，讓您能夠獲得專業意見和解答疑惑。請攜帶筆記本和筆記工具，以便記錄重點內容。', '寵物的飲食養生--日常護理--健康管理--預防常見疾病的方法--Q&A時間', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '高雄市', '苓雅區', '建國北路987號', '85.jpg,86.jpg,87.jpg,88.jpg,89.jpg,90.jpg', 2, 0, '3.5', 8),
(30, 1, '驚嚇寵物化妝大賽', '誰說只有人類才能參加化妝比賽？這場獨特的寵物化妝大賽將讓您的寵物成為最酷炫的恐怖造型！在這個活動中，您可以給您的寵物進行特殊的化妝和造型，展現他們的恐怖一面。評審團將選出最具創意和恐怖效果的寵物造型。除了比賽，活動現場還設有餐飲攤位和恐怖主題展覽，讓您和其他寵物主人一同享受恐怖的樂趣。請攜帶寵物的化妝道具和玩具，並注意寵物的舒適和安全。', '報到--比賽規則說明--上半場比賽--中場休息--下半場比賽--點心時間--頒獎典禮', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '中西區', '府前路321號', '80.jpg,81.jpg,82.jpg,83.jpg,78.jpg,79.jpg', 2, 0, '4.5', 9),
