(45, 1, '夏日寵物泳池派對', '在這個夏天，讓您的毛孩盡情玩水！我們特別為寵物們準備了一個大型泳池派對。您的寵物可以在清涼的水中暢快遊玩，還有水上滑梯、泳池籃球等水上遊戲等待著它們。此外，還有寵物小禮物和特別的水上表演節目等著您。快來和您的毛孩一起享受這個令人興奮的夏日活動吧！', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台南市', '中西區', '府前路156號', '12.jpg,7.jpg,8.jpg,9.jpg,10.jpg,11.jpg', 2, 0, '4.5', 8),
