(47, 4, '寵物行為訓練講座', '這場講座旨在教導寵物主人如何訓練和培養寵物的良好行為。專業的寵物行為訓練師將分享訓練技巧和策略，幫助您建立與您的毛孩之間的良好互動和信任關係。讓您的毛孩成為社會化的好夥伴。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '台中市', '南區', '建國南路123號', '88.jpg,89.jpg,90.jpg,85.jpg,86.jpg,87.jpg', 2, 0, '4.5', 6),
(48, 5, '快樂寵物學校', '快樂寵物學校是一所專業的寵物訓練學校，致力於提供高品質的訓練和教育服務。我們的課程包括基礎指令訓練、社交化訓練、問題行為矯正等方面的內容。我們採用正向訓練方法，鼓勵寵物學員通過遊戲和獎勵來學習和成長。讓您的毛孩在快樂和友善的環境中學習，成為聽話和友好的寵物伴侶。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '桃園市', '八德區', '中華路190號', '89.jpg,90.jpg,85.jpg,86.jpg,87.jpg,88.jpg', 2, 0, '3.5', 8),
(49, 6, '寵物美容DIY工作坊', '在這個DIY工作坊中，您將學習如何為您的寵物進行基本的美容護理。專業美容師將教授您如何洗澡、修剪指甲和梳理寵物的毛髮。您可以親自動手，讓您的毛孩在家也能保持整潔和迷人的外觀。', '主人分享時間--毛孩fun電時光--整理行囊', '為了確保寵物活動的順利進行，我們制定了以下活動規範。首先，請確保您的寵物已接受基本訓練並保持良好的行為，以確保場內其他參與者的安全。請攜帶寵物的食物和水，並隨時清理寵物的排泄物。請綁牢狗狗的狗繩，讓他們在市集內保持受控制的狀態。禁止攜帶其他非寵物動物進入市集範圍。最後，請尊重其他參與者和攤位的隱私和財物安全。謝謝您的合作，讓我們一起享受這個難忘的寵物盛會！', '活動現場將提供免費停車位300個，不接受預約。活動地區除遇大豪雨特報或颱風影響宣布停班停課、集會遊行等不可抗力之天災、人為因素、行政院環保署空氣品質指標達危害等級或活動單位公告延期外，其活動皆照常舉行。倘遇上述原因導致活動延期，因而無法參加者，所繳交之報名費，主辦（執行）方應扣除已代辦或支出費用後，將餘額退回。倘遇上述原因導致活動未能舉辦，報名費將以5折退回。如有贈送禮品商，禮品最終材質、尺寸等，可能因製造時程、活動內容規劃等因素而有些許不同，主辦單位保留微調或更換之權利。', '桃園市', '中壢區', '三芝路89號', '45.jpg,46.jpg,47.jpg,48.jpg,49.jpg,50.jpg', 2, 0, '3.5', 8),
