INSERT INTO `activity_wish` (`activity_wish_sid`, `member_sid`, `name`, `city`, `area`, `content`, `other_message`, `wish_date`) VALUES
(1, 'mem00021', '貓貓教育活動', '台北市', '中山區', '想要辦貓貓際遇的活動～～不管新手貓奴還是有多年經驗的貓友，都可以來參加這個有趣且富有教育意義的活動。希望可以了解如何給您的貓咪進行基本的日常護理，包括梳毛、修甲和牙齒清潔。如果有專家將分享關於貓咪行為的知識，並提供實用的解決方案來處理常見的行為問題那就更好了。大家也可以一起分享自己養貓的經驗和故事。', NULL, '2023-06-09 14:18:54'),
(2, 'mem00022', '狗狗派對', '台中市', '南區', '狗狗們可以盡情奔跑、玩耍和互動。希望可以有各種有趣的遊戲和障礙，讓您的狗狗們能夠展現他們的活力。不僅是狗狗有點心可以吃，主人們也可以在這裡品嚐到美味的食物和飲品。中場會有一個狗狗服裝秀！讓狗狗有機會贏得大獎，展示他們的個性和風格。請投我一票吧～～', NULL, '2023-07-12 15:49:28'),
(3, 'mem00023', '貓狗相遇活動', '高雄市', '三民區', '這將是一個促進不同寵物間友好交流的好機會，讓貓咪和狗狗們可以在愉快的氛圍中互相認識、互動。貓狗們可以在專門設置的區域自由漫遊，相互交流。選擇安全的環境，確保每隻寵物都能舒適愉快地參與活動。設置各種有趣的遊戲和障礙，讓您的貓咪和狗狗們一同參與，展現他們的機智和活力。這是一個可以讓毛孩大玩特玩得好機會，走過路過絕對不要錯過～～！', NULL, '2023-07-07 00:00:00'),
(4, 'mem00024', '寵物美容比賽', '台北市', '大安區', '我計畫舉辦一場寵物美容比賽，展示寵物的美麗與風采。', NULL, '2023-08-07 00:00:00'),
(5, 'mem00025', '貓狗健康講座', '台中市', '北區', '我打算舉辦一場貓狗健康講座，分享養護寵物的相關知識。', NULL, '2023-08-01 00:00:00'),
(6, 'mem00026', '狗狗聚會', '台北市', '信義區', '我想組織一場狗狗聚會，讓狗狗們互相認識並建立友誼。', '活動地點：陽明山公園，請攜帶狗狗的玩具和食物。', '2023-07-25 00:00:00'),
