INSERT INTO `post_comment` (`comment_sid`, `post_sid`, `member_sid`, `parent_sid`, `comment_content`, `comment_date`, `create_time`) VALUES
(1, 1, 'mem00277', 0, '試著換一種口味的食物看看，或者試著用手餵食。希望您的貓咪能盡快恢復食慾！', '2022-09-24 10:15:27', '2023-07-12 15:11:41'),
(2, 1, 'mem00278', 0, '或許貓咪有些不適，建議您帶牠去看獸醫做個檢查，以確認牠的健康狀況。', '2022-09-25 14:20:19', '2023-07-12 15:11:41'),
(3, 1, 'mem00254', 0, '貓咪可能不喜歡現在的食物，可以試試其他品牌或口味的貓糧。', '2022-09-26 09:45:36', '2023-07-12 15:11:41'),
(4, 1, 'mem00292', 0, '貓咪可能有些疲倦，給牠提供一個安靜舒適的環境，讓牠休息一下。', '2022-09-27 17:30:48', '2023-07-12 15:11:41'),
(5, 1, 'mem00266', 0, '您可以嘗試添加一些湯汁或罐頭食品到貓咪的食物中，看看是否能引起牠的食慾。', '2022-09-28 11:55:13', '2023-07-12 15:11:41'),
(6, 1, 'mem00255', 0, '貓咪可能有些焦慮，可以試試使用一些貓咪玩具或進行互動遊戲，轉移牠的注意力。', '2022-09-29 16:40:05', '2023-07-12 15:11:41'),
(7, 1, 'mem00279', 0, '或許貓咪有些口腔不適，可以檢查一下是否有口臭或牙齦紅腫的情況。', '2022-09-30 12:05:39', '2023-07-12 15:11:41'),
(8, 1, 'mem00261', 0, '貓咪可能因為環境變化或壓力而失去食慾，嘗試提供一個安靜穩定的環境給牠。', '2022-10-01 15:50:42', '2023-07-12 15:11:41'),
(9, 1, 'mem00263', 0, '有些貓咪比較挑食，您可以試著提供一些新鮮的食材，如蒸熟的雞肉或魚肉。', '2022-10-02 13:25:59', '2023-07-12 15:11:41'),
(10, 1, 'mem00283', 0, '或許貓咪需要一些時間來適應新的食物，持續觀察並給予一些耐心。', '2022-10-03 18:10:21', '2023-07-12 15:11:41'),
(11, 2, 'mem00260', 0, '你可以考慮尋找寵物旅館或寵物托管服務，他們提供專業的寵物照顧服務，可以照顧你的狗狗並提供舒適的住宿環境。', '2023-01-14 09:25:34', '2023-07-12 15:22:53'),
(12, 2, 'mem00252', 0, '你可以詢問身邊的朋友或家人，看看是否有人願意照顧你的狗狗，這樣可以確保你的狗狗在熟悉的人身邊得到照顧。', '2023-01-15 10:35:19', '2023-07-12 15:22:53'),
(13, 2, 'mem00282', 0, '你可以嘗試預訂寵物友善的飯店，這些飯店通常提供寵物專用的住宿設施，讓你的狗狗和你一起入住。', '2023-01-16 11:50:43', '2023-07-12 15:22:53'),
(14, 2, 'mem00295', 0, '你可以找尋當地的寵物寄養家庭，他們通常是寵物愛好者，提供家庭式的寵物照顧服務，讓你的狗狗有個溫暖的家。', '2023-01-17 12:45:51', '2023-07-12 15:22:53'),
(15, 2, 'mem00257', 0, '你可以考慮雇用寵物保姆，他們會到你的家中照顧你的狗狗，讓牠在熟悉的環境中得到照顧。', '2023-01-18 13:55:27', '2023-07-12 15:22:53'),
(16, 2, 'mem00297', 0, '你可以參考寵物園區或寵物遊樂場，這些地方通常提供住宿服務，並且有專業的工作人員照顧你的狗狗。', '2023-01-19 15:10:18', '2023-07-12 15:22:53'),
(17, 2, 'mem00266', 0, '你可以在寵物社群或網路上尋找志願者，他們願意提供寵物寄養服務，讓你的狗狗在有愛心的人身邊度過假期。', '2023-01-20 16:25:39', '2023-07-12 15:22:53'),
(18, 2, 'mem00273', 0, '你可以找尋專業的寵物旅行社，他們可以為你安排完善的寵物旅行計劃，包括狗狗的住宿安排。', '2023-01-21 17:40:56', '2023-07-12 15:22:53'),
(19, 2, 'mem00259', 0, '你可以考慮找尋寵物保姆網站或應用程式，這些平台上有許多註冊的寵物保姆，你可以挑選合適的人照顧你的狗狗。', '2023-01-22 19:05:32', '2023-07-12 15:22:53'),
(20, 2, 'mem00288', 0, '你可以詢問當地的寵物訓練中心，他們通常提供寄養服務，並有專業的訓練師照顧你的狗狗。', '2023-01-23 20:30:44', '2023-07-12 15:22:53'),
(21, 3, 'mem00267', 0, '我也去過八里左岸河濱公園，真的是個很棒的寵物友善景點！我的狗狗非常開心地在那裡奔跑玩耍。', '2022-11-18 11:10:25', '2023-07-12 15:32:38'),
(22, 3, 'mem00292', 0, '八里左岸河濱公園的風景真的很美，特別適合帶著寵物一同享受大自然的美景和新鮮空氣。', '2022-11-16 12:20:37', '2023-07-12 15:32:38'),
(23, 3, 'mem00278', 0, '我也帶著我的貓咪去八里左岸河濱公園散步，牠好像對河邊的鳥兒特別感興趣，一直盯著它們看。', '2022-11-16 13:35:41', '2023-07-12 15:32:38'),
(24, 3, 'mem00252', 0, '這個景點真的非常適合寵物，我在那裡看到了很多人帶著不同種類的寵物一同享受戶外活動。', '2022-11-16 14:45:52', '2023-07-12 15:32:38'),
(25, 3, 'mem00264', 0, '我在八里左岸河濱公園度過了一個美好的下午，和我的狗狗散步、奔跑，享受了很多快樂時光。', '2022-11-16 16:00:14', '2023-07-12 15:32:38'),
(26, 3, 'mem00285', 0, '八里左岸河濱公園真的是一個很棒的寵物友善景點！我已經計劃下次再帶我的狗狗去玩。', '2022-11-16 17:15:29', '2023-07-12 15:32:38'),
(27, 3, 'mem00255', 0, '八里左岸河濱公園的環境非常乾淨整潔，有很多綠地可以供寵物奔跑，非常適合遠離都市的喧囂。', '2022-11-16 18:30:43', '2023-07-12 15:32:38'),
(28, 3, 'mem00299', 0, '我在八里左岸河濱公園度過了一個輕鬆愉快的週末，寵物友善的環境讓我和我的狗狗都非常放鬆。', '2022-11-16 19:45:57', '2023-07-12 15:32:38'),
(29, 3, 'mem00272', 0, '我也聽說八里左岸河濱公園是一個很棒的寵物友善景點，下次一定要帶著我的寵物去探索一下！', '2022-11-16 20:55:11', '2023-07-12 15:32:38'),
(30, 3, 'mem00261', 0, '我非常喜歡八里左岸河濱公園的寵物友善氛圍，大家都很尊重彼此，讓我和我的狗狗都感到舒適。', '2022-11-16 22:10:26', '2023-07-12 15:32:38'),
(31, 3, 'mem00257', 0, '我剛去過八里左岸河濱公園，真的是個很棒的寵物友善景點！我的狗狗在那裡玩得超開心。', '2022-11-16 11:57:31', '2023-07-12 15:35:23'),
(32, 3, 'mem00264', 0, '八里左岸河濱公園的風景真的美不勝收，特別是在傍晚時分，金色的陽光照射在河面上，非常漂亮。', '2022-11-16 13:10:45', '2023-07-12 15:35:23'),
(33, 3, 'mem00282', 0, '我也在八里左岸河濱公園看到了很多人帶著寵物，大家都相互尊重，形成了一個和諧愉快的氛圍。', '2022-11-16 14:25:57', '2023-07-12 15:35:23'),
(34, 3, 'mem00296', 0, '我帶著我的貓咪去八里左岸河濱公園散步，牠非常喜歡這裡的環境，一直在追逐著蝴蝶玩耍。', '2022-11-16 15:40:12', '2023-07-12 15:35:23'),
(35, 3, 'mem00279', 0, '八里左岸河濱公園是個適合全家一起去的地方，不僅可以放鬆心情，還可以讓寵物享受自由奔跑的樂趣。', '2022-11-16 16:55:24', '2023-07-12 15:35:23'),
(36, 3, 'mem00291', 0, '我在八里左岸河濱公園散步時，遇到了其他寵物主人，大家都很友善，分享了一些寵物養育的心得。', '2022-11-16 18:10:36', '2023-07-12 15:35:23'),
(37, 3, 'mem00273', 0, '八里左岸河濱公園的環境非常乾淨整潔，還有許多垃圾桶供人們隨手丟棄寵物的廢棄物，非常貼心。', '2022-11-16 19:25:48', '2023-07-12 15:35:23'),
(38, 3, 'mem00268', 0, '八里左岸河濱公園的遊樂設施也很多，不僅有寵物專用的運動區，還有供孩子玩耍的遊樂場，非常適合全家一同前往。', '2022-11-16 20:40:53', '2023-07-12 15:35:23'),
(39, 3, 'mem00288', 0, '我在八里左岸河濱公園度過了一個輕鬆愉快的周末，和我的狗狗一起享受了大自然的美景和寵物友善的環境。', '2022-11-16 21:55:07', '2023-07-12 15:35:23'),
(40, 3, 'mem00275', 0, '八里左岸河濱公園的空氣清新，綠樹成蔭，非常適合帶著寵物散步或慢跑，享受大自然的恩賜。', '2022-11-16 23:10:21', '2023-07-12 15:35:23'),
