INSERT INTO `post_list_member` (`post_sid`, `member_sid`, `board_sid`, `post_title`, `post_content`, `post_date`, `post_type`, `pet_sid`, `update_date`, `post_status`) VALUES
(1, 'mem00300', 1, '我的貓咪不吃飯怎麼辦？', '我的天啊！我的貓咪最近一直不吃飯，這真的讓我超級緊張，不知道該怎麼辦了！我已經嘗試了各種方法，包括換食物、手餵，甚至給了牠一些特別的零食，但貓咪就是不肯碰食物！這情況已經持續好幾天了，我真的不知道該怎麼辦才好！\r\n\r\n我現在真的是搞不懂貓咪到底發生了什麼事，為什麼突然對食物變得如此抗拒？難道牠生病了？還是受了什麼驚嚇？我完全不知道該從哪裡下手。\r\n\r\n我決定向大家尋求幫助和建議！如果有人曾經經歷過類似的情況，請告訴我該怎麼辦！我實在是太擔心我的貓咪了，我真的希望牠能盡快恢復食慾，變回那個活力滿滿的貓咪！\r\n\r\n請大家幫幫我！如果你們有任何建議或經驗，請在下方留言告訴我！我真的非常需要你們的幫助，因為我不知道該怎麼辦才好！謝謝大家！', '2023-08-07 13:31:56', 'P01', NULL, '2022-09-24 09:20:34', 0),
(2, 'mem00271', 2, '想給我的狗狗找個好住宿', '我最近想出國玩，但是不知道要怎麼安排狗狗的住宿，想請問大家有什麼好的建議嗎？謝謝大家～', '2023-08-07 20:03:25', 'P01', NULL, '2023-01-12 15:17:56', 0),
(3, 'mem00236', 3, '推薦新北市寵物友善景點-八里左岸河濱公園！', '我們最近去了一個很棒的寵物友善景點，大家一定要去看看！\r\n就在新北市的「八里左岸河濱公園」！ 位於新北市八里區，擁有寬闊的河濱綠地，提供了許多活動和休憩空間，非常適合您和寵物一同享受戶外活動。\r\n\r\n在八里左岸河濱公園，您可以帶著寵物散步在寬敞的草地上，讓牠盡情奔跑和玩耍。此外，公園內還有專為寵物設計的運動區，您可以帶著寵物進行訓練或遊戲。公園也提供寵物專用的垃圾桶和清潔區域，方便您處理寵物的廢棄物。\r\n\r\n八里左岸河濱公園的風景非常美麗，您可以在河邊漫步，欣賞壯麗的河景和周遭的自然景觀。公園內也設有休憩區和露天座位，您可以坐下來休息，享受寧靜的時光。\r\n\r\n重要的是，在前往八里左岸河濱公園時，請確保遵守公園的寵物管理規定，例如牽繫寵物的繩索，清理寵物的廢棄物，並尊重其他公園使用者的權益。\r\n\r\n八里左岸河濱公園提供了一個寵物友善的環境，讓您和您的寵物共同享受戶外活動和大自然的美景。希望您和您的寵物在這裡度過愉快的時光！', '2022-11-16 10:45:22', 'P01', NULL, '2022-11-17 14:12:40', 0),
(4, 'mem00210', 4, '想找個安親托管狗狗', '我最近要出差，想找個可信的安親托管狗狗的地方，求推薦！', '2023-02-23 09:36:17', 'P01', NULL, '2023-02-24 11:40:45', 0),
(5, 'mem00202', 5, '狗狗貓咪交流板！', '大家有沒有養多種寵物的經驗呢？一起來分享交流吧！', '2023-04-05 14:20:31', 'P01', NULL, '2023-04-06 16:18:13', 0),
(6, 'mem00252', 6, '來分享我家毛孩的日常！', '我家毛孩最近特別喜歡玩球，大家也可以試試看！', '2022-10-15 16:55:03', 'P01', NULL, '2022-10-17 09:08:32', 0),
(7, 'mem00229', 7, '學校推薦！', '我推薦一下某寵物學校，老師教學非常用心，學生學習成效也非常好！', '2023-03-17 11:30:10', 'P01', NULL, '2023-03-20 09:08:32', 0),
(8, 'mem00210', 1, '狗狗吃錯東西，該怎麼處理？', '最近我家狗狗誤食了巧克力，我十分擔心牠的身體狀況。經過與寵物醫院的討論，我發現狗狗誤食巧克力會引起中毒的風險。建議各位狗狗主人要注意給狗狗食用適合的食物，並及時到寵物醫院進行處理。', '2022-09-22 17:42:13', 'P01', NULL, '2022-09-23 11:30:20', 0),
(9, 'mem00253', 2, '寵物旅館的選擇', '每當要出門旅行時，我最困擾的就是如何安置我的毛孩。最近，我詢問了幾家寵物旅館，發現寵物旅館的設備與品質也是千差萬別的，建議大家選擇前一定要做好功課。', '2022-10-07 09:18:56', 'P01', NULL, '2022-10-08 14:20:42', 0),
(10, 'mem00298', 3, '帶狗狗去山區遊玩的注意事項', '山區空氣清新，是遛狗的好去處。然而，山區也有諸多危險，狗狗在山區中要注意踩踏區域，避免跌倒。而且山區狼狽較多，要保護好狗狗的安全，建議繫上狗狗的鐵鏈，避免狗狗因為好奇心跑走或迷路。', '2022-11-18 14:30:10', 'P01', NULL, '2022-11-19 09:15:22', 0),
(11, 'mem00211', 3, '北海道有哪些寵物友善景點？', '北海道是日本一個非常適合寵物旅行的地方，不僅有美麗的風景，還有許多寵物友善的景點。例如旭山動物園、小樽運河、美深湖等等，都是寵物主人和毛孩子們非常喜愛的旅遊景點。不過，前往這些景點前要確認場所是否允許進入寵物，以及詳細的進入條件和規定。', '2023-01-18 11:47:08', 'P01', NULL, '2023-04-22 14:02:19', 0),
(12, 'mem00245', 1, '寵物牙齒保健', '寵物的口腔健康和人類一樣重要，若不好好照顧寵物的口腔衛生，可能會引發各種疾病，如口臭、蛀牙、牙周病等等。所以要定期幫寵物刷牙，選擇適合的口腔保健產品，還要定期檢查寵物的口腔健康狀況，讓寵物有健康的口腔環境。', '2022-09-22 09:32:57', 'P01', NULL, '2023-03-06 15:23:44', 0),
(13, 'mem00295', 2, '寵物住宿的注意事項', '寵物住宿時需要注意的事項很多，例如要確認住宿場所是否符合標準，適不適合寵物入住，還要關注住宿場所的安全措施，以及是否提供寵物的飲食、運動等服務。此外，如果寵物有特殊需求，例如需要特殊的藥物或者照顧，也需要事先和住宿場所溝通，以確保寵物能夠得到適當的照顧。', '2023-04-05 18:21:13', 'P01', NULL, '2023-04-08 09:12:27', 0),
(14, 'mem00257', 1, '狗狗兔兔飼養不宜', '有些人會把狗狗和兔兔放在一起飼養，但是這是不推薦的。因為狗狗會追趕和攻擊兔子，這樣會給兔子帶來很大的壓力，可能導致兔子受傷或死亡。另外，狗狗和兔兔的營養需求也不一樣，如果放在一起飼養，就很難滿足它們的營養需求。所以，如果你有狗狗和兔兔，最好還是分開飼養。', '2023-04-09 06:26:09', 'P01', NULL, '2023-05-10 08:13:04', 0),
(15, 'mem00300', 1, '飼養貓咪的注意事項', '飼養貓咪是很多人的喜愛，但是要注意以下幾點：\r\n\r\n1. 食物：貓咪不能吃巧克力、洋蔥、大蒜、咖啡因等人類食品，還要避免太多的魚類和豬肉，以免引起營養失衡。\r\n\r\n2. 環境：貓咪需要一個乾淨、安靜、舒適的環境，避免讓它們感到緊張和焦慮。\r\n\r\n3. 疫苗：貓咪需要接種必要的疫苗，以防止某些疾病的發生。\r\n\r\n4. 護理：貓咪需要定期梳毛、洗澡和修剪爪子，這樣可以保持其健康和清潔。', '2022-11-19 00:50:21', 'P01', NULL, '2022-11-20 05:14:38', 0),
(16, 'mem00238', 1, '貓咪心理健康：你的貓咪需要治療嗎？', '貓咪是不會說話的，但牠們也有情感和行為問題。有些問題可能需要治療，例如焦慮症、憂鬱症和強迫症等。貓咪的治療方法有許多種，包括藥物治療、行為治療和心理治療等。如果你的貓咪有任何行為或情感問題，建議儘早找醫師進行評估，以便找到最適合的治療方式。', '2022-09-24 14:25:32', 'P01', NULL, '2022-09-25 10:12:45', 0),
(17, 'mem00242', 1, '寵物看診小貼士：如何減少狗狗在診所的緊張情緒？', '對於一些狗狗來說，看診是一個非常緊張的體驗。這裡提供幾個減少狗狗在診所緊張情緒的小貼士：\r\n\r\n1. 練習帶狗狗出門，熟悉新環境\r\n2. 為狗狗帶上口罩或遮眼罩，讓牠感到更安全\r\n3. 帶著狗狗到診所散步，熟悉環境\r\n4. 給予獎勵和鼓勵\r\n\r\n透過以上的方法，可以讓狗狗在診所感到更加輕鬆和安全。', '2022-11-06 09:17:24', 'P01', NULL, '2022-11-07 08:20:10', 0),
(18, 'mem00279', 2, '假日遠足好去處：清境萊茵花田寵物旅館', '位於台灣南投縣仁愛鄉的清境萊茵花田寵物旅館，是一個非常適合寵物和家人一起度過假日的好去處。旅館內設備齊全，有寵物友善客房，適合全家大小帶著毛孩一起旅遊！', '2023-01-06 09:17:24', 'P01', NULL, '2023-01-07 08:20:10', 0),
(19, 'mem00210', 1, '我的貓咪生病了', '最近我的貓咪生病了，不知道該怎麼辦？有沒有人有類似的經驗呢？', '2022-09-01 12:34:56', 'P01', NULL, '2022-09-02 13:45:23', 0),
(20, 'mem00211', 1, '如何餵養貓咪', '想養貓咪的人一定都很關心如何餵養貓咪，這裡分享一些養貓咪的心得。', '2022-09-03 14:56:32', 'P01', NULL, '2022-09-05 09:12:14', 0),
(21, 'mem00212', 11, '貓咪的睡姿', '貓咪的睡姿真是太可愛了，我家貓咪喜歡趴在電視機旁邊睡覺，不知道大家的貓咪都有什麼奇怪的睡姿呢？', '2022-09-07 17:23:45', 'P01', NULL, '2022-09-08 10:11:09', 0),
(22, 'mem00213', 1, '貓咪的玩具', '貓咪喜歡玩什麼玩具呢？我家的貓咪很愛玩球，還會自己撿回來，有點像小狗。', '2022-09-10 09:32:21', 'P01', NULL, '2022-09-12 16:24:35', 0),
(23, 'mem00214', 2, '寵物旅館推薦', '最近想帶寵物出去旅遊，但是不知道哪些旅館是寵物友善的，有人可以推薦一下嗎？', '2022-09-15 11:44:56', 'P01', NULL, '2022-09-17 08:36:27', 0),
(24, 'mem00215', 2, '旅行中如何照顧寵物', '帶寵物去旅行需要注意很多事情，像是飲食、住宿、散步等等，這裡提供一些旅行中如何照顧寵物的建議。', '2022-09-18 15:22:11', 'P01', NULL, '2022-09-20 14:31:09', 0),
(25, 'mem00209', 1, '夏季寵物健康小常識', '天氣炎熱，寵物的身體健康非常重要。夏季常見的問題有哪些呢？如何預防？這里有一些小貼士，讓您的毛孩可以度過一個愉快的夏季。', '2023-04-12 10:34:25', 'P01', NULL, '2023-05-01 11:23:17', 0),
(26, 'mem00259', 1, '毛孩常見病症及處理方法', '寵物病症常見，您是否遇到過？那麼在家裡該怎麼處理呢？這里為您提供一些簡單實用的處理方法，讓您的毛孩能夠在家得到適當的治療。', '2022-12-10 08:21:09', 'P01', NULL, '2022-12-11 16:47:53', 0),
(27, 'mem00276', 1, '毛孩身上發現蟲子怎麼辦？', '看到毛孩身上有蟲子，您是不是也會很擔心？那麼該怎麼辦呢？這里提供了一些常用的處理方法，幫助您快速解決這個問題。', '2023-02-28 14:56:34', 'P01', NULL, '2023-03-02 09:11:28', 0),
(28, 'mem00298', 2, '外出旅行寵物住宿該注意什麼？', '要出去玩，寵物住宿該注意什麼呢？這里為您提供了一些小貼士，幫助您選擇合適的寵物住宿，讓毛孩們在外也能得到良好的照顧。', '2023-01-23 17:09:43', 'P01', NULL, '2023-01-24 09:12:55', 0),
(29, 'mem00270', 1, '寵物健康你我有責', '寵物是我們家庭的一份子，牠們帶給我們歡笑和快樂。然而，隨著人們對於寵物的飼養需求增加，寵物醫療也越來越受到關注。作為主人，我們必須了解寵物醫療的重要性，以確保毛孩們的健康和幸福。\r\n\r\n寵物醫療包括預防保健、診斷和治療，能夠提供牠們全面的健康保障。疫苗接種、定期體檢、牙齒清潔、寄生蟲預防、疾病治療等等，都是寵物醫療的重要內容。而當我們的毛孩生病或受傷時，也需要及時就醫，接受專業的治療和護理，以免造成更大的傷害。', '2023-05-12 15:42:34', 'P01', NULL, '2023-05-19 00:09:06', 0),
(30, 'mem00280', 2, '毛小孩住宿的全新體驗啦啦啦', '當您出門旅行或是有緊急事情需要處理時，有時候無法帶著毛孩一同出門。這時候，尋找一個安全、舒適、有良好口碑的寵物住宿場所是非常重要的。\r\n\r\n寵物住宿場所能夠提供您的毛孩一個安全舒適的環境，在您不在身邊的時候照顧他們的需求。這裡有專業的工作人員，會確保您的毛孩得到良好的照顧和保護，包括飲食、運動、清潔、玩耍等方面。\r\n\r\n此外，寵物住宿場所也為您的毛孩提供了社交和互動的機會，讓牠們與其他的毛孩相處，建立友誼和信任。這對於社交能力較差或是需要更多關注的毛孩來說，是非常有益的體驗！\r\n\r\n', '2023-05-12 15:53:53', 'P01', NULL, '2023-05-19 11:20:03', 0),
(31, 'mem00300', 3, '寵物友善景點，帶上毛孩一起探索！', '您是否經常面臨出門旅行卻無法帶著毛孩的困擾？現在，越來越多的景點開始接受寵物進入，成為了寵物友善景點。這些景點提供了各種不同的活動和設施，讓您和您的毛孩一起探索新的地方和體驗新的冒險！\r\n\r\n無論是海灘、公園、湖泊還是山區，都有許多寵物友善的景點，讓您可以享受美好的時光和自然風光，同時與毛孩一起共度美好時光。在這些景點中，您可以帶著毛孩一起散步、運動、游泳、釣魚、露營等等，一起體驗美好的自然風光和活動。\r\n\r\n', '2023-05-12 15:55:36', 'P01', NULL, '2023-05-15 16:07:46', 0),
(32, 'mem00300', 11, '寵物安親，讓您出門無憂！', '寵物安親是一種為主人解決寵物照顧問題的服務。當您需要外出旅行、上班、或其他事情時，您可以將寵物交給專業的寵物安親人員照顧，讓您出門無憂，寵物也能得到妥善的照顧和關愛。\r\n寵物安親通常會提供寵物定期餵食、散步、清潔和玩耍等服務，並能夠解決寵物在主人不在身邊時可能出現的問題，例如寂寞、憂鬱、失控等等。同時，寵物安親還能夠及時發現和處理寵物的健康問題，確保寵物健康和安全。\r\n如果您需要寵物安親的服務，建議您提前和安親人員進行溝通和協商，了解其服務內容、價格和保險等情況。', '2023-05-12 15:58:51', 'P01', NULL, '2023-05-16 16:07:51', 0),
(33, 'mem00300', 5, '號外！5/25在大安森林公園舉辦狗聚', '毛孩爸媽看過來！ 我們即將在5/25在台北市大安森林公園舉辦一場狗聚，邀請各位狗友帶著自己的毛孩一起參加。這場狗聚旨在提供一個讓毛孩們能夠放鬆、自由奔跑的環境，讓牠們有機會與其他狗狗玩耍、社交，並且促進與主人之間更加緊密的關係。\r\n狗聚將在當天上午十點開始，會場將提供各種狗狗玩具、攝影區等等，讓毛孩們可以盡情地奔跑、嬉戲、玩耍，而主人們也可以在這個活動中，和其他狗友們交流分享養狗心得，建立更深厚的友誼。\r\n', '2023-05-12 16:00:09', 'P01', NULL, '2023-05-15 16:07:56', 0),
(34, 'mem00300', 1, '寵愛牠就一起守護牠的健康', '提高寵物醫療意識是非常重要的。我們建議主人們定期帶寵物去接受醫療保健，遵循醫生的建議進行預防和治療，並時刻關注寵物的健康狀況。同時，也要注意給寵物提供安全、舒適的生活環境，避免疾病和傷害的發生。\r\n\r\n如果您還沒有為您的毛孩進行全面的醫療保健，現在就是一個好時機。我們建議您找一家信譽良好、專業的寵物診所，讓您的寵物接受專業的醫療保健。在這裡，您的毛孩將能夠獲得最好的護理和治療，並且您也能夠學到更多有關寵物醫療的知識和技巧。\r\n', '2023-05-12 16:09:34', 'P01', NULL, '2023-05-15 16:08:23', 0),
(35, 'mem00300', 3, '週末帶著毛孩去戶外散散心吧！', '位於新北市瑞芳區的十分瀑布是一個非常適合帶寵物一起前往的景點。整個景區環境寬敞，有許多綠地可以讓寵物休息玩耍，而且在走步道的過程中可以欣賞到瀑布美景，讓您和寵物一起感受大自然的美好。此外，十分瀑布周邊也有一些餐廳提供寵物友善的用餐環境，您可以在享用美食的同時照顧寵物。整體來說，十分瀑布是一個非常寵物友善的景點，值得您和寵物一起前往探索。', '2023-05-12 16:11:02', 'P01', NULL, '2023-05-15 16:08:29', 0),
(36, 'mem00300', 1, '貓狗大作戰，最關心您寶貝的健康', '醫療保健對寵物的健康十分重要，特別是在年紀漸長或身體狀況不佳的情況下。寵物需要定期接受獸醫檢查、接種疫苗、進行牙齒清潔、做骨密度測試等等，以確保身體健康並及早發現任何健康問題。另外，對於經常在室內活動的寵物，預防蚤、蟎等寄生蟲也非常重要。如果您的寵物出現任何不尋常的症狀，請及時帶牠前往獸醫診所檢查。寵物的健康和長壽需要主人的關愛和細心照料，維持健康的生活方式對您的寵物而言也是最好的禮物。', '2023-05-12 16:17:21', 'P01', NULL, '2023-05-15 12:17:41', 0),
(37, 'mem00270', 4, '寵物安親：讓您的毛孩在您不在家時得到最好的照顧', '當您需要短暫離開家時，您可以考慮寵物安親服務。這些服務通常提供安全、寬敞、乾淨的環境，以及有經驗的工作人員照顧您的寵物。許多寵物安親中心還提供活動、遊戲和社交互動，讓您的寵物不會感到無聊或孤單。此外，寵物安親中心也可以提供飲食、定期澡洗和醫療保健等基本服務，讓您可以安心出門，知道您的寵物得到了良好的照顧。如果您需要寵物安親服務，請確保選擇信譽良好的中心，以確保您的寵物得到最好的照顧！', '2023-05-12 16:18:30', 'P01', NULL, '2023-05-15 12:17:32', 0),
(38, 'mem00277', 5, '號外！6/5毛孩運動會，和您的寵物一起運動吧！', '6/5在大佳河濱公園舉辦毛孩運動會，讓您和您的寵物一起運動，享受愉快的時光！本次活動設有多個運動項目，包括狗狗競速、接力賽、攀爬比賽等等，讓您的寵物可以盡情展現自己的風采。同時，還有豐富的獎品等您來拿！\r\n\r\n我們鼓勵所有的寵物主人和寵物一起參加本次活動，讓您的寵物得到運動和社交的機會，同時也可以增進您和寵物之間的感情。本次活動免費參加，歡迎大家踴躍參加！\r\n\r\n時間：6/5（六）9:00-12:00\r\n地點：大佳河濱公園\r\n報名方式：現場報名，免費參加', '2023-05-12 16:20:03', 'P01', NULL, NULL, 0),
(40, 'mem00270', 1, '重視保健，讓您的寵物更健康', '寵物是我們生活中不可或缺的伙伴，因此保護牠們的健康非常重要。除了定期的獸醫檢查和疫苗接種外，寵物還需要做定期的牙齒清潔、身體檢查、血液檢查等。此外，定期檢查眼睛和耳朵的健康狀況，並及時檢查牠們是否感染蚤子、蟎等寄生蟲也很重要。提前預防比事後治療更好，所以寵物醫療保健應該成為寵物主人的日常事務。照顧好寵物的健康，讓牠們健康長壽，與您相伴更長久。', '2023-05-12 17:15:48', 'P01', NULL, '2023-05-13 17:15:48', 0),
(41, 'mem00270', 2, '擔心出國毛孩該怎麼辦嗎？', '在寵物住宿場所中，還有許多額外的服務和活動，例如美容、按摩、訓練等等。您可以選擇合適的服務，為您的毛孩提供最好的照顧和關愛。這也可以讓您更加放心，知道您的毛孩正在得到最好的照顧和關注。', '2023-05-12 17:37:24', 'P01', NULL, '2023-05-15 17:37:24', 0),
(42, 'mem00277', 3, '和您的毛孩一起探索寵物友善景點', '無論是在城市或郊區，寵物友善景點是讓您和您的毛孩共度時光的好地方。寵物友善景點可以是公園、海灘、咖啡館、餐廳等，這些地方允許您的寵物進入，並且提供相應的設施和服務。在這些地方，您可以和您的毛孩享受陽光、呼吸新鮮空氣，還可以和其他寵物和主人們互動。但是，當您帶著寵物外出時，請務必遵守相應的規定，包括拴繩、撿便等等。讓我們一起探索寵物友善景點，讓您和您的毛孩有更多的機會體驗生活的樂趣。', '2023-05-12 17:37:40', 'P01', NULL, '2023-05-17 17:37:40', 0),
(43, 'mem00270', 1, '如何選擇適合自己寵物的醫院？', '選擇適合自己寵物的醫院是非常重要的。你需要考慮的因素包括：距離、獸醫師的資格和經驗、設施和設備、評價等等。你可以詢問其他飼主的意見或網路評論，也可以親自到診所參觀，詢問醫生的經驗和看設施設備是否符合標準。', '2023-05-13 11:53:45', 'P01', NULL, '2023-05-15 15:53:45', 0),
(44, 'mem00270', 2, '看中哪些因素，選擇一家好的寵物旅館？', '選擇一家好的寵物旅館，需要注意幾個因素：首先要考慮旅館的地理位置是否方便，其次要查看旅館的設施和服務，比如房間大小、空調設備、清潔情況等，還要了解旅館的安全措施，比如防盜、防火等。最重要的是要詢問是否有訓練有素的工作人員，他們能夠保障您寵物的安全和健康。', '2023-05-15 11:55:00', 'P01', NULL, '2023-05-17 16:55:00', 0),
(45, 'mem00270', 4, '寵物安親服務是什麼？有什麼優點？', '寵物安親服務是一種照顧寵物的服務，當主人需要離開家時，可以讓寵物在安全、舒適的環境下得到照顧。其優點包括：避免留下寵物孤單、焦慮，不用擔心飼料、水等問題，照顧專業、貼心，寵物可以得到適當的運動和社交。', '2023-05-18 11:55:07', 'P01', NULL, '2023-05-19 11:55:07', 0),
(46, 'mem00270', 1, '常見的狗狗皮膚病及其治療方法', '常見的狗狗皮膚病包括濕疹、皮膚過敏、寄生蟲感染等等。治療方法包括獸醫師的處方藥物、餵食特殊食品、洗澡和清潔等等。但是，最重要的是要找出病因並解決，例如避免食用導致過敏的食物、減少狗狗在戶外暴露於寄生蟲等環境中等。', '2023-05-16 12:06:56', 'P01', NULL, '2023-05-19 12:06:56', 0),
(47, 'mem00270', 2, '如何保證在住宿時寵物的安全和健康？', '當您選擇一家寵物旅館時，請詢問有關寵物的安全和健康措施，比如旅館的獸醫設施、飲食和運動等安排，以確保您的寵物能夠在旅途中得到良好的照顧。此外，您也可以提供寵物相關的資料和照片給旅館，以便他們更好地了解您的寵物，並能夠提供更個性化的服務。', '2023-05-15 12:09:04', 'P01', NULL, '2023-05-16 15:09:04', 0),
(48, 'mem00270', 4, '如何選擇一家好的寵物安親服務？', '選擇一家好的寵物安親服務需要考慮多方面因素，包括設施、環境、服務、照顧人員等。可以查詢評論、詢問朋友、實地考察等方法進行選擇。', '2023-05-17 12:32:00', 'P01', NULL, '2023-05-18 20:47:00', 0),
(49, 'mem00260', 1, '適當的預防措施減少寵物蛔蟲感染', '寵物蛔蟲感染是很常見的問題。狗狗和貓咪會通過進食帶有寄生蟲卵的糞便或食物感染寄生蟲。定期為你的寵物進行除蟲和疫苗接種可以預防寄生蟲感染，另外保持環境清潔也是非常重要的。', '2023-05-17 12:32:00', 'P01', NULL, '2023-05-20 10:47:00', 0),
(50, 'mem00250', 4, '寵物安親服務的設施和服務是什麼？', '寵物安親服務的設施通常包括寬敞的狗舍或貓舍、舒適的睡床、飼料和水的供應、定期運動等。服務通常包括照顧、運動、餵養、洗澡、打掃等。', '2023-05-11 12:32:00', 'P01', NULL, '2023-05-18 10:47:00', 0),
(51, 'mem00270', 2, '給寵物安排住宿：優點和缺點', '寵物住宿的優點是，當您需要離開家時，可以放心地把寵物寄宿在專業的旅館中，讓寵物得到充分的照顧和關注。缺點是，寵物可能會有一些適應上的問題，比如與陌生人相處、環境改變等，需要耐心和時間來調整。因此，在安排住宿之前，請與寵物多做溝通和訓練，以減少這些問題的發生。', '2023-05-15 12:32:00', 'P01', NULL, '2023-05-18 10:47:00', 0),
(52, 'mem00270', 4, '安排寵物安親時需要考慮的事項', '安排寵物安親時需要考慮的事項包括選擇好的安親服務、提供寵物必要的資料、準備好必要的飼料、玩具等，並讓寵物適應新環境。', '2023-05-16 12:32:00', 'P01', NULL, '2023-05-18 19:36:00', 0),
(53, 'mem00270', 1, '寵物牙齒保健：避免龍口咖啡', '不正確的口腔護理會導致狗狗或貓咪出現牙周病和牙齒問題。你可以給寵物提供刷牙、洗牙和口腔清潔等保健方法。還要注意餵食，例如避免給寵物喝咖啡等人類飲料。', '2023-05-16 22:32:00', 'P01', NULL, '2023-05-18 09:36:00', 0),
(54, 'mem00300', 4, '如何讓寵物適應安親服務？', '讓寵物適應安親服務需要一定的時間和耐心。可以提前和照顧人員溝通，讓寵物熟悉環境和人員，帶上寵物喜歡的玩具和飼料，給予關愛和陪伴，並定期探訪。', '2023-05-13 12:50:01', 'P01', NULL, '2023-05-14 16:38:34', 0),
(55, 'mem00270', 2, '寵物住宿和傳統的狗舍有何區別？', '寵物住宿和傳統的狗舍在設施和服務方面有所不同。寵物住宿更加舒適，設施和服務更加多樣化，例如提供寵物美容、寵物營養餐等服務，也更加注重寵物健康管理。傳統的狗舍則是以提供基本餵養和生活環境為主。', '2023-05-13 19:50:01', 'P01', NULL, '2023-05-15 16:38:34', 0),
(57, 'mem00300', 5, ' 寵物大挑戰', ' 你的毛孩準備好挑戰極限了嗎？我們的「寵物大挑戰」等著你們來挑戰！在這個比賽中，你的寵物將會面臨各種不同的挑戰，例如越過障礙、游泳比賽和腦力遊戲等等。這不僅是一個展現你的寵物實力的機會，也是一個可以和你的毛孩一起互動、建立更深層的感情的機會。快來報名參加吧，一起挑戰極限！', '2023-05-13 15:34:46', 'P01', NULL, '2023-05-15 09:47:35', 0),
(58, 'mem00270', 7, '最新課程資訊公告', '親愛的寵物家長您好：\r\n近期寵物學校新增了幾堂課程，包括狗狗從入門到進階的訓練課程、貓咪的行為調教課程，以及小型寵物常見疾病預防課程等。歡迎有需要的寵物家長報名參加，讓您的毛孩有更好的學習體驗。\r\n', '2023-04-01 10:23:41', 'P01', NULL, '2023-04-02 13:45:22', 0),
(59, 'mem00270', 8, '餐廳推薦-貓咪專屬料理', '各位貓奴好！最近有一家新開幕的餐廳，提供了貓咪專屬的餐點。菜單上有各種口味的貓糧、貓罐頭，還有貓咪最愛的鮮肉！就算是貓咪的主人，也可以在這裡點到自己喜愛的餐點。更重要的是，這家餐廳的環境也十分貓咪友善，充滿著貓咪的氛圍，讓您的毛孩也能一同享受用餐樂趣。\r\n', '2023-03-15 14:05:02', 'P01', NULL, '2023-03-16 10:17:42', 0),
(60, 'mem00270', 9, '保養寵物毛髮小技巧', '毛孩的毛髮健康與否關係到寵物的整體健康，以下是幾個保養寵物毛髮的小技巧：\r\n1. 頻繁的梳理可以減少結痕、防止脫髮。\r\n2. 飲食應當均衡，避免缺乏營養。\r\n3. 給寵物洗澡時，不要用人用的洗髮精或肥皂，選用適合寵物的清潔用品。\r\n4. 在熱天裡，可以為寵物修剪過長的毛髮，減少散熱困難。\r\n希望以上小技巧可以各位毛孩爸媽更清楚如何照護自己的毛小孩！', '2023-03-22 14:05:02', 'P01', NULL, '2023-03-23 10:17:42', 0),
(61, 'mem00300', 9, '寵物洗澡技巧分享', '親愛的會員們，我們來聊聊如何幫寵物洗澡吧！首先，選擇適合寵物皮膚的洗澡產品是很重要的，不要用人用的洗髮精和沐浴乳等清潔產品。其次，洗澡水溫要控制在適當的溫度，不要太熱或太冷，以免傷害寵物皮膚。最後，洗完澡後要好好擦乾寵物身上的水分，以免引起感冒等問題。希望這些小技巧能幫助到大家，讓寵物可以健康美麗的生活！', '2023-04-01 12:30:00', 'P01', NULL, '2023-04-02 14:45:00', 0),
(62, 'mem00270', 12, '寵物喪禮的注意事項', '親愛的會員們，今天我們來談談寵物喪禮的注意事項。首先，選擇適合的寵物殯葬方式，可以選擇土葬、火化、水葬等方式，或者選擇相應的骨灰盒，避免負擔過重。其次，選擇好喪禮的時間和地點，給寵物一個安靜、溫馨的告別環境。最後，注意疫情期間的相關防疫措施，保護自己和他人的健康。希望這些注意事項能夠幫助到您，讓寵物可以得到合適的告別方式，安心離去。', '2023-02-20 09:15:00', 'P01', NULL, '2023-02-21 13:20:00', 0),
(63, 'mem00270', 11, '幼貓養成心得分享', '親愛的會員們，這裡是寵物幼貓養成心得分享。首先，提供給幼貓適宜的飼料和適量的水，以保持它們的健康。其次，幼貓需要適當的運動量和遊戲時間，促進它們的成長和發展。最後，訓練幼貓的好習慣，讓貓咪可以更守規矩的成長！', '2023-02-21 09:15:00', 'P01', NULL, '2023-02-21 13:20:00', 0),
(64, 'mem00270', 8, '全新環保餐盒，友善毛孩的選擇', '為了維護地球永續發展，本店推出全新的環保餐盒，以可再利用材質製成，符合友善毛孩的選擇。無論是想要在餐廳內享用美食，或是外帶回家品嚐，都可以選擇使用環保餐盒。除了愛護地球，也愛護毛孩的健康，從餐盒到餐點，全都採用無毒環保材質，讓毛孩吃得健康又安心。', '2023-04-18 12:34:56', 'P01', NULL, '2023-04-19 13:22:08', 0),
(65, 'mem00270', 9, '快來報名寵物按摩體驗課程', '提供最專業的寵物按摩體驗課程，為您的毛孩解除身體緊繃的不適感，放鬆身心，讓牠們更健康快樂。我們的寵物按摩師傳授的按摩技巧不僅可以消除肌肉僵硬疼痛，更能促進血液循環，增強免疫力。每次課程時間約60分鐘，費用合理，歡迎前來報名體驗。', '2023-02-12 09:30:22', 'P01', NULL, '2023-02-13 10:45:12', 0),
(66, 'mem00300', 12, '最具紀念價值的寵物紀念碑墓', '輕鬆打造屬於毛孩的紀念碑墓，讓您和毛孩永遠擁有彼此的回憶。我們提供豐富的墓碑設計選擇，不論是雕刻技巧還是材質，都是一流水準，讓您可以根據毛孩的特質和個性，打造專屬的墓碑。並且，我們提供完整的墓葬服務，從墓碑的設計到選址，都可以幫您妥善安排。讓毛孩在天堂也可以感受到主!', '2023-02-16 09:30:22', 'P01', NULL, '2023-02-18 10:45:12', 0),
(67, 'mem00200', 7, '如何選擇適合自己毛孩的寵物學校？', '寵物學校種類繁多，如何找到最適合自己寶貝的寵物學校呢？', '2023-01-22 08:24:15', 'P01', NULL, '2023-01-23 11:30:00', 0),
(68, 'mem00270', 8, '狗狗也可以來咖啡廳喝咖啡！', '你知道哪裡有寵物友善的咖啡廳嗎？趕快帶著你的毛孩去享受下午茶吧！', '2023-02-01 14:12:10', 'P01', NULL, '2023-02-02 16:55:00', 0),
(69, 'mem00260', 9, '怎樣幫助寵物克服分離焦慮？', '寵物有時候也會出現分離焦慮，不要擔心，這裡有幾種方法可以幫助你的毛孩克服分離焦慮！', '2023-03-12 10:00:00', 'P01', NULL, '2023-03-13 11:30:00', 0),
(70, 'mem00300', 12, '如何面對寵物的離世？', '當寵物離開人世時，主人該怎麼做？這裡有幾點小建議可以幫助你度過失去寵物的難關。', '2023-04-09 09:45:00', 'P01', NULL, '2023-04-10 14:20:00', 0),
(71, 'mem00300', 11, '養狗或養貓？如何選擇適合自己的寵物？', '在養寵物之前，應該先了解自己的生活方式和時間安排，才能選擇適合自己的狗或貓。', '2023-05-03 17:30:00', 'P01', NULL, '2023-05-04 10:10:00', 0),
(72, 'mem00220', 12, '與寵物告別的十個方式', '飼主們都不希望看到自己的毛孩離開，但總有一天他們會離開我們。如何在最後的時刻好好告別，更能讓彼此心中有個了結。以下介紹十個告別方式，讓你們與毛孩在生命盡頭也能有美好的結局。', '2023-05-02 16:12:09', 'P01', NULL, '2023-05-03 10:20:33', 0),
(73, 'mem00300', 11, '如何訓練狗狗不叫', '有些狗狗的叫聲太過嘈雜，不僅影響周圍鄰居，也常常讓飼主感到困擾。不過其實教育狗狗不要叫是可以成功的，以下提供一些方法，幫助你訓練你的狗狗，不再亂叫。', '2023-04-23 08:40:15', 'P01', NULL, '2023-05-05 14:32:22', 0),
(74, 'mem00300', 11, '如何訓練幼貓不上沙發', '幼貓常常不聽話，尤其是訓練牠們不上沙發更是困難重重。其實，要訓練幼貓不上沙發，重點是要找到幼貓的喜好點，讓牠們愛上自己的窩，避免在沙發上睡覺。詳細的訓練方式可以參考網路上的相關資源。', '2023-01-01 12:34:56', 'P01', NULL, '2023-01-02 10:22:35', 0),
(75, 'mem00300', 12, '如何照顧老年犬', '老年犬的健康狀況比年輕犬隻更需要關注，因此照顧老年犬需要更加細心和注意。應當適當調整老年犬的飲食和運動，並且定期帶牠們到寵物醫院檢查，以及及時處理老年犬出現的健康問題。', '2023-02-05 09:17:23', 'P01', NULL, '2023-02-06 11:53:42', 0),
(76, 'mem00300', 4, '一窺寵物美容店的日常', '美容對於寵物的健康與幸福十分重要，然而寵物美容店的日常工作其實並不是那麼容易。在這裡，你需要掌握基本的美容技能，了解寵物的需求和特點，並與主人保持良好的溝通。除此之外，你還需要保持清潔和衛生，保障寵物在舒適的環境下進行美容。', '2023-03-12 14:27:11', 'P01', NULL, '2023-03-14 08:45:20', 0),
(77, 'mem00300', 11, '幼犬訓練必學！三招讓你的小狗乖乖聽話', '你的小狗常常亂叫、隨地大小便，不乖巧又淘氣嗎？不用擔心，只要掌握這三招訓練方式，讓你的小狗馬上變乖乖聽話！\n第一招：正確的口令訓練\n第二招：專注力訓練\n第三招：社交化訓練', '2023-03-20 10:25:16', 'P01', NULL, '2023-03-21 15:30:08', 0),
(78, 'mem00300', 12, '如何照顧老狗的身體健康', '老狗身體漸漸變差，這個時候主人們必須更加注意他們的健康問題。在老狗的生活中，有許多小細節需要主人們關注。\n第一個細節：飲食\n第二個細節：運動\n第三個細節：身體檢查', '2023-02-15 08:55:21', 'P01', NULL, '2023-02-16 16:42:11', 0),
(79, 'mem00270', 6, '哈士奇梗圖合集', '哈士奇是一種非常受歡迎的寵物犬種，它們機靈聰穎，活潑好動。以下是一些哈士奇的梗圖，讓你在忙碌的生活中放鬆一下，開心一整天！', '2023-01-28 13:10:45', 'P01', NULL, '2023-01-29 09:20:03', 0),
(80, 'mem00300', 7, '寵物學校招生公告', '寵物學校即將開學，歡迎寵物主人們帶著您的毛孩一同來學習，我們提供專業、貼心的課程，讓您的寵物學有所成！', '2023-02-05 13:42:00', 'P01', NULL, '2023-02-06 16:23:00', 0),
(81, 'mem00300', 7, '寵物訓練班開課了！', '寵物訓練班開課了！讓您的寵物學會基本的訓練，從而增加與您的互動，建立更深厚的感情，歡迎踴躍報名！', '2023-04-15 09:30:00', 'P01', NULL, '2023-04-16 11:18:00', 0),
(82, 'mem00280', 8, '寵物友善餐廳推薦', '在這裡推薦一家寵物友善餐廳，餐廳提供寵物專屬餐點，讓您的毛孩也能享受美食的同時，一同度過美好的時光！', '2023-03-10 16:55:00', 'P01', NULL, '2023-03-12 09:02:00', 0),
(83, 'mem00220', 9, '怎麼樣才能讓毛孩健康成長？', '關於寵物的照護，除了基本的飲食與日常護理外，還有許多需要注意的地方，例如定期檢查身體、打疫苗、注意寵物心理健康等等，快來看看這篇文章，一起為毛孩的健康成長努力吧！', '2023-02-25 10:20:00', 'P01', NULL, '2023-02-26 14:07:00', 0),
(84, 'mem00220', 12, '如何適當地處理寵物過世？', '寵物是人們生活中的重要伙伴，當牠們離開人們的生命時，往往會帶來無法言喻的傷痛，但是我們仍然需要面對這個現實，本篇文章介紹了一些適當的處理方式，希望能幫到大家。', '2023-05-01 14:10:00', 'P01', NULL, '2023-05-05 14:07:00', 0),
(85, 'mem00300', 11, '小貓貓的練習時間', '小貓貓在成長過程中需要充足的睡眠和運動，才能保持健康成長。適當的練習時間也能增加貓咪的活力，以下是小貓貓的練習時間參考。\n第一個時間：早上\n第二個時間：下午\n第三個時間：晚上', '2023-05-01 11:45:27', 'P01', NULL, '2023-05-02 16:05:55', 0),
(86, 'mem00300', 12, '老年犬飲食小撇步', '隨著犬隻年齡增長，飲食也需要作出相應的調整。例如可增加富含葡萄糖胺、軟骨素等成分的狗糧，幫助維持關節健康，避免關節疾病的發生。此外，應避免餵食高熱量、高脂肪、高鈉、高蛋白等食物，以免導致肥胖、腎臟負擔過重等問題。', '2023-02-01 10:23:45', 'P01', NULL, '2023-02-02 15:34:12', 0),
(87, 'mem00220', 12, '老年貓常見疾病', '老年貓常見的疾病包括腎臟病、心臟病、糖尿病、甲狀腺功能亢進等。貓咪的健康狀況隨著年齡增長而逐漸下降，因此需要定期檢查身體健康狀況，注意餵食，合理餵食含有維生素、礦物質、蛋白質等必要營養成分的食物，避免營養過剩。如果發現貓咪有不適，應及時帶去寵物醫院進行治療。', '2023-03-07 14:56:21', 'P01', NULL, '2023-03-08 11:23:32', 0),
(88, 'mem00270', 12, '老犬常見疾病', '老年犬常見的疾病包括關節炎、骨質疏鬆、白內障、肝臟病、膀胱炎等。狗隻在老年時，身體功能逐漸衰退，因此需要加強照護，注意餵食營養均衡的食物，適當進行運動，幫助保持身體健康。此外，也需要定期檢查身體狀況，發現問題及時治療。', '2023-03-10 14:56:21', 'P01', NULL, '2023-03-14 11:23:32', 0),
(89, 'mem00300', 6, '我家寶貝是個美食家', '我家寶貝最愛吃的是烤雞腿，每當有我們的晚餐，牠總是在我們身旁盯著烤雞腿的方向看，看起來很可愛呢！', '2023-04-26 12:24:16', 'P01', NULL, '2023-05-10 09:35:43', 0),
(90, 'mem00300', 7, '如何選擇適合自己毛孩的學校？', '每個毛孩的性格和習慣都不一樣，選擇適合自己毛孩的學校是很重要的，這篇文章將為大家介紹如何選擇適合自己毛孩的學校，希望能對大家有所幫助。', '2023-02-14 09:30:12', 'P01', NULL, '2023-05-02 11:15:20', 0),
(91, 'mem00280', 8, '寵物友善餐廳推薦', '想帶著毛孩外出用餐卻不知道去哪裡？這篇文章將為大家推薦數家寵物友善餐廳，讓您和毛孩一起享用美食的時光！', '2023-01-21 15:40:05', 'P01', NULL, '2023-05-09 16:22:48', 0),
(92, 'mem00300', 9, '應該如何保養寵物毛髮？', '每個毛孩都想要擁有一頭美麗的毛髮，但如何保養毛孩的毛髮卻是很多家長不知道的問題。這篇文章將為大家介紹如何保養寵物毛髮，讓毛孩擁有一頭健康美麗的毛髮！', '2023-03-10 10:55:30', 'P01', NULL, '2023-05-12 11:15:20', 0),
(94, 'mem00220', 7, '秋季課程開始囉！', '各位寵物主人們，我們的秋季課程即將開始了！這裡有專業的教練，能夠為您的寶貝提供最好的訓練，讓牠們變得更加聽話和懂事。我們的課程包括基本訓練、進階訓練、特殊技能訓練等，您可以根據您的需求選擇適合的課程。歡迎來電詢問，我們隨時為您服務！', '2023-04-15 14:00:00', 'P01', NULL, '2023-04-16 14:00:00', 0),
(95, 'mem00300', 8, '新上市的寵物餐廳', '各位寵物主人們，我們有一家新上市的寵物餐廳，提供美味可口的寵物餐點，絕對讓您的寶貝開心滿足！我們的餐廳裝潢舒適、氣氛愉快，您可以和您的毛孩一起在這裡享受美食。除了餐點外，我們還有許多有趣的活動，例如狗狗聚會、寵物時裝秀等，歡迎大家前來參加！', '2023-02-25 09:30:00', 'P01', NULL, '2023-02-26 09:30:00', 0),
(96, 'mem00220', 8, '寵物餐廳推薦', '最近去了一家寵物友善的餐廳，環境非常舒適，而且菜單也很豐富，有許多為寵物準備的美食，讓毛孩也可以一起享受美味。推薦給各位飼主們！', '2023-04-12 10:32:45', 'P01', NULL, '2023-04-12 11:20:30', 0),
(97, 'mem00300', 12, '老犬護理建議', '老犬的身體功能逐漸衰退，需要更多的護理。建議飼主們可以多給老犬按摩，定期檢查身體狀況，控制飼料攝取量，適當增加運動時間，以維護老犬的健康。', '2023-05-02 13:45:21', 'P01', NULL, '2023-05-03 09:12:02', 0),
(98, 'mem00260', 11, '狗狗訓練技巧', '狗狗在成長過程中需要進行訓練，讓牠們學會基本的禮儀和指令。建議飼主們可以使用正面的強化方法，例如給予獎勵和讚美，以增強狗狗的學習動機，同時也可以避免使用過於嚴厲的懲罰方式，以免影響狗狗的情緒和行為。', '2023-03-15 08:23:12', 'P01', NULL, '2023-03-16 14:09:20', 0),
(99, 'mem00300', 6, '我的金毛兒子', '這是我家的金毛，他很聰明、活潑好動，也很喜歡撒嬌，是我最好的朋友，希望大家也能好好疼愛你們的毛孩！', '2023-02-01 10:30:00', 'P01', NULL, '2023-02-02 15:45:00', 0),
(100, 'mem00300', 8, '推薦一家狗狗友善的餐廳', '最近發現了一家非常狗狗友善的餐廳，不僅提供寵物專屬菜單，也有專門的寵物區域，環境舒適寬敞，適合帶著毛孩共享美食！', '2023-04-15 14:00:00', 'P01', NULL, '2023-04-16 10:30:00', 0),
(101, 'mem00300', 8, '推薦一家狗狗友善的餐廳', '最近發現了一家非常狗狗友善的餐廳，不僅提供寵物專屬菜單，也有專門的寵物區域，環境舒適寬敞，適合帶著毛孩共享美食！', '2023-04-15 14:00:00', 'P01', NULL, '2023-04-16 10:30:00', 0),
(102, 'mem00280', 9, '注意！春夏季毛孩防曬重要', '隨著氣溫升高，曬黑的季節即將到來，但是大家不要忘記你的毛孩也需要防曬，以避免曬傷和皮膚發炎，特別是白色的毛孩更要注意！', '2023-05-02 13:45:00', 'P01', NULL, '2023-05-03 09:10:00', 0),
(103, 'mem00300', 3, '最佳旅遊目的地：寵物友善的天堂', '無論是長途旅行還是短暫的週末旅遊，帶著您的毛茸茸好朋友一起去寵物友善的景點是一個絕佳的選擇。以下是一些受歡迎的寵物友善景點，這些地方提供舒適的住宿、寬敞的戶外區域和特別設計的活動，讓您的寵物也能享受愉快的假期。', '2023-05-15 11:54:40', 'P01', NULL, '2023-05-16 11:54:40', 0),
(104, 'mem00300', 3, '追尋自然之美：寵物友善的郊區公園', '如果您想與寵物一同享受大自然的美景，寵物友善的郊區公園是您的理想選擇。這些公園通常提供大片草地供您的寵物奔跑、散步小徑讓您倆一同探索，還可能有專門設置的寵物遊樂區和飲水站，讓您的寵物能夠在安全和舒適的環境中盡情玩耍。', '2023-05-15 11:54:41', 'P01', NULL, '2023-05-16 11:54:41', 0),
(105, 'mem00300', 3, '歷史與文化之旅：寵物友善的博物館與遺址', '想要結合寵物友善的旅行與文化體驗嗎？一些博物館和古蹟提供了寵物友善的參觀政策，讓您的寵物可以與您一同欣賞歷史的壯麗和文化的豐富。請確保您遵守相應的規定，並注意您的寵物在這些特殊場所的行為與舒適度。', '2023-05-15 11:54:42', 'P01', NULL, '2023-05-16 16:54:42', 0),
(106, 'mem00300', 3, '沿海度假勝地：寵物友善的海灘和渡假村', '無論是與您的寵物一同沐浴陽光，還是在沙灘上散步，寵物友善的海灘和渡假村是您與毛孩度過難忘假期的理想場所。許多沿海度假勝地提供寵物友善的住宿選擇，並且一些海灘還設有專用的寵物區域，讓您的寵物可以自由奔跑和與其他寵物互動。', '2023-05-15 11:54:42', 'P01', NULL, '2023-05-16 11:54:42', 0),
(107, 'mem00300', 3, '城市探險：寵物友善的公園和咖啡廳', '如果您身處城市，也有許多寵物友善的選擇供您探索。城市公園通常提供寵物友善的區域，讓您的寵物可以與其他狗狗玩耍。此外，越來越多的咖啡廳也歡迎您攜帶寵物前來享用美食和飲品。在這些場所，您可以與您的寵物共度美好時光，同時還能體驗城市的活力和文化。', '2023-05-15 11:54:42', 'P01', NULL, '2023-05-16 11:54:42', 0),
(108, 'mem00201', 1, '我家貓咪不吃飯怎麼辦？', '我的貓咪最近一直不吃飯，該怎麼辦呢？求助！', '2023-01-15 09:30:12', 'P01', NULL, '2023-01-16 10:20:34', 0),
(109, 'mem00202', 2, '我帶寵物住宿的心得分享', '最近帶著我的毛小孩到一家寵物住宿中心度假，整個體驗超棒！在這篇文章中，我將分享我的心得和寵物住宿的注意事項，希望對大家有所幫助。', '2023-02-08 13:45:09', 'P01', NULL, '2023-02-09 14:55:42', 0),
(110, 'mem00203', 3, '我們一家人的寵物友善旅行', '上個週末，我們全家人帶著愛犬前往一個寵物友善的景點旅行。這是一次美好的經歷，讓我們的寵物也能享受到大自然的美景和活動。這篇文章將分享我們的旅程和一些建議，希望能啟發其他寵物家庭的旅行計畫。', '2023-03-20 16:30:54', 'P01', NULL, '2023-03-21 17:40:28', 0),
(111, 'mem00204', 4, '讓我的毛孩變成時尚寵物', '想讓你的寵物成為時尚寵物嗎？我將分享一些寵物美容的小技巧和經驗，讓你的毛孩變得更可愛和迷人！快來看看這些寵物美容的秘訣吧。', '2023-04-10 19:10:37', 'P01', NULL, '2023-04-11 20:25:19', 0),
(112, 'mem00205', 5, '狗狗和貓貓的奇妙相處之道', '我家有一隻狗狗和一隻貓貓，它們從小一起長大，彼此之間有著奇妙的互動和相處方式。在這篇文章中，我將分享我家寵物們的故事和一些養狗養貓的心得，希望能給其他寵物家庭一些啟示和幫助。', '2023-05-02 22:55:01', 'P01', NULL, '2023-05-03 23:45:33', 0),
(113, 'mem00206', 6, '我的毛孩日記：探險記', '今天，我帶著我的毛孩進行了一次刺激的探險之旅！在這篇日記中，我將紀錄我們的冒險過程、遇到的挑戰和美好時刻。希望這個故事能帶給大家快樂和共鳴，一起分享毛孩的成長點滴。', '2023-05-08 09:20:54', 'P01', NULL, '2023-05-09 10:35:17', 0),
(114, 'mem00207', 7, '寵物學校的成長歷程', '我的寵物在寵物學校度過了一段難忘的時光，這裡的老師們不僅教會了牠們基本的技能，還培養了他們的社交能力和紀律觀念。在這篇文章中，我將分享我寵物在寵物學校的成長歷程和學習心得。', '2023-06-15 12:05:29', 'P01', NULL, '2023-06-16 13:15:50', 0),
(115, 'mem00208', 8, '寵物友善餐廳：愛與美食的結合', '愛寵物的人總是希望和毛小孩們一起享受美食時光。我將分享一些寵物友善餐廳的推薦和體驗，這些餐廳提供了美味的料理和舒適的環境，讓我們和寵物一同享受用餐的樂趣。', '2023-06-25 15:40:12', 'P01', NULL, '2023-06-26 16:50:45', 0),
(116, 'mem00209', 9, '我的寵物好物分享', '在我們的生活中，有一些寵物用品和產品成為了我們和寵物之間的寶貴寶貝，它們為我們帶來了許多的', '2023-01-10 18:20:37', 'P01', NULL, '2023-01-11 19:30:59', 0),
(117, 'mem00210', 12, '老犬/貓的關愛指南', '我家的老犬/貓進入了老年階段，需要更多的關愛和照顧。在這篇文章中，我將分享一些照顧老犬/貓的心得和方法，讓我們的毛孩度過健康、舒適的晚年時光。', '2023-04-05 20:10:24', 'P01', NULL, '2023-04-06 21:20:58', 0),
(118, 'mem00211', 1, '急求！寵物醫療中心推薦', '最近我的貓咪出現了一些異常狀況，我很擔心牠的健康狀況。有沒有人可以推薦一家寵物醫療中心？我希望能找到專業且信任的醫生來照顧我的毛小孩。如果你有任何好的建議，請不要猶豫，立即回覆我！', '2023-01-25 14:30:12', 'P01', NULL, '2023-01-26 15:20:34', 0),
(119, 'mem00212', 2, '我家的寵物住宿奇遇記', '上個月，我帶著我的毛小孩入住一家寵物住宿中心，這是一段令人難以忘懷的經歷。在這篇文章中，我將詳細描述我和寵物在這個住宿中心的生活點滴，包括他們的設施、服務和對待寵物的態度。如果你正在尋找一個優質的住宿地點，一定要看看這篇文章！', '2023-02-15 09:45:09', 'P01', NULL, '2023-02-16 10:55:42', 0),
(120, 'mem00213', 3, '我們一起去寵物友善景點', '最近，我帶著我的愛犬去了一個寵物友善的景點，我們度過了一個愉快且充滿回憶的時光。在這篇文章中，我將分享我們的旅程，包括景點的特色、適合寵物的活動，還有一些實用的小貼士。如果你也是寵物家庭，一定不要錯過這個好去處！', '2023-03-20 12:30:54', 'P01', NULL, '2023-03-21 13:40:28', 0),
(121, 'mem00214', 4, '打造寵物美容專屬天堂', '如果你是一個愛護寵物的人，那麼你一定會喜歡這篇文章！我將分享一些關於寵物美容的小秘訣和經驗，讓你的毛孩變得更加美麗和迷人。無論是基本的美容護理還是時尚造型，這裡有你需要的一切資訊！', '2023-04-10 15:10:37', 'P01', NULL, '2023-04-11 16:25:19', 0),
(122, 'mem00215', 5, '如何讓狗狗和貓貓和平相處', '你家有狗狗和貓貓嗎？如果是的話，你一定知道他們之間的相處並不總是和諧的。在這篇文章中，我將分享一些我們家狗狗和貓貓和平相處的寶貴經驗和建議。如果你想讓你的毛孩們和睦相處，一定要看看這篇文章！', '2023-05-02 18:55:01', 'P01', NULL, '2023-05-03 19:45:33', 0),
(123, 'mem00216', 6, '我的毛孩日記：歡樂時光', '這是我的毛孩日記，記錄著我和我的毛小孩一起度過的歡樂時光。我們一起玩耍、散步，還有許多有趣的冒險。在這篇日記中，我將與大家分享我和毛孩的點點滴滴，希望能帶給你們快樂和共鳴！', '2023-05-08 08:20:54', 'P01', NULL, '2023-05-09 09:35:17', 0),
(124, 'mem00217', 7, '寵物學校的奇妙變化', '我的寵物在寵物學校度過了一段難忘的時光，從那以後牠們變得更聰明、更有紀律性。在這篇文章中，我將分享我寵物學校的經驗和成果，讓你也了解到寵物學校對寵物成長的重要性。', '2023-06-12 11:45:27', 'P01', NULL, '2023-06-13 12:55:59', 0),
(125, 'mem00218', 8, '寵物友善餐廳推薦', '如果你喜歡和寵物一起外出用餐，那麼你一定會喜歡這篇文章！我將介紹幾家寵物友善的餐廳，它們提供美味的料理和舒適的環境，讓我們和寵物一同享受用餐的樂趣。無論是周末早午餐還是晚餐約會，這些餐廳都是你和寵物共度美好時光的絕佳選擇！', '2023-05-25 15:40:12', 'P01', NULL, '2023-05-26 16:50:45', 0),
(126, 'mem00219', 9, '我的寵物好物分享', '在我們的生活中，有一些寵物用品和產品成為了我們和寵物之間的寶貴寶貝，它們為我們帶來了許多的快樂和便利。在這篇文章中，我將分享一些我和寵物們喜愛的好物，希望能給其他寵物家庭帶來一些參考和啟發。如果你也有一些寵物好物推薦，歡迎在下方留言分享！', '2023-07-10 18:20:37', 'P01', NULL, '2023-07-11 19:30:59', 0),
(127, 'mem00220', 12, '老犬/貓的關愛指南', '我家的老犬/貓進入了老年階段，需要更多的關愛和照顧。在這篇文章中，我將分享一些照顧老犬/貓的心得和方法，讓我們的毛孩度過健康、舒適的晚年時光。無論是養老飲食、適度運動還是關節保健，這裡有一些建議和技巧可以幫助你照顧老犬/貓的健康和幸福。', '2023-03-05 20:10:24', 'P01', NULL, '2023-03-06 21:20:58', 0),
(128, 'mem00221', 1, '寵物的心理健康', '寵物的心理健康同樣重要，它們也有情緒和壓力。作為寵物主人，我們應該關注和照顧它們的心理健康。與人類一樣，寵物可能會經歷焦慮、壓力、恐懼和憂鬱等問題。在這篇文章中，我將分享一些幫助寵物保持心理健康的方法，包括提供安全的環境、建立穩定的日常生活和提供適當的社交互動。希望這些資訊能幫助你更好地照顧你的毛小孩的心理健康！', '2023-06-20 09:30:12', 'P01', NULL, '2023-06-21 10:40:34', 0),
(129, 'mem00222', 2, '如何幫寵物緩解焦慮', '寵物也可能經歷焦慮，特別是在面對壓力、環境變化或分離時。作為寵物主人，我們可以採取一些措施來幫助它們緩解焦慮並提供安全感。在這篇文章中，我將分享一些有效的方法，包括建立穩定的日常生活、提供適當的運動和遊戲、使用舒緩的音樂和氣味等。讓我們一起為寵物的幸福和舒適而努力吧！', '2023-03-05 13:45:09', 'P01', NULL, '2023-03-06 15:00:42', 0),
(130, 'mem00223', 3, '帶寵物去露營的準備工作', '夏天是帶寵物去露營的絕佳時機！在計劃露營之前，我們需要做一些準備工作，確保寵物的安全和舒適。在這篇文章中，我將分享一些帶寵物去露營的準備工作，包括檢查寵物的健康狀況、帶上必需品、選擇適合的露營地點等。讓我們一起享受與寵物一起度過的難忘露營之旅吧！', '2023-01-15 16:20:54', 'P01', NULL, '2023-01-16 18:35:28', 0),
(131, 'mem00224', 4, '如何幫寵物建立健康的飲食習慣', '寵物的飲食習慣對其健康至關重要。作為寵物主人，我們需要確保它們獲得均衡的飲食，以維持良好的體重和健康狀態。在這篇文章中，我將分享一些幫助寵物建立健康飲食習慣的方法，包括選擇適合的寵物食品、控制飲食量、定期餵食和提供適當的營養補充。讓我們一起為寵物的健康而努力吧！', '2023-02-01 20:15:33', 'P01', NULL, '2023-02-02 22:30:07', 0),
(132, 'mem00225', 5, '與寵物一起運動的好處', '與寵物一起運動不僅有助於維持它們的身體健康，還能增強彼此之間的聯繫和互動。在這篇文章中，我將介紹一些與寵物一起運動的好處，包括增加運動量、改善心理健康、減輕壓力和提高生活質量。不論是散步、慢跑、游泳還是玩耍，與寵物一起運動是一個愉快且有益健康的方式。讓我們一起享受運動的樂趣吧！', '2023-01-10 09:40:12', 'P01', NULL, '2023-01-11 11:55:44', 0),
(133, 'mem00226', 6, '寵物的日常生活分享', '在這篇文章中，我將與大家分享我和寵物的日常生活。從早晨的起床時間到晚上的入睡儀式，我們一起度過了許多美好時光。寵物是我們生活中的陪伴者和家人，他們給予我們無限的愛和快樂。讓我們一起回顧那些溫馨的時刻，感謝寵物帶給我們的幸福！', '2023-02-20 15:30:09', 'P01', NULL, '2023-02-21 17:45:32', 0),
(134, 'mem00227', 7, '寵物學校的學習成果', '我家的寵物在寵物學校學習了許多有用的技能和知識。在這篇文章中，我將分享寵物學校的學習經驗和成果，讓你也了解到寵物學校對寵物成長的重要性。寵物學校不僅能教導寵物基本的禮儀和指令，還能提供社交和遊戲的機會。讓我們一起為寵物的成長和學習努力吧！', '2023-03-10 19:50:18', 'P01', NULL, '2023-03-11 21:05:41', 0),
(135, 'mem00228', 8, '寵物友善餐廳推薦', '如果你喜歡和寵物一起外出用餐，那麼你一定會喜歡這篇文章！我將介紹幾家寵物友善的餐廳，它們提供美味的料理和舒適的環境，讓我們和寵物一同享受用餐的樂趣。無論是周末早午餐還是晚餐約會，這些餐廳都是你和寵物共度美好時光的絕佳選擇！', '2023-04-05 12:30:54', 'P01', NULL, '2023-04-06 14:45:17', 0),
(136, 'mem00229', 9, '我的寵物好物分享', '在我們的生活中，有一些寵物用品和產品成為了我們和寵物之間的寶貴寶貝，它們為我們帶來了許多的快樂和便利。在這篇文章中，我將分享一些我和寵物們喜愛的好物，希望能給其他寵物家庭帶來一些參考和啟發。如果你也有一些寵物好物推薦，不妨和我們一起分享吧！', '2023-05-15 17:20:43', 'P01', NULL, '2023-05-16 19:35:06', 0),
(137, 'mem00230', 11, '幼犬的養育技巧', '作為一個幼犬的主人，我們需要了解幼犬的特殊需求並給予適當的照顧和訓練。在這篇文章中，我將分享幼犬的養育技巧，包括餵食、衛生、訓練和社交等方面的建議。讓我們一起為幼犬的成長和健康而努力吧！', '2023-06-25 10:10:27', 'P01', NULL, '2023-06-26 12:25:51', 0),
(138, 'mem00231', 12, '老犬的健康護理', '隨著寵物年齡的增長，老犬需要更多的關愛和護理。在這篇文章中，我將分享一些老犬的健康護理技巧，包括定期健康檢查、適量的運動、良好的營養和關節保健等。讓我們一起為老犬的幸福和健康而努力吧！', '2023-05-10 14:50:36', 'P01', NULL, '2023-05-11 17:05:59', 0),
(139, 'mem00232', 1, '如何讓寵物舒適度過夏天', '夏天的高溫對於寵物來說是一個挑戰。在這篇文章中，我將分享一些讓寵物舒適度過夏天的小貼士。首先，提供充足的水源和陰涼的休息地點，讓寵物可以隨時飲水和休息。其次，避免在炎熱時段長時間帶寵物外出，以免中暑。還有，定期給寵物洗澡並保持皮膚乾爽，防止皮膚病的發生。讓我們一起為寵物度過一個涼爽的夏天！', '2022-09-10 11:30:21', 'P01', NULL, '2022-09-11 13:45:44', 0),
(140, 'mem00233', 2, '寵物住宿的注意事項', '當我們需要暫時離開時，寵物住宿是一個不錯的選擇。在這篇文章中，我將分享寵物住宿的注意事項。首先，選擇信譽良好的寵物住宿設施，確保寵物能夠得到適當的照顧和關注。其次，提前預訂住宿，確保有足夠的空間供寵物居住。還有，提供寵物所需的食物、玩具和藥物，以維護其健康和舒適。讓我們為寵物提供一個安全和愉快的住宿環境！', '2022-10-05 14:20:35', 'P01', NULL, '2022-10-06 16:35:58', 0),
(141, 'mem00234', 3, '寵物友善景點推薦', '在這篇文章中，我將介紹一些寵物友善的景點，讓您可以和寵物一同享受旅行的樂趣。這些景點提供了寵物友善的環境和設施，讓您和寵物可以一起探索自然和享受戶外活動。無論是郊遊、露營還是登山，這些景點都是您和寵物共度美好時光的理想之地。讓我們一起探索寵物友善的世界吧！', '2022-11-15 09:40:12', 'P01', NULL, '2022-11-16 11:55:34', 0),
(142, 'mem00235', 4, '寵物美容的重要性', '寵物美容不僅可以使寵物外觀整潔，還有助於其身體健康和幸福。在這篇文章中，我將探討寵物美容的重要性。首先，定期洗澡和梳理可以保持寵物的皮膚和毛髮健康。其次，美容過程中可以檢查和清理寵物的耳朵、牙齒和爪子，預防疾病的發生。還有，美容過程可以增加寵物與主人之間的親密關係，提升寵物的精神狀態。讓我們一起為寵物的美麗和健康而努力吧！', '2023-01-20 15:30:09', 'P01', NULL, '2023-01-21 17:45:22', 0),
(143, 'mem00236', 5, '與寵物共享生活的喜悅', '在這篇文章中，我將分享與寵物共享生活的喜悅。無論是早晨的散步、下午的玩耍還是晚上的擁抱，寵物帶給我們無盡的愛和歡樂。它們是我們生活中最忠實的伴侶，始終陪伴在我們身邊。和寵物在一起，我們可以感受到無條件的愛和無盡的快樂。讓我們一起享受與寵物共處的美好時光吧！', '2023-03-08 12:15:27', 'P01', NULL, '2023-03-09 14:30:51', 0),
(144, 'mem00237', 6, '毛孩的成長日記', '這是一篇關於我毛孩成長的日記。從它的誕生到現在，我見證了它的每一個成長階段。它從一個小小的生命開始，漸漸長大，充滿活力。我和它一起度過了無數個快樂時光，也一起經歷了挑戰和困難。這個日記記錄了我們的點點滴滴，讓我們的回憶永遠鮮活。讓我們一起紀念毛孩的成長和美好時光！', '2023-04-12 16:20:34', 'P01', NULL, '2023-04-13 18:35:57', 0),
(145, 'mem00238', 7, '寵物學校的好處', '寵物學校是寵物教育和訓練的理想場所。在這篇文章中，我將介紹寵物學校的好處。首先，寵物學校可以幫助寵物建立良好的行為和社交技巧，提升其品行和可愛度。其次，寵物學校提供專業的訓練師和豐富的課程，幫助寵物和主人建立良好的溝通和信任。還有，寵物學校提供一個與其他寵物和主人互動的機會，擴展寵物的社交圈子。讓我們一起為寵物的教育和成長努力吧！', '2023-06-05 09:40:42', 'P01', NULL, '2023-06-06 11:55:04', 0),
