(152, 'mem00294', 4, '寵物美容板的護理建議', '在這篇文章中，我將分享一些寵物美容板的護理建議和心得。寵物美容是保持寵物外貌和健康的重要一環，我們可以使用各種美容產品和技巧，使寵物保持潔淨、健康和漂亮。讓我們一起探索寵物美容的世界，給寵物帶來更美好的生活！', '2023-05-20 14:30:10', 'P01', NULL, '2023-05-21 16:45:34', 0),
(153, 'mem00295', 5, '狗/貓聚板的交友活動', '在狗/貓聚板上，我們可以參加各種狗狗和貓咪的交友活動。這些活動提供了一個互相認識和交流的機會，讓我們的毛孩們能夠結交新朋友並享受社交互動的樂趣。讓我們一起參加這些狗/貓聚板的交友活動，為寵物營造更多的社交機會！', '2023-07-07 18:55:42', 'P01', NULL, '2023-07-08 21:10:06', 0),
