INSERT INTO `restaurant_activity` (`rest_sid`, `act_sid`, `title`, `content`, `img`, `date`) VALUES
(1, 1, '毛絨絨寶貝派對', '與您的寵物一起參加歡樂派對，享受互動遊戲和美食，不論是貓咪或狗狗歡迎一同參加我們所舉辦的毛絨絨派對，毛小孩與大人們一起互相交流。', '50284914917_01601674d5_c.jpg', '2023年8月1日至2023年8月7日'),
(2, 2, '寵物8月生日慶祝', '歡迎8月生的毛小孩，我們將為您的寵物慶祝生日，特別準備驚喜蛋糕和精心挑選的生日禮物！', '3f4efb92.jpeg', '2023年9月15日至2023年9月30日'),
(3, 3, '狗狗社交聚會', '與其他狗狗及其主人一起參加社交聚會，建立新的友誼，讓您的狗狗在社交聚會上與其他毛孩們玩耍互動！', 'w700d1q75cms.jpeg', '2023年10月8日至2023年10月10日'),
(4, 4, '寵物時尚秀', '一起裝扮毛孩們，來走秀吧！展示寵物時尚造型，與其他寵物主人分享寵物時尚心得，成為寵物時尚達人！', 'posts_image3_104092_1614933498.jpeg', '2023年11月5日至2023年11月12日'),
(5, 5, '家庭寵物日', '帶全家一起參加的寵物日活動，樂趣遊戲、親子互動，讓家庭更加和諧快樂！', '2209191738561782700107.png', '2023年12月10日至2023年12月11日'),
(6, 6, '愛心領養日', '推廣領養寵物的重要性，我們將舉辦愛心領養日活動，提供優惠價格和免費專業領養咨詢服務，鼓勵大家選擇領養流浪動物，給他們一個溫暖的家！', 'images.jpeg', '2024年1月20日至2024年1月31日'),
(7, 7, '寵物健康講座', '我們邀請專業寵物醫生主講健康講座，學習如何全面照顧寵物的身體和健康狀態。這是一個學習寵物健康知識的絕佳機會。', '275863066_326739662810739_8754407048132976896_n.jpeg', '2024年3月8日至2024年3月10日'),
(8, 8, '寵物攝影比賽', '展現您寵物的獨特魅力！參加我們的寵物攝影比賽，分享您拍攝的寵物照片，有機會贏得豐富的攝影相關獎品，捕捉美好時刻。', 'qrboSC3zyBtndijLPgik29YuXt3GSsbJDq5bdGN5.jpeg', '2024年4月15日至2024年4月30日'),
(9, 9, '寵物美容示範', '由專業寵物美容師進行示範，學習基本寵物美容技巧，打造寵物的時尚造型，讓您的毛孩更加迷人可愛。', 'ebac83beb7a4755080f4b6ccf995b920.jpeg', '2024年6月5日至2024年6月10日'),
(10, 10, '寵物慈善義賣', '我們舉辦慈善義賣活動，為需要幫助的流浪動物籌集善款，共同關懷寵物福利！您可以參觀我們的義賣攤位，購買各種寵物相關商品和手工製品，所有收益將捐贈給當地的動物收容所，為無家可歸的寵物提供食物、醫療和庇護所。一同為愛心事業盡一份心力，讓這個世界更美好！', 'v2-d1379e4cce3a779954c37d8912c0a3a3_ipico.jpeg', '2024年7月20日至2024年7月31日'),
(11, 11, '寵物健康日', '免費提供專業健康檢查、疫苗接種和寵物營養諮詢，讓您的寵物健康快樂，提供一個關心寵物健康的專屬活動。', '210802101345760997GASV1.jpeg', '2023年9月5日至2023年9月10日'),
(12, 12, '寵物音樂派對', '狂歡的音樂派對！現場DJ音樂、寵物表演和美味小吃，與您的寵物一同度過一個難忘的歡樂時光。', 'How_To_Throw_Your_Dog_The_Best_Birthday_Party.png', '2023年10月15日至2023年10月16日'),
(13, 13, '寵物時尚大秀', '展示寵物時尚的盛會！時尚秀、時尚攝影和時尚商品展示，讓您的寵物成為焦點，一同追求時尚與風格。', 'w700d1q75cms132.jpeg', '2023年08月20日至2023年08月25日'),
(14, 14, '尋寶遊戲', '勇敢的寵物大逃亡！參加挑戰賽，追踪尋找寵物，贏得豐富獎品，一同體驗刺激和樂趣。', 'ezgif-4-436ccda15a.jpeg', '2023年08月30日至2023年09月30日'),
(15, 15, '寵物友善咖啡品鑑', '品味咖啡的同時，享受與寵物的親密時光，咖啡試飲、獨特寵物主題菜單，與您的寵物共度愉快時光。', 'coffee-4502112337-1258756.jpeg', '2023年11月10'),
(16, 16, '寵物情人節派對', '與您的寵物共度浪漫時光！特別菜單、精彩表演和愛心禮物，讓您與寵物表達愛意，創造美好回憶。', '4535-fyrpeie7320820.jpeg', '2023年8月23日'),
(17, 17, '寵物養生講座', '聆聽專家的養生知識和寵物保健建議，了解如何照顧寵物的身心健康，提供一個寵物健康知識的寶庫。', '2209041322518522982050.jpeg', '2023年8月30日至2023年9月15日'),
(18, 18, '寵物散步聚會', '與其他寵物主人一同參加散步聚會，帶著您的寵物在公園享受愉快的散步時光，結交新朋友。', '6068fd20597947e8a8e02c41c8bb166f.jpeg', '2023年8月5日至2023年8月7日'),
(19, 19, '寵物才藝表演', '讓您的寵物展示他們的才藝！參加才藝表演，讓您的寵物在觀眾面前展示各種有趣和驚人的技能。', '5181edd0acfb868355268638.jpeg', '2023年9月15日至2023年9月20日'),
(20, 20, '萬聖節派對', '萬聖節的寵物派對！帶上您的寵物穿上可愛的萬聖節服裝，參加狂歡派對，享受獨特的節日氛圍和美味的節日小吃。', '168968741240932_P19114481.jpeg', '2023年10月28日至2023年10月31日'),
(43, 21, '季節限定前菜', '抹茶季限定前菜，抹茶米餅，南瓜豆腐南瓜豆腐發想來自 勾玉豆腐，使用日本葛粉、鮮奶、腰果加入蒸熟的東昇南瓜製作而成再淋上特製抹茶醬汁，讓人回味無窮', '339029415_157790413874189_5127916755876503629_n.jpeg', '2023年9月5日至2023年9月10日'),
(22, 22, '毛絨絨寶貝派對', '與您的寵物一起參加歡樂派對，享受互動遊戲和美食，不論是貓咪或狗狗歡迎一同參加我們所舉辦的毛絨絨派對，毛小孩與大人們一起互相交流。', '50284914917_01601674d5_c.jpg', '2023年8月1日至2023年8月7日'),
(23, 23, '寵物8月生日慶祝', '歡迎8月生的毛小孩，我們將為您的寵物慶祝生日，特別準備驚喜蛋糕和精心挑選的生日禮物！', '3f4efb92.jpeg', '2023年9月15日至2023年9月30日'),
(24, 24, '狗狗社交聚會', '與其他狗狗及其主人一起參加社交聚會，建立新的友誼，讓您的狗狗在社交聚會上與其他毛孩們玩耍互動！', 'w700d1q75cms.jpeg', '2023年10月8日至2023年10月10日'),
(25, 25, '寵物時尚秀', '一起裝扮毛孩們，來走秀吧！展示寵物時尚造型，與其他寵物主人分享寵物時尚心得，成為寵物時尚達人！', 'posts_image3_104092_1614933498.jpeg', '2023年11月5日至2023年11月12日'),
(26, 26, '家庭寵物日', '帶全家一起參加的寵物日活動，樂趣遊戲、親子互動，讓家庭更加和諧快樂！', '2209191738561782700107.png', '2023年12月10日至2023年12月11日'),
(27, 27, '愛心領養日', '推廣領養寵物的重要性，我們將舉辦愛心領養日活動，提供優惠價格和免費專業領養咨詢服務，鼓勵大家選擇領養流浪動物，給他們一個溫暖的家！', 'images.jpeg', '2024年1月20日至2024年1月31日'),
(28, 28, '寵物健康講座', '我們邀請專業寵物醫生主講健康講座，學習如何全面照顧寵物的身體和健康狀態。這是一個學習寵物健康知識的絕佳機會。', '275863066_326739662810739_8754407048132976896_n.jpeg', '2024年3月8日至2024年3月10日'),
(29, 29, '寵物攝影比賽', '展現您寵物的獨特魅力！參加我們的寵物攝影比賽，分享您拍攝的寵物照片，有機會贏得豐富的攝影相關獎品，捕捉美好時刻。', 'qrboSC3zyBtndijLPgik29YuXt3GSsbJDq5bdGN5.jpeg', '2024年4月15日至2024年4月30日'),
(30, 30, '寵物美容示範', '由專業寵物美容師進行示範，學習基本寵物美容技巧，打造寵物的時尚造型，讓您的毛孩更加迷人可愛。', 'ebac83beb7a4755080f4b6ccf995b920.jpeg', '2024年6月5日至2024年6月10日'),
(31, 31, '寵物慈善義賣', '我們舉辦慈善義賣活動，為需要幫助的流浪動物籌集善款，共同關懷寵物福利！您可以參觀我們的義賣攤位，購買各種寵物相關商品和手工製品，所有收益將捐贈給當地的動物收容所，為無家可歸的寵物提供食物、醫療和庇護所。一同為愛心事業盡一份心力，讓這個世界更美好！', 'v2-d1379e4cce3a779954c37d8912c0a3a3_ipico.jpeg', '2024年7月20日至2024年7月31日'),
(32, 32, '寵物健康日', '免費提供專業健康檢查、疫苗接種和寵物營養諮詢，讓您的寵物健康快樂，提供一個關心寵物健康的專屬活動。', '210802101345760997GASV1.jpeg', '2023年9月5日至2023年9月10日'),
(33, 33, '寵物音樂派對', '狂歡的音樂派對！現場DJ音樂、寵物表演和美味小吃，與您的寵物一同度過一個難忘的歡樂時光。', 'How_To_Throw_Your_Dog_The_Best_Birthday_Party.png', '2023年10月15日至2023年10月16日'),
(34, 34, '寵物時尚大秀', '展示寵物時尚的盛會！時尚秀、時尚攝影和時尚商品展示，讓您的寵物成為焦點，一同追求時尚與風格。', 'w700d1q75cms132.jpeg', '2023年08月20日至2023年08月25日'),
(35, 35, '尋寶遊戲', '勇敢的寵物大逃亡！參加挑戰賽，追踪尋找寵物，贏得豐富獎品，一同體驗刺激和樂趣。', 'ezgif-4-436ccda15a.jpeg', '2023年08月30日至2023年09月30日'),
(36, 36, '寵物友善咖啡品鑑', '品味咖啡的同時，享受與寵物的親密時光，咖啡試飲、獨特寵物主題菜單，與您的寵物共度愉快時光。', 'coffee-4502112337-1258756.jpeg', '2023年11月10'),
(37, 37, '寵物情人節派對', '與您的寵物共度浪漫時光！特別菜單、精彩表演和愛心禮物，讓您與寵物表達愛意，創造美好回憶。', '4535-fyrpeie7320820.jpeg', '2023年8月23日'),
(38, 38, '寵物養生講座', '聆聽專家的養生知識和寵物保健建議，了解如何照顧寵物的身心健康，提供一個寵物健康知識的寶庫。', '2209041322518522982050.jpeg', '2023年8月30日至2023年9月15日'),
