INSERT INTO `restaurant_information` (`rest_sid`, `name`, `phone`, `city`, `area`, `address`, `acceptType`, `info`, `notice`, `feature_title`, `feature_content`, `feature_img`, `start_at_1`, `end_at_1`, `start_at_2`, `end_at_2`, `people_max`, `rest_date`, `created_at`, `average_friendly`, `booking_count`) VALUES
(1, 'Woodid手作韓食', 227017739, '台北市', '大安區', '仁愛路四段300巷19弄6號', '大/中/小型犬/貓', '夢中醒來的第一個念頭是「屋頂」 不僅為自己、為家人，更為朋友、毛孩 遮風避雨，還可以享用溫暖人心的料理 吳老闆是位主廚，喜歡美食更喜歡做菜 延伸了「Wu did」吳作、無敵的意思 우리 韓文是「我們」，在美食當前不分你我 這是我們的夢，想給踏進屋頂的你們，最純粹的餐點', '若有生病情況不建議進入避免交叉感染', '各式各樣的韓式料理', '供應菜色以韓式鍋物定食為主，其他還有拌飯、煎餅、炸物、炒雜菜或炒肉類等等，也有適合不同人數用餐的雙人...', '3f4efb92-7a8c-4e80-a22d-d687ea63091f.jpeg', '12:00:00', '14:00:00', '17:00:00', '20:00:00', 24, '4', '2023-06-26 13:25:54', '4.3', 2),
(2, '兔Dreams寵物餐廳', 227030037, '台北市', '大安區', '新生南路一段161巷10號1號', '大/中/小型犬/貓', '我們有店兔（營業時間都有兔子在，但只有特定時間開放與客人近距離接觸）、有人族和兔族食物、有兔子跑跑區', '⚠️最後點餐時間皆為19:30\r\n⚠️國定假日如果是落在週一至五的話 一樣是11:30開始喔！\r\n', '不定期舉辦活動', '舉辦各式寵物，親子活動，手作課程，歡迎參加', '0f6bd03e668f6556a3a8a6b2c96f548346188219.jpeg', '11:00:00', '20:00:00', NULL, NULL, 16, NULL, '2023-06-26 13:29:53', '3.9', 3),
(3, 'Toast Chat', 227215661, '台北市', '大安區', '光復南路290巷58號1樓', '大/中/小型犬/貓', '在與各式麵包的交談之中，我們找到了更美味的配方；利用不同的食材變化，重新來詮釋法式吐司。請與我們一同享受這嶄新的美味。', '', '工業風餐廳', '店內以簡單明亮的工業風為主，輕鬆不拘束的舒適感，座位沒有固定形式，左邊右邊中間各有個的特色', '20190901160429_97.jpeg', '12:00:00', '20:00:00', NULL, NULL, 24, NULL, '2023-07-02 13:52:24', '3.8', 2),
(4, '曜日義式餐酒館', 227085910, '台北市', '大安區', '東豐街53號1樓', '大/中/小型犬/貓', '菜單主打義大利麵的「Yoh曜日義式餐酒館」是一家寵物友善的義式餐廳，營業時段從中午到午夜，因此也能在這享受到晚上的餐酒微醺時光，設有包廂空間，同行的寵物在這也吃得到毛小孩特餐！', '', '提供包廂服務', '《Yoh曜日義式餐酒館》餐廳內則是乾淨整潔明亮。用餐限時2小時，若有毛小孩一起用餐，會視情況優先安排包廂區域，且另有提供包廂、包場等服務，可以事先電話預約詢問。', '20181103201909_90.jpeg', '12:00:00', '22:00:00', NULL, NULL, 30, NULL, '2023-07-05 13:35:11', '4.8', 73),
(5, '2J CAFE', 227003783, '台北市', '大安區', '建國南路二段79巷9號', '大/中/小型犬/貓', '2J CAFE由古民家老宅改建，由韓國人開的餐廳，獨棟保留紅磚設計復古老屋，混搭加入工業風與美式鄉村風格，兩層樓韓系咖啡廳。', '', '復古風味/戶外庭院', '獨棟兩層樓空間，一樓走工業風設計，二樓則美式鄉村風的氛圍，戶外有大片庭院，設有座位，整個陽傘座位，森林系咖啡廳氣氛。', '2JCAFE17.jpeg', '11:30:00', '22:30:00', NULL, NULL, 24, NULL, '2023-07-05 13:50:27', '4.3', 3),
(6, 'Toasteria Cafe 吐司利亞', 223210073, '台北市', '大安區', '信義路二段200號', '大/中/小型犬/貓', 'Toasteria Cafe不只是一間餐廳或是咖啡廳，吐司利亞帶給您的是一趟通往美麗地中海國度的旅程。帶你進入這個放鬆的空間是一系列完美和諧的組合：在經典的空間設計享用療癒的道地地中海料理，體驗優質貼心的服務，精挑細選的世界音樂，彷彿真的來到了地中海。', '', '擁有多元風味的餐點', ' Toasteria Cafe是一間以開放的心態讓我們的菜單由不同文化背景豐富我們地中海風格的廚房。有來自以色列、洛哥、埃及、希臘、西班牙、法國、義大利的味道，一次達成造訪各個國家的夢想。', '20211224230344_21.jpeg', '09:00:00', '00:00:00', NULL, NULL, 36, NULL, '2023-07-09 12:03:58', '4.0', 3),
(7, '來吧Cafe', 227093843, '台北市', '大安區', '信義路三段134巷12號', '大/中/小型犬/貓', '來吧Cafe前身是做網路甜點起家，主打少糖和少鹽並使用優質的食材製作甜點', '', '韓系建築風', '來吧 Cafe’是獨棟的兩層樓咖啡廳，簡約的設計外觀，讓人會忍不住在外面多拍幾張厲害的照片。', '1490104877-2729053783_wn.jpeg', '11:30:00', '22:00:00', NULL, NULL, 32, '1', '2023-07-09 12:08:11', '4.0', 3),
(8, '舒服生活', 227088380, '台北市', '大安區', '文昌街66號', '大/中/小型犬/貓', '你餓，走進來吃飯; 你渴，進來喝杯咖啡; 想啜飲小酌，進來絕對不會後悔。身心疲憊、孤單寂寞、雀躍興奮、一群朋友嬉鬧時......。這裡將會是你除了家以外另一個安心享受的所在。', '', '古董老件特色咖啡廳', '舒服生活可以是酒吧，可以是咖啡館，可以是舊物市集，也可以租借拍攝、取景，是一個定位多元的美好空間，內部將近百坪的空間，挑高且寬敞明亮，徜徉在此感到無比愜意，當下感受正如其名Truffles Living', '171118-7932-2-pgVU6.jpeg', '12:00:00', '20:00:00', NULL, NULL, 28, NULL, '2023-07-09 12:15:04', '4.0', 2),
(9, '貮樓（敦南店）', 227009855, '台北市', '大安區', '敦化南路二段63巷14號', '大/中/小型犬/貓', '隱密的巷弄間靜靜地倚著大樹的獨棟建築，這是我們的起點。取名為「貳樓」是因為大樓林立的都市裡二樓不會是個商辦空間，也不會是個營業場所；二樓是一間間我們在精神上依靠的住家，同時一份份的溫暖也從二樓開始發生。', '', '木質外觀設計', '「貳樓」位於在靜謐的敦南巷弄間，獨棟的建築木造外觀，暖黃色的燈光，貳樓想帶給顧客最純粹的『家的感覺』以及創意的新美式料理。', '23.jpeg', '11:00:00', '21:00:00', NULL, NULL, 30, NULL, '2023-07-09 12:19:48', '3.9', 3),
(10, 'Rebirth Cafe & Restaurant', 223660985, '台北市', '大安區', '溫州街48巷2號', '大/中/小型犬/貓', '一間位於溫州街上的咖啡廳，一位中年大叔每天燃燒生命，一群熱血青年由顧客轉職店員，沒錯！我們是Rebirth ，讓每一次相遇成———未完待續', '', '無法定義的店，實現夢想的萬事屋', '店裡三不五時會舉辦攝影展、小型音樂會，甚至烤肉派對，不管來幾次都摸不清：這裡究竟是咖啡廳、餐廳還是酒吧？你認為是什麼就是什麼，我們並沒有設定它的樣子，但我們比較喜歡用『萬事屋』來形容這間店', '1546834126-888497009_wn.jpeg', '15:00:00', '02:00:00', NULL, NULL, 26, NULL, '2023-07-09 13:37:01', '4.5', 2),
(11, '金烤盃', 226591212, '台北市', '內湖區', '江南街96巷7號\r\n', '大/中/小型犬/貓', '想吃烤肉不想動手\r\n快來《金烤盃》!!!!!\r\n超友善寵物餐廳~\r\n提供毛孩餐點乙份', '', '提供毛小孩餐點', '精緻高品質的創意美味餐點、服務、時尚充滿藝術感的用餐環境，CP質爆表！提供超大份量的免費狗狗餐（牛肉or雞肉、豬肉），不但我們吃得美味愉悅外，毛小孩也飽餐一頓，心滿意足呢！', '48773093926_be41d655fd_c.jpeg', '11:30:00', '14:00:00', '17:00:00', '23:00:00', 32, '1', '2023-07-10 01:52:21', '3.9', 3),
