(13, 'NEKKO BAR 貓吧', 227011511, '台北市', '大安區', '四維路14巷3號', '大/中/小型犬/貓', 'Sake & Wine 微醺空間—城市中的心靈庇護所', '', '日式室內設計風格', '吧檯廚房與座位貫穿了整個窄長型空間，不譁眾取寵的現代日式風格，簡練冷靜的氛圍裡到處都有以貓咪為主題的擺設。冷與萌可以如此可愛的融合！', '-NWfd9eQ2UZ3-LnR78-w_inline-live-3--NWfd9pDe2c0O1a4cGNr-34fad683-63ad-4ef0-b3b3-17851f22357a.jpeg', '18:00:00', '02:00:00', NULL, NULL, 32, '1', '2023-07-10 02:08:13', '4.2', 2),
(14, 'PS BUBU 金屋藏車食堂', 228760698, '台北市', '士林區', '中山北路七段140巷1號', '大/中/小型犬/貓', '金屋藏車食堂 PS BUBU位於天母地區汽車主題式餐廳店內以MINI車及老式金龜車為座位提供南加州義大利餐點~ 也是寵物友善環境，提供毛小孩精緻料理，讓您與愛犬能共度享受美食的歡樂時光', '', '金屋藏車', '復古的金龜車元素堆疊成整間店的容貌，美國各州的車牌、海報、扭蛋、還有美式復古的各類玩具等等，店內以MINI車及老式金龜車為座位，提供南加州義大利餐點', '67900d2ce48eac99adf6955608c49574f2363201.jpeg', '12:00:00', '21:00:00', NULL, NULL, 24, '2', '2023-07-10 02:12:20', '3.4', 2),
(15, '養鍋Yang Guo石頭涮涮鍋', 223969909, '台北市', '中正區', '寧波西街81號', '大/中/小型犬/貓', '養鍋精神 本持著 養滋胃 品鮮味 食尚鮮\r\n一鍋の堅持造就\r\n一鍋の熱情成就\r\n一鍋の生活滿足\r\n一鍋の溫度溫暖', '', '平凡の火鍋中品嚐出我們的用心！', '火鍋的不僅僅是美食，也蘊含著每道食材能帶來什麼不一樣的故事。真心及細心在食材上看不到任何不健康且廉價的食材，都是滿滿且份量十足的火鍋。讓你好好養一下『溫暖心、溫暖胃、食鍋趣』。', '20210704141448_40.jpeg', '11:00:00', '14:30:00', '17:00:00', '22:30:00', 20, NULL, '2023-07-10 02:14:07', '4.5', 2),
(16, '樂野食', 223888088, '台北市', '大安區', '敦化南路一段233巷56號', '大/中/小型犬/貓', '從早晨的令人精神飽滿早午餐，下午優閒寧靜的下午茶時光、晚上下班聚會的輕鬆小酌、手工甜點、精心特調的輕食、還有主廚為素食者特製的蔬食系列，皆有樂野食用心的美味餐點陪伴', '', '親子與寵物友善餐廳', '廳還規劃設置兒童遊憩區，讓有孩童的家長來此用餐，可以有稍微喘息的空間。不只是親子友善，同時也是寵物友善，寵愛毛小孩的朋友，不用擔心因攜帶寵物被拒於門外，餐廳特別拉開孩童和毛小孩的用餐區，讓大家都可以在樂野食與親朋好友同樂享受美食。', 'C5DDADA6-5157-5E1F-966F-7249FB20D12D.jpeg', '11:00:00', '20:00:00', NULL, NULL, 28, NULL, '2023-07-10 02:19:26', '4.2', 2),
(17, '棧-直火廚房', 287739938, '台北市', '大安區', '仁愛路四段345巷4弄4號', '大/中/小型犬/貓', '直火料理X職人俱樂部X美食美酒\r\n直火料理＆肉類專門\r\n精釀啤酒', '', '炭烤手法料理', '特別自美國購買導熱快且蓄熱佳的黑鐵烤爐、底座以紅磚頭砌成、選用本地龍眼木及木炭碳烤，廚師上下移動烤架控溫，以高溫火烤鎖住肉汁，藉由木炭導火、龍眼木導煙燻，造就誘人烙痕與香氣。', 'WILDWOOD.jpeg', '12:00:00', '14:30:00', '16:00:00', '22:30:00', 34, NULL, '2023-07-10 02:25:23', '4.0', 2),
(18, '父母＿FUMU', 225185660, '台北市', '中山區', '興安街103號', '大/中/小型犬/貓', '在父母，無論白天或晚上，我們都提供各式各樣的餐點和飲品。你可以在白天享用全台北最道地的英式早餐；在下午來杯Flat White搭配現烤的肉桂捲；晚上品嚐我們最受歡迎的英式炸魚薯條，配上一杯冰冰涼涼的新鮮生啤酒', '', '為什麼叫父母', '我們開店的構想，是想把兩種截然不同的情境結合在同一個空間。白天是乾淨明亮的環境，搭配早午餐跟好喝的咖啡。晚上就在昏暗的燈光下，與親朋好友一起喝著酒，隨著音樂搖擺。而這兩種型態正好符合我們印象中的媽媽與爸爸。', 'C-MP-IN-MP+NORH.png', '10:00:00', '02:00:00', NULL, NULL, 26, NULL, '2023-07-10 02:30:42', '3.9', 3),
(19, 'Lazzy Cafe 寵物餐廳', 287800383, '台北市', '信義區', '光復南路419巷49號1樓', '大/中/小型犬/貓', 'Lazzy Café是一間複合式咖啡廳，同時也是寵物友善餐廳，提供寵物餐食、寵物美容、寵物備品如睡墊等服務，店內空間很大，另設有投影幕，許多人會在此舉辦毛孩的慶生會。', '', '毛兒變裝秀', 'Lazzy的一大亮點就是有超大面的變裝牆，各式各樣的毛兒服飾可以盡情玩弄你的毛寶貝。不只有毛兒的衣服還有毛爸媽的派對帽可以玩，超適合找好朋友們一起來，來這裡辦各種節日的派對都能找到適合的衣服！', 'img_6804-scaled.jpeg', '11:00:00', '19:00:00', NULL, NULL, 35, '1', '2023-07-10 02:38:45', '4.6', 3),
(20, '他。植物咖啡 He Coffee', 227476058, '台北市', '松山區', '八德路四段245巷52弄29號1樓', '大/中/小型犬/貓', '隱身在都市中，充滿綠意的植物系寵物友善咖啡廳，環境明亮開闊、舒服放鬆，高人氣店狗會不定時出沒，體積龐大但性格溫馴', '', '店長｜人氣之王，溫馴大狗喜樂蒂——樂樂', '狗如其名，性格好溫馴，總是帶著笑臉， 徘徊笑著在每位咖啡廳的客人之間。 ', 'potato_2dc1ff8a-fee1-4c38-84bc-7c8cbd219b8a_f4ff22fcda08f72b68b8c708cdc94942f74c80ee.jpeg', '11:30:00', '22:00:00', NULL, NULL, 24, NULL, '2023-07-10 02:41:31', '4.4', 2),
(21, '稻邸D.House', 225577980, '台北市', '大同區', '迪化街一段244號', '大/中/小型犬/貓', '在大稻程裡的一處老宅邸，D.House稻邸，我們是一間寵物友善餐廳舒適的空間', '', '復古的室內環境', '古蹟老宅邸保留原貌，以帶有復古、現代感的桌椅佈置、綠意盎然的植栽，將老宅與寵物完美的結合呈現，整個用餐空間活潑又靜謐的氛圍，看著每一桌客人帶著心愛的毛小孩來此用餐，享受浪漫的用餐氛圍！！', 'fdsfwefw.jpeg', '10:30:00', '19:00:00', NULL, NULL, 24, NULL, '2023-07-10 02:43:45', '4.3', 2),
(22, '鴉埠咖啡 Yaboo', 223912868, '台北市', '大安區', '永康街41巷26號', '大/中/小型犬/貓', 'YABOO CAFE 這裡歡迎喜好隨性自在，不拘泥小節，好慵懶但不懶惰的朋友們。我們以一種很隨性的步調生活著,也把這步調,分享給你.我們隨性,但不代表不認真喔!', '', '深夜咖啡廳', '是台北少數營業至深夜12點的咖啡館，鴉埠除了有寬闊舒適的空間、令人印象深刻的「隨便你、隨便我」菜單，還有一隻會不停用屁股親近你的巨可愛貓咪。是一間適合約會、姊妹淘聚會，也適合需要長時間筆電工作的朋友喔！', '2063973bd94da1b611a81d1a01e6ad33903f099b.jpeg', '12:00:00', '00:00:00', NULL, NULL, 22, NULL, '2023-07-10 02:48:22', '4.6', 3),
(23, '貓圖咖啡 CAT. jpg cafe', 233652865, '台北市', '大安區', '潮州街154號', '大/中/小型犬/貓', '貓，俏皮的模樣總是讓人會心一笑攝影，用圖片記錄日常散步的無意間發現咖啡，濃郁香氣帶來放鬆與寧靜在鬧中取靜的一隅，「貓圖咖啡，CAT. jpg cafe」誕生店裡的每一個細節都是我們反覆推敲後的呈現，經過不斷的嘗試、修正，直到誕生無論帶著甚麼心情踏進貓圖，希望在這裡能感到放鬆、舒適，直至離開的那一刻，內心仍滿載歡愉與溫暖。', '', '充滿貓的店', '整家餐廳都是以店貓為主題環繞，書籍也多是寵物或貓狗的書籍。小巧的門面以木框窗、矮凳及不同姿態的貓咪裝點其中，有種樸實的可愛！', '23564181174_49b8fc9395_c.jpeg', '08:30:00', '17:30:00', NULL, NULL, 24, NULL, '2023-07-10 03:15:46', '3.3', 2),
(24, 'Campus Cafe', 227516021, '台北市', '大安區', '忠孝東路三段203號', '大/中/小型犬/貓', '「CAMPUS CAFE 」主打著校園風格，以平價消費，免加收服務費，享受頂級美味。餐點除了道地美味，份量也不忘發揮美式精神，料多且新鮮實在的木盆沙拉，以蘿蔓，番茄，彩椒，小黃瓜，花椰菜等多種生菜，搭配堅果與一大球南瓜泥，加上培根、起司和特調凱薩醬調製，雖是生菜為主，卻飽足感十足', '', '美式風格店面', '一踏進店裡就能感受濃厚的美式氛圍，帶點Loft風格的復古磚牆，以大量的暖色系木頭裝潢相襯；明亮寬敞的窗面設計，加上原木大長桌與牆邊的書櫃，海外帶回的收藏品、骨董、NBA親筆簽名球衣等等，完美詮釋了美式餐廳的復古感。火', '39477438621_53efe7e5de_c.jpeg', '11:00:00', '21:00:00', NULL, NULL, 24, NULL, '2023-07-10 03:23:17', '3.6', 2),
(25, '花生俱樂部', 227752525, '台北市', '大安區', '大安路一段19巷16號', '大/中/小型犬/貓', '沒人生來厭世，卻在體驗人生的過程中覺得心累，靈魂彷彿被撕裂，飄蕩城市間，偶然遇見花生俱樂部 Peanut Club，走進一場不停歇的微醺派對，這裡沒有雞湯，只有酒精，選一杯理性多一點感性少一點的雞尾酒，縱容自己沈浸在淡淡的憂傷中，慢慢沈澱，鬆綁自己。', '', '結合咖啡廳、餐酒館和酒吧', '花生俱樂部白天也能喝到美酒、深夜也能喝到咖啡，而且只要店裡有開，在任何時段都能品嚐到美味甜點、下酒菜或豐盛的料理，甚至可幫吃素的朋友特製素食燉飯、素食義大利麵喔！', '20200828235502_72.jpeg', '18:00:00', '02:00:00', NULL, NULL, 28, '1', '2023-07-12 13:59:32', '4.3', 3),
