(27, '大毛屋涮涮鍋', 227587878, '台北市', '大安區', '光復南路456巷22號', '大/中/小型犬/貓', '大毛屋涮涮鍋位於台北大安，店內有兩隻巨型貴賓店狗，吃火鍋又可以到看兩隻巨型貴賓店狗，寵物友善餐廳，帶寵物還送寵物餐喔。', '', '寵物免費吃到飽', '帶寵物來用餐，還會送寵物雞肉吃到飽喔', '20180729235523_54.jpeg', '05:30:00', '10:30:00', NULL, NULL, 20, '1', '2023-07-12 14:08:15', '3.7', 2),
