(29, '小黑小白寵物休閒餐廳', 226790987, '新北市', '鶯歌區', '文化路200號之50號', '大/中/小型犬/貓', '如果帶寵物來逛鶯歌，小黑小白寵物休閒餐廳是你用餐的一個好選擇，它是專為毛孩開的極為寵物友善的餐廳，有提供寵物餐點，還有大草皮讓狗狗奔跑！', '', '毛孩盡情奔跑的大草皮', '讓毛小孩來大草皮來放電囉～大面積的草坪和獨木橋讓毛孩可以大手大腳的自由奔跑與穿梭。', '0huXR1s4iOKndvSD8rw3ZVIFYeJgZcOix_FjA1QUNLdBdHcXEhViZlDU9Ic0BeKGwoVzIxEBgadEIWcG0jUXw.jpeg', '12:00:00', '20:00:00', NULL, NULL, 28, '3,4', '2023-07-12 14:18:54', '4.0', 3),
(30, '貓子曬太陽', 286605220, '新北市', '永和區', '福和路125巷2號', '大/中/小型犬/貓', '在庸庸碌碌的生活中，很多人都會忽略了自己心裡真實的感受，和一些單純', '', '寬敞舒適的環境', '外面大約有15個座位，裡面大約可容納40多個座位，空間非常寬敞,無論是帶毛小孩或是家中小朋友，這裡都不會有狹小的感覺，店員會因來店人數，合併座位或分開，所以不用擔心，位置不夠的問題', '51a9879becb73fa367727c925777a57e43c692f5.jpeg', '10:00:00', '20:00:00', NULL, NULL, 38, '4', '2023-07-13 12:37:19', '4.0', 3),
(31, 'Eat enjoy意享美式廚房', 229109179, '新北市', '新店區', '北新路一段88巷9號', '大/中/小型犬/貓', '意享的創始人，在沒有餐飲背景的情況下，秉持著─『歡喜做，甘願受』的想法，就算再苦也要給他熬過，但由於年紀越來越大，店內營運毫無成長，在親朋好友苦口婆心要她放棄繼續經營這間店的同時，她的這番話─「都做這麼久了，我就歡喜做，甘願受，不想放棄這間承載著很多回憶的店」，使得長子有了想幫母親繼續營運並且讓年邁的她放心的想法。', '', '招牌甜點─「千層」', '我們經營理念就像是我們的招牌甜點──「千層」一樣，看似平凡的外型，一刀切下後那層層分明內層讓人驚艷，如同我們或許沒有那麼亮眼的店鋪外型，但裡裡外外不論是服務或是餐點都實實在在；千層壯觀的景象使您大飽眼福，如同我們的餐點每道讓您驚艷不已；當您咬下的剎那，這就是意享的滋味。', 'A7C02808.jpeg', '11:30:00', '21:30:00', NULL, NULL, 28, NULL, '2023-07-13 12:43:14', '4.6', 2),
(32, '捲尾巴寵物餐廳', 222318882, '新北市', '永和區', '永平路306號', '大/中/小型犬/貓', '我們想要創造一個地方，一個不論你來自哪裡，都可以放下疲憊，單純的享受空間，讓同樣帶著毛小孩的家長可以自在的休憩，讓喜歡毛小孩的人們可以在此練習，讓不熟悉毛小孩的人們可以感受毛孩世界的純粹，讓每顆正在失溫的心可以在這裡找到再度溫暖起來的動力，捲尾巴應著這樣的心意誕生了', '', '柴柴陪伴', '這家餐廳以迷人的柴犬主題裝潢和環境，帶給客人愉悅的用餐體驗。在這裡，您可以與友人和家人一起享受美味佳餚，同時被柴犬的陪伴和活潑可愛的氛圍所包圍。是一個結合了美食和狗狗愛好者共同喜愛的場所，為您帶來難忘和愉快的用餐體驗。', '1476104225-2163368991_l.jpeg', '10:30:00', '21:30:00', NULL, NULL, 28, '1', '2023-07-13 12:46:43', '4.4', 2),
(33, '覺旅咖啡(西湖店)', 287513227, '台北市', '內湖區', '瑞光路583巷24號', '大/中/小型犬/貓', '咖啡店的裝潢充滿著旅行的元素，您可以感受到探險的氛圍和冒險的精神。此外，覺旅咖啡也提供輕食和甜點，讓您在品味咖啡的同時，享受美味的小吃。無論您是咖啡愛好者還是旅行者，覺旅咖啡都是一個值得探索和體驗的獨特場所。', '', '旅行主題', '餐廳融合了旅行的元素，裝潢設計帶有探險和冒險的感覺，營造出一種獨特的氛圍，讓客人彷彿置身於一個精彩的旅程中。覺旅咖啡注重咖啡的品質，使用精心挑選的咖啡豆進行烘焙，保證每一杯咖啡都呈現出豐富的風味和香氣。', 'IMG_1507-800x600.jpeg', '08:00:00', '22:00:00', NULL, NULL, 24, NULL, '2023-07-13 12:54:11', '3.7', 2),
(34, '馬李王早午餐', 908517686, '台北市', '中山區', '中原街34號', '大/中/小型犬/貓', '是一家寵物友善餐廳，由姓馬、李、王的三個老闆一起合開，也成為這家餐廳名字的由來。店家為於中原街上，位置很好找，招牌是醒目的橘色，上面有隻可愛的小狗，店門採落地窗，可清楚看到店家內部。', '', '寵物友善/早午餐特色', '餐廳提供舒適且安全的環境，歡迎顧客攜帶寵物一同用餐，並提供相關設施和服務，例如寵物區域、水碗和寵物友善的座位等。\r\n專注於提供豐富多樣的早午餐選項，包括健康營養的早餐選擇、創意美味的午餐組合，讓客人享受美味的早午餐時光。', '2dcc9f605f1ee3384cdb419e2160fb26ce529f04.jpeg', '10:30:00', '20:30:00', NULL, NULL, 20, NULL, '2023-07-15 12:43:27', '4.6', 2),
(35, '芭蕾咖啡館', 227631981, '台北市', '松山區', '民生東路五段36巷8弄62號', '大/中/小型犬/貓', '芭蕾咖啡館，自2005年七月份在台北市民生社區成立，在這個空間中，咖啡館的主人期待讓咖啡與生活更貼近，如同每日的家庭生活一般，因此在這裡找不到傳統咖啡館櫃檯的距離感與吧台隔離的壓破感，期待帶給咖啡愛好者一個自由開放的空間感，可以與我們一同研究咖啡豆的烘焙；也可與我們一同等待一杯好咖啡的時光。', '', '手工烘培', '芭蕾的甜點與輕食也都是手工新鮮烘焙，從台灣食材的探尋到糕點烘焙的探索，都期待讓來到這裡的朋友們，感受到最真誠的美味，這也是芭蕾咖啡館每天每天所期待傳達的理念。\r\n', '328030143_783792929753871_7932844072771030001_n.jpeg', '11:30:00', '20:30:00', NULL, NULL, 30, NULL, '2023-07-15 12:54:40', '4.1', 3),
(36, '秋葵犬食堂', 229130077, '新北市', '新店區', '文化路31號', '大/中/小型犬/貓', '秋葵犬食堂是新店七張站與大坪林站附近的一家精緻文青系便當與手工甜點下午茶餐廳，位於技嘉大樓對面的巷內，前身為OSSO美式餐廳，於2019年5月重新裝潢再試營運，正餐主打家常味的特色手做餐盒，提供商業午餐，整體裝潢相當有文青網美的氣息，餐廳是寵物友善，且店內有兩隻可愛又親人的店狗。', '', '主打咖哩與餐盒', '多層次熟成咖哩餐盒，加入多樣蔬菜與多種咖哩香料一起拌炒\r\n熟成數天讓風味更加十足。廖爸功夫菜，廖爸三十幾年的做菜功力與客家精神都濃縮在這一份份餐盒中，', '90299871_2168492023281390_5066079470851457024_n.jpeg', '10:00:00', '14:00:00', NULL, NULL, 16, '7', '2023-07-15 12:56:35', '4.6', 2),
(37, 'TO House兔子庭園餐廳', 226191908, '新北市', '八里區', '博物館路202巷46號', '大/中/小型犬/貓', 'To House兔子庭園餐廳 每一道餐點都是主廚們精心為您準備，食材的嚴選（堅持不使用料理包及半成品的食物）慢火熬煮出濃郁豐厚口感的靈魂醬汁與天然食材間絕妙的平衡，都是為了讓您的味蕾有最好的體驗。 呈現到您面前的餐點都是在主廚的用心中與您耐心等候下完成，希望在您入口的同時能感受到我們的誠意！', '', '兔兔主題', '餐廳設有室內和室外的兔子園區，供顧客觀賞和互動。顧客可以在用餐期間欣賞到活潑可愛的兔子們，與它們互動，增添用餐體驗的樂趣。餐廳菜單以兔子為主題，提供具有創意的兔子造型菜品，例如兔子造型的甜點、兔子造型的三明治等。', '262468363_4775010205894590_3058601613384217649_n.jpeg', '11:00:00', '18:00:00', NULL, NULL, 30, '2', '2023-07-15 13:02:30', '3.9', 3),
(38, '93寵物咖啡複合餐飲', 286303193, '新北市', '八里區', '觀海大道93號', '大/中/小型犬/貓', '咖啡30年老經驗，2018年看中八里左岸悠閒風光，在這裡腹地150坪，打造地中海裝潢餐廳。 附設停車場，非常適合家庭聚餐、重車、腳踏車。 足夠空間可以讓主人帶毛寶貝用餐，我們也為毛寶貝貼心準備原肉鮮食，還有歡迎來找93店長柴犬cash玩。 ', '', '複合式咖啡廳', '顧客可以在愜意的環境中品嚐美味的咖啡，同時與寵物餐廳內設有開放式吧台，顧客可以親自體驗手沖咖啡的過程，並提供咖啡教學，讓顧客深入了解咖啡的製作過程和品味。提供包場和舉辦烤肉派對的場所。顧客可以在這個舒適的戶外空間中享受美食和社交，舉辦私人活動、聚會或慶祝活動。', 'db839e9f25aec29bebaa4a6d5f105731cd0f1297.jpeg', '10:00:00', '12:00:00', NULL, NULL, 32, NULL, '2023-07-15 13:06:15', '3.9', 3),
(39, '布佬廚房Bruce’s Kitchen', 286666181, '新北市', '新店區', '車子路137號', '大/中/小型犬/貓', '店名「布佬」除了是Bruce的代稱之外，同時也是「不老」的意思，代表著一種追求、落實蔬食生活的新態度觀 – 傳達謙卑對待人事物、隨時讓自己歸零、重新學習的態度。堅持好的食材，以天然原味的料理基礎，求新求變跳脫傳統素食的框架，提升健康美味蔬食，與更多人分享，期望給客人有到朋友家吃頓飯的溫暖與輕鬆。', '', '料理神隊友：松露餛飩', '中西大合併蹦出新滋味-松露餛飩，濃郁松露的美味香氣，搭配布佬秘制醬汁，採用精選植物肉、新鮮食材，一顆顆餡料飽滿，清爽香甜,鮮嫩多汁的餛飩，讓你讚不絕口的好味道😋只有布佬廚房才能吃得到的私房料理，快來嚐嚐鮮！布佬廚房新商品', '261548885_7294860247206097_1289235659188123713_n.jpeg', '11:30:00', '14:30:00', '17:00:00', '20:00:00', 24, NULL, '2023-07-15 13:54:32', '4.4', 2),
(40, 'Eat enjoy 意享美式廚房', 227215662, '新北市', '林口區', '文化三路一段390-1號', '大/中/小型犬/貓', '提供美味的義大利麵/燉飯/漢堡/披薩/早午餐/法式千層蛋糕/手工甜點 另外還提供狗狗餐🐶 餐點品項豐富，適合朋友家人相約聚餐，寵物友善餐廳用餐環境，歡迎帶自己家的毛小孩一同來用餐，但是請遵守寵物公約唷\"', '', '半熟的誘惑！茄汁肉醬沙卡蘇卡', '猶如清晨的陽光柔和灑落，這道茄汁肉醬沙卡蘇卡與你的味蕾跳起了熱舞。香濃的番茄與肉醬炒著新鮮牛絞肉，每一粒肉末都充滿著誘人的茄汁滋味。扭開時間的鑰匙，點燃你的燃燒熱情，讓我們的土雞蛋燉煮至你的心坎裡。', '358045771_1713741852380916_8105642330636262691_n.jpeg', '10:00:00', '20:00:00', NULL, NULL, 28, NULL, '2023-07-15 13:59:11', '4.3', 2),
(41, '三芝二號倉庫咖啡館', 226361052, '新北市', '三芝區', '中山路一段4號', '大/中/小型犬/貓', '坐在黃昏的燈光下品茗、喝著咖啡，手握著的陶杯，都是在地藝術家的手作作品，在新穎幽雅的空間裡讓人難以忘卻舊倉庫的氣息。 咖啡館的牆壁上有框了一塊倉庫班駁的原牆，使人不會忘記它走過的痕跡。\"', '', '老倉改造的咖啡廳', '整修時以不改變整體結為基礎，展覽館屋頂，仍保留木頂支架（日式施工法），僅將屋頂破舊之琉璃瓦翻修，咖啡館屋頂則採「風古斗厝方式」建築。在本地的藝術家協助下，讓整個倉庫展現出特有的人文藝術風情，館内處處可見到藝術家琢磨的痕跡，外牆陶壁的設計、内部藝術家作品的佈置，甚至洗手間内的陶磚都充滿了本地藝術家的巧思。', '20180810164740557.jpeg', '11:30:00', '19:30:00', NULL, NULL, 22, '3,4', '2023-07-15 14:06:06', '4.1', 3),
(42, '貓肥咖啡館', 227017737, '新北市', '淡水區', '新生街108巷2號', '大/中/小型犬/貓', '淡水寵物友善咖啡廳，貓肥咖啡館已經有七年多營業歷史啦！貓肥咖啡還是很受客人們的喜愛唷！主打現點現做的料理與飲品，送入口中的可是老闆娘和家人們用心呈現的美味。寵物友善的貓肥咖啡館 很歡迎客人們帶著自己心愛的毛小孩、動物朋友們來貓肥咖啡館品嘗餐點、度過愜意的午後。', '', '貓咪互動區', '餐廳設有貓咪互動區，讓顧客可以親近貓咪、和牠們玩耍和撫摸。這個區域提供舒適的座位和玩具，讓顧客能夠與貓咪建立連結並享受與牠們互動的樂趣。餐廳以精心烹調的咖啡飲品為特色，提供各種口味豐富的咖啡選擇。顧客可以在貓咪的陪伴下，品味著香濃的咖啡，享受輕鬆愜意的用餐體驗。', 'fatcat.jpeg', '11:00:00', '20:00:00', NULL, NULL, 18, NULL, '2023-07-15 14:10:42', '3.7', 3),
(43, '千汌日本料理', 423768658, '台中市', '西區', '存中街61巷1號', '大/中/小型犬/貓', '千汌日本料理是富有特色的兩層樓日式洋房建築，由老屋改建融合新舊元素，展現老宅特有的浪漫面貌，餐廳還有一個日式庭園，很適合給毛小孩跑跳活動的空間。', '', '免費寵物餐食', '免費寵物餐食是千汌日式料理餐廳為了關愛寵物和寵物主人而提供的特殊福利。提供特製的寵物菜單，讓您的寵物也能一同享受用餐的樂趣。餐廳可能採用高品質的專業寵物食材，確保食物的安全和營養，千汌日式料理餐廳可能設計有寵物友好的用餐環境，例如室外座位區域或專門的寵物用餐區。', 'lawn.jpeg', '11:00:00', '21:00:00', NULL, NULL, 24, NULL, '2023-07-16 01:22:59', '3.9', 11),
(44, 'Tikiyalo鐵枝路咖啡交易所', 435097354, '台中市', '中區', '臺灣大道一段1號', '大/中/小型犬/貓', 'TIKIYALO是一句台語，我們在台中火車站大智北路這裡，前面有一片超Chill大草', '', '土石流咖啡', '土石流咖啡內層為冰美式咖啡，上層為我們手作焦糖脆餅及巧克力碎，滋味特別的好！﻿上面蓋的是我們家的特調奶蓋，奶蓋要配冰飲，做出來才會漂亮。﻿潰堤的方向、流下來的程度、上面的配料放的角度，其實都是有講究的..不是隨便亂倒嘿...﻿\r\n', '20200611225856_57.jpeg', '10:00:00', '19:00:00', NULL, NULL, 30, NULL, '2023-07-16 01:32:27', '3.9', 3),
(45, '派特寵物友善餐廳', 423899891, '台中市', '南屯區', '公益路二段959號', '大/中/小型犬/貓', '收費方式：低消$250/人，毛孩免入園費，毛孩游泳費用：$300/400/500。假日用餐時間：3hr。台中寵物友善餐廳｜台中寵物住宿｜台中寵物安親｜寵物幼兒園｜貓咪住宿｜寵物鮮食｜', '', '提供包場活動服務', '讓寵物主人可以租用整個餐廳或特定區域，專門為自己的寵物和朋友舉辦活動或聚會。可根據客人的需求和寵物的飲食習慣提供客製化的菜單，確保寵物也能享受到適合它們的美食。除了用餐，寵物友善餐廳包場活動還可能提供其他娛樂活動，例如舉辦寵物遊戲、寵物競賽或寵物社交活動等。', '310579283_1423267111491092_535417506778121940_n-scaled-1.jpeg', '11:00:00', '19:00:00', NULL, NULL, 26, NULL, '2023-07-16 01:37:36', '4.3', 1),
(46, '裹腹Grab Food Brunch', 423268001, '台中市', '西區', '華美街478-1號', '大/中/小型犬/貓', '裹腹，以可愛貓咪做logo的早午餐店，也是寵物友善空間，就在台中廣三sogo附近，華美街上。寵物友善餐廳，請牽繩或用提籃\r\n，每人低消一份餐或一人200元，不使用整桌總價平均計算', '', '外送服務', '提供多樣化的早午餐選擇，包括各式早晨特色菜、蛋品、鬆餅、法式吐司、三明治等，以滿足不同客人的口味需求。營造出舒適輕鬆的用餐環境，讓客人在享受美食的同時，能感受到愉悅的用餐氛圍。Grab Food外送服務，方便客人在家或辦公室也能品嚐到美味的早午餐。', '20220716234419_42.jpeg', '09:00:00', '15:00:00', NULL, NULL, 24, NULL, '2023-07-16 01:41:04', '4.3', 1),
(47, '食久。茶事', 966823037, '台中市', '大里區', '甲堤南路71-1號', '大/中/小型犬/貓', '以Together is better為核心，希望我們在自己生長的地方(十九甲)打造一個，讓大家可以聚在一起分享著生活瑣事的空間。 『食久』，位於大里名十九甲的一個小區。提供餐點和舒適的環境。 『茶事』，大家可以喝著茶，聊著開心或是難過的事，得到世外桃源的釋放。', '', '親子寵物特色餐廳', '「食久茶事」除了內用的貨櫃屋用餐空間，戶外也提供了大片的用餐環境，樹旁的草地則是非常適合毛小孩與小朋友們奔跑、玩耍的地方。白天來到此可以感受著純白系清新明亮且舒適的風格氛圍，晚上來到此則可以感受點燈下溫馨、溫暖的風格氛圍，果真非常適合喜歡拍照的各位朋友們，連我用餐當天也帶走很多喜歡的影像回家。', '20220901-IMG_7542.jpeg', '11:00:00', '20:00:00', NULL, NULL, 24, NULL, '2023-07-16 01:46:10', '4.3', 1),
(48, 'WPAPA Teppanyaki Brunch', 424962278, '台中市', '大里區', '塗城路923巷16號', '大/中/小型犬/貓', '讓鐵板的焦香滿足您的嗅覺，Wpapa以主廚為名，以愛烹調，\r\n以簡單享受生活，快來享受Wpapa為您準備的精緻餐點，豐富您的味覺與視覺', '', '冰淇淋與酥皮蘋果派', '冷熱交替的甜點·用香草冰淇淋與層層的酥皮做搭配，蜂蜜焦糖漂浮拿鐵品嚐蜂蜜與焦糖醬的甜之外再帶有微苦的拿鐵，讓品嚐時有層層的滋味，柳橙莓果soda柳橙果露與林滿滿的冰塊氣泡飲再淋上莓果醬，酸甜風味與較有香氣的莓果超搭', '20211202162342_89.jpeg', '09:00:00', '15:00:00', NULL, NULL, 32, '1', '2023-07-16 01:49:47', '4.0', 2),
(49, 'TIGERROAR 韓虎嘯', 424631698, '台中市', '西屯區', '福星路591號', '大/中/小型犬/貓', '為RH-GROUP旗下品牌之一。主打道地韓式風味料理，我們引進多種經典韓式口味、特聘韓國專業廚藝團隊來台；採用當地調味料完美呈現道地風味！', '', '韓式料理', '韓式小菜吃到飽，韓國著名的特色鍋物，炸雞、豆腐煲、石鍋拌飯等經典的美食，在這都能吃的到', '2021012644-scaled.jpeg', '10:00:00', '22:00:00', NULL, NULL, 28, NULL, '2023-07-16 01:54:08', '4.0', 1),
(50, '菇神觀景複合式餐飲', 425822585, '台中市', '新社區', '協中街287號', '大/中/小型犬/貓', '菇神是首家推廣菇類火鍋之餐廳，與菇農合作，每天鮮採立即送到店內料理，以提供兼顧美味健康的菇類食品為目標，並已“養生之道，食在菇神”當作企業核心價值。', '', '以菇類為主題的火鍋餐廳', '菇神是以菇類為主題的火鍋餐廳，提供兼顧美味健康的菇類餐飲與伴手禮，並以「養生之道，食在菇神」為企業核心價值，是台中不可錯過的推薦美食，寵物友善餐廳。在2022年，菇神為了追求鮮味的極致推出「菇鮮、雞鮮、海味鮮」的放山古早雞海味宴，ㄧ經推出就贏得消費者的喜愛。。', '10711.jpeg', '11:00:00', '19:00:00', NULL, NULL, 24, NULL, '2023-07-16 01:58:33', '4.0', 1);
