(48, 22, 'mem00001', 4, 3, 4, '帶著寵物來這裡吃飯真的很開心，服務人員對寵物都很友善，推薦給其他寵物家長', 0, '2023-07-17'),
(49, 23, 'mem00002', 3, 5, 3, '我們的毛小孩在這家餐廳度過了美好的時光，食物對寵物也很安全，一切都很完美。', 0, '2023-07-17'),
(50, 24, 'mem00003', 5, 4, 4, '這裡的環境非常適合寵物，特別設計了一個寵物區，讓主人們能放心用餐。', 0, '2023-07-17'),
(51, 25, 'mem00004', 4, 5, 5, '食物的選擇很多，寵物也能品嘗到一些特別的寵物餐點，主人和寵物都滿意的用餐體驗。', 0, '2023-07-17'),
(52, 26, 'mem00446', 5, 5, 5, '\"餐廳的員工對寵物真的很友善，我們的狗狗在這裡玩得很開心，下次還會再來。', 0, '2023-07-17'),
(53, 27, 'mem00447', 3, 3, 4, '這家餐廳的內部裝潢很有趣，寵物可以在這裡放鬆身心，非常適合帶著寵物來用餐。', 0, '2023-07-17'),
(54, 28, 'mem00448', 4, 4, 5, '我們的貓咪平常都很害羞，但在這家餐廳裡卻顯得很開心，環境對寵物來說真的很友善。', 0, '2023-07-17'),
(55, 29, 'mem00449', 5, 5, 5, '餐廳的位置很便利，寵物遛完之後正好可以來這裡用餐，餐點品質也很不錯。', 0, '2023-07-17'),
(56, 30, 'mem00500', 5, 4, 5, '環境優雅，餐點豐富，寵物也能和主人一起享受美味的用餐時光，很棒的寵物友善餐廳。', 0, '2023-07-17'),
(57, 31, 'mem00000', 5, 4, 5, '我們帶著狗狗一起來用餐，餐廳提供了專屬寵物區，讓我們的毛小孩也能享受用餐樂趣。', 0, '2023-07-17'),
(58, 32, 'mem00001', 4, 3, 4, '食物的品質超乎預期，而且餐廳為寵物提供了水碗和小零食，真是周到的寵物友善措施。', 0, '2023-07-17'),
(59, 33, 'mem00002', 3, 5, 3, '來這家餐廳用餐的過程中，我們的貓咪表現得非常放鬆，這裡確實是個寵物心情愉快的地方。', 0, '2023-07-17'),
(60, 34, 'mem00003', 5, 4, 4, '環境安靜整潔，適合寵物放鬆，服務人員也很有耐心，對待我們的狗狗非常友善。', 0, '2023-07-17'),
(61, 35, 'mem00004', 4, 5, 5, '用餐期間，我們的寵物和其他來訪的寵物都相處融洽，這家餐廳的寵物友善氛圍很不錯。', 0, '2023-07-17'),
(62, 36, 'mem00446', 5, 5, 5, '餐點選擇豐富，連我們的要求挑剔的寵物都能找到自己喜歡的口味，真的是不錯的選擇。', 0, '2023-07-17'),
(63, 37, 'mem00447', 3, 3, 4, '我們一家人帶著愛犬共進晚餐，整個用餐體驗很開心，狗狗也在餐廳裡玩得很開心。', 0, '2023-07-17'),
(64, 38, 'mem00448', 4, 4, 5, '這裡的服務真的很讚，不僅對待客人親切，對寵物也很溫暖，是值得再次光顧的地方。', 0, '2023-07-17'),
(65, 39, 'mem00449', 5, 5, 5, '寵物區有很多有趣的寵物玩具，我們的貓咪在這裡度過了一個愉快的下午。', 0, '2023-07-17'),
(66, 40, 'mem00500', 5, 4, 5, '這是我們帶狗狗來的第一家餐廳，整體感覺不錯，以後會經常光顧的寵物友善餐廳。', 0, '2023-07-17'),
(67, 41, 'mem00000', 5, 4, 5, '這家餐廳的寵物友善措施真的讓人驚艷，寵物不僅受到歡迎，還有特別設計的寵物菜單。', 0, '2023-07-17'),
(68, 42, 'mem00001', 4, 3, 4, '我的狗狗在這家餐廳玩得不亦樂乎，而且周圍的顧客也對牠非常友善，愛心十足的用餐體驗。', 0, '2023-07-17'),
(69, 43, 'mem00002', 5, 5, 5, '無論是對待客人還是寵物，這裡的服務都令人滿意，真的是一家值得推薦的寵物友善餐廳。', 0, '2023-07-17'),
(70, 44, 'mem00003', 5, 4, 4, '我們帶著兩隻貓咪來用餐，餐廳提供了安全的寵物籠，讓我們能夠安心用餐，很貼心的設計', 0, '2023-07-17'),
(71, 45, 'mem00004', 4, 5, 5, '餐廳的環境設計真的很特別，還有專門的寵物攝影角落，我們的狗狗在那裡留下了美好回憶。', 0, '2023-07-17'),
(72, 46, 'mem00446', 5, 5, 5, '這裡的寵物區很寬敞，有很多其他的寵物朋友，我們的狗狗在這裡度過了愉快的時光。', 0, '2023-07-17'),
(73, 47, 'mem00447', 3, 3, 4, '用餐過程中，服務員還給了我們的狗狗一些小點心，簡直就是一個尊榮的寵物用餐體驗。', 0, '2023-07-17'),
(74, 48, 'mem00448', 4, 4, 5, '這家餐廳的寵物友善政策很周全，讓主人能夠專心用餐，而寵物也不會感到無聊。', 0, '2023-07-17'),
(75, 49, 'mem00449', 5, 5, 5, '在這裡用餐的過程中，我們的寵物受到了很多其他客人的關愛，真的是一個大家庭的感覺。', 0, '2023-07-17'),
(76, 50, 'mem00500', 5, 4, 5, '餐廳提供了免費的寵物用品租借服務，這讓我們的狗狗有了更好的用餐體驗，感謝餐廳的用心。', 0, '2023-07-17'),
(77, 1, 'mem00096', 5, 5, 4, '我們家的狗狗非常喜歡這家餐廳，他在這裡有專屬的區域可以玩耍，工作人員也很貼心，讓我們的用餐體驗更加愉快。這裡真的是寵物友善的好地方', 1, '2023-02-06'),
(78, 2, 'mem00226', 4, 3, 4, '這裡是寵物的天堂，我們帶著愛貓來用餐，餐廳提供了專屬的貓咪用具，讓我們的貓咪也能融入用餐的氛圍，是個非常愉快的用餐體驗', 2, '2023-04-18'),
(79, 3, 'mem00110', 4, 3, 5, '我們帶著愛犬來到這家餐廳，感受到了真摯的寵物友善，餐廳提供了寵物用具與水源，讓我們的小狗也能玩得很開心！', 3, '2023-03-30'),
(81, 5, 'mem00063', 3, 3, 4, '這裡不僅有美食，還有可愛的寵物陪伴。餐廳的寵物區很乾淨整潔，工作人員也非常細心照顧我們的寵物，讓我們感到很放心', 5, '2023-05-03'),
(82, 6, 'mem00238', 4, 4, 5, '有寵物的家庭一定不能錯過這家餐廳！我們帶著愛犬來用餐，餐廳提供了寵物用具，服務人員也很照顧我們的愛狗，讓我們的用餐時光更加溫馨愉快', 6, '2023-04-14'),
(83, 7, 'mem00212', 4, 3, 3, '終於找到一家可以和愛狗一起用餐的餐廳！這裡的食物超級好吃，環境也很舒適，最棒的是可以與愛狗一同分享美好時光', 7, '2023-03-11'),
(84, 8, 'mem00123', 4, 5, 4, '寵物友善的餐廳真的是太難得了！這裡的服務讓人感到賓至如歸，我們的愛狗也很快樂。下次再來，還要帶更多寵物朋友', 8, '2023-01-07'),
(85, 9, 'mem00117', 5, 4, 4, '來到這家寵物友善餐廳，讓我們的貓咪第一次感受到了用餐的樂趣。這裡真的是貓咪的天堂，吃飯的同時也能一起和貓咪互動，太幸福了', 9, '2023-01-13'),
(86, 10, 'mem00024', 4, 4, 4, '太愛這家餐廳了！不僅食物美味，環境舒適，還可以和愛狗一起來用餐。這裡真的是寵物友善的天堂，我們家狗狗很喜歡', 10, '2023-05-06'),
(87, 11, 'mem00400', 5, 5, 4, '這家餐廳真的是寵物友善的天堂！我帶著愛犬來用餐，餐廳提供了專屬的寵物區域，有寵物用具和玩具，讓我的愛犬也能玩得很開心', 11, '2023-07-16'),
(88, 12, 'mem00217', 5, 5, 5, '來到這家寵物友善餐廳，讓我們的貓咪第一次感受到了用餐的樂趣。這裡真的是貓咪的天堂，吃飯的同時也能一起和貓咪互動，太幸福了', 12, '2023-01-15'),
(89, 13, 'mem00127', 4, 4, 5, '太愛這家餐廳了！不僅食物美味，環境舒適，還可以和愛狗一起來用餐。這裡真的是寵物友善的天堂，我們家狗狗很喜歡', 13, '2023-02-07'),
(90, 14, 'mem00157', 5, 4, 3, '寵物友善的餐廳真的是太難得了！這裡的服務讓人感到賓至如歸，我們的愛狗也很快樂。下次再來，還要帶更多寵物朋友', 14, '2023-01-17'),
(91, 15, 'mem00208', 5, 3, 4, '有寵物的家庭一定不能錯過這家餐廳！我們帶著愛犬來用餐，餐廳提供了寵物用具，服務人員也很照顧我們的愛狗，讓我們的用餐時光更加溫馨愉快', 15, '2023-07-11'),
