INSERT INTO `shop_product` (`product_sid`, `category_sid`, `category_detail_sid`, `supplier_sid`, `for_pet_type`, `name`, `description`, `img`, `shelf_date`, `update_date`, `shelf_status`, `supplier`, `avg_rating`, `sales_qty`) VALUES
('BFHE0001', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用情緒美麗好心情60克(貓狗保健品)', '全方位情緒關鍵\r\n穩定神經\r\n消除壓力\r\n維持活力\r\n色胺酸在體內可轉化為產生愉悅感的血清素，有助毛孩消除壓力。\r\n安撫憂鬱心情，舒緩犬貓不安情緒，緩解焦慮。\r\nGABA及茶胺酸能穩定神經，讓毛孩慢慢放鬆情緒更穩定。\r\n初乳蛋白提供優質營養，維持活力，提升毛孩身心健康。\r\n\r\n含有色胺酸、茶胺酸、雞肝粉、GABA、初乳蛋白\r\n使用方式:每日一包。請依寵物體型、健康狀況、年齡、運動量酌量調整。', 'pro200.jpg', '2023-07-11 21:26:13', '2023-07-19 22:01:58', 1, 'GoMo Pet Food 大成狗貓', '4.7', '36'),
('BFHE0002', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用牛磺酸60克(貓狗保健品)', '單次單包，乾淨不沾手。\r\n食品級氮氣充填，穩定保鮮\r\n提供完整均衡營養\r\n幫助成長發育\r\n\r\n注意事項\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。\r\n5.請勿取代醫療用品，如有需要請諮詢獸醫師。', 'pro209.jpg', '2023-07-11 21:39:34', '2023-07-11 21:39:34', 1, 'GoMo Pet Food 大成狗貓', '4.5', '8'),
('BFHE0003', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用離胺酸60克(貓狗保健品)', '單次單包，乾淨不沾手。\r\n食品級氮氣充填，穩定保鮮\r\n提供完整均衡營養\r\n幫助成長發育\r\n\r\n注意事項\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。\r\n5.請勿取代醫療用品，如有需要請諮詢獸醫師。', 'pro210.jpg', '2023-07-11 21:42:48', '2023-07-11 21:42:48', 1, 'GoMo Pet Food 大成狗貓', '4.5', '52'),
('BFHE0004', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用潔牙清新好口氣60克(貓狗保健品)', '全方位清新口氣\r\n鞏固牙齒\r\n口腔護理\r\n維護牙齦健康\r\n大成溯源鮮蛋粉提供維生素與礦物質，強健骨骼及牙齒發育。\r\n複合益生菌粉使口氣芬芳，減緩口臭。\r\n微細顆粒的物理摩擦與潔齒成份保護牙齒。\r\n舒緩牙齦與口腔不適。\r\n每日一包。請依寵物體型、健康狀況、年齡、運動量酌量調整。', 'pro211.jpg', '2023-07-11 21:46:59', '2023-07-11 21:46:59', 1, 'GoMo Pet Food 大成狗貓', '4.4', '189'),
('BFHE0005', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用關節健康好活力60克(貓狗保健品)', '全方位活力關鍵\r\n幫助骨骼發展\r\n促進膠原蛋白生成\r\n預防關節老化\r\nUC-II促進膠原蛋白生成\r\n減緩關節退化預防關節老化\r\n雞肝粉含鈣與磷、維生素D，有助增強骨骼及牙齒\r\n含豐富的葡萄萄胺、軟骨素，幫助骨骼發展。\r\nOptiMSM關節保健，幫助維持強壯的骨骼結構，能承受體重負擔。\r\n每日一包。請依寵物體型、健康狀況、年齡、運動量酌量調整。', 'pro214.jpg', '2023-07-11 21:49:22', '2023-07-11 21:49:22', 1, 'GoMo Pet Food 大成狗貓', '4.4', '119'),
('BFHE0006', 'F', 'HE', 8, 'B', '大成狗貓-貓犬專用免疫調節葡聚糖60克(貓狗保健品)', '單次單包，乾淨不沾手。\r\n食品級氮氣充填，穩定保鮮\r\n提供完整均衡營養\r\n幫助成長發育\r\n\r\n熱量 每包7.350Kcal\r\n蛋白質 每包0.494公克\r\n脂肪 每包0.014公克\r\n碳水化合物 每包 1.312公克\r\n\r\n注意事項\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。\r\n5.請勿取代醫療用品，如有需要請諮詢獸醫師。', 'pro218.jpg', '2023-07-11 21:55:03', '2023-07-11 21:55:03', 1, 'GoMo Pet Food 大成狗貓', '4.8', '48'),
('BFHE0007', 'F', 'HE', 8, 'B', '大成狗貓-寵物專用亮麗爆毛蛋粉60克(貓狗保健品)', '單次單包，乾淨不沾手。\r\n食品級氮氣充填，穩定保鮮\r\n提供完整均衡營養\r\n幫助成長發育\r\n\r\n含有雞蛋粉、麥芽糊精、玉米澱粉、二氧化矽\r\n\r\n營養分析\r\n熱量 每包9.172Kcal\r\n蛋白質 每包0.682公克\r\n脂肪 每包0.436公克\r\n碳水化合物 每包0.630公克\r\n\r\n\r\n注意事項\r\n1.開封前產品若有膨脹、凹陷、破損或異味之情形，不可食用，請撥打公司客服專線。\r\n2.勿當主餐餵食。\r\n3.請放在孩童無法拿取處。\r\n4.寵物食用後若有不適，請暫停使用。\r\n5.請勿取代醫療用品，如有需要請諮詢獸醫師。', 'pro219.jpg', '2023-07-11 21:56:47', '2023-07-11 21:56:47', 1, 'GoMo Pet Food 大成狗貓', '5.0', '4'),
('BFSN0001', 'F', 'SN', 13, 'B', '汪喵星球-迪士尼系列 冷凍乾燥原肉小零嘴 米妮款紐西蘭骰子牛 40g (貓狗零食)', '◆迪士尼限定包裝．限量登場\r\n◆犬貓摯愛，人氣熱銷零食！\r\n◆100%天然原肉塊、0%添加物\r\n◆口感鬆脆，好剝好咀嚼\r\n◆限定版包裝「與原版天然原肉零食的成分、克數、售價」皆相同，\r\n  不用擔心毛孩不吃唷！\r\n\r\n', 'pro298.jpg', '2023-08-02 10:24:57', '2023-08-02 10:24:57', 1, 'DogCatStar 汪喵星球', '4.2', '75'),
('BFSN0002', 'F', 'SN', 13, 'B', '汪喵星球-迪士尼系列 冷凍乾燥原肉小零嘴 米奇款安心雞胸肉 50g (貓狗零食)', '◆迪士尼限定包裝．限量登場\r\n◆犬貓摯愛，人氣熱銷零食！\r\n◆100%天然原肉塊、0%添加物\r\n◆口感鬆脆，好剝好咀嚼\r\n◆限定版包裝「與原版天然原肉零食的成分、克數、售價」皆相同，\r\n  不用擔心毛孩不吃唷！', 'pro300.jpg', '2023-08-02 10:26:43', '2023-08-02 10:26:43', 1, 'DogCatStar 汪喵星球', '4.3', '21'),
('BFSN0003', 'F', 'SN', 13, 'B', '汪喵星球-冷凍乾燥原肉小零嘴｜山味(貓狗零食)', '&bull; 不含任何人工香料、防腐劑\r\n&bull; 「冷凍乾燥技術」製作，可常溫保存\r\n\r\n雞胸肉/雞肉鬆：\r\n高蛋白低脂肪，有助毛孩強健體格。優質蛋白質來源，富含菸鹼酸、B6、B12 和膽鹼等營養素\r\n\r\n雞胗:\r\n耐咬不傷牙，毛孩快樂咬咬的同時還能潔牙！嚴選優質雞胗，富含鐵、鋅和 B群等營養素\r\n\r\n櫻桃鴨胸肉:\r\n鐵質最豐富的禽鳥，幫毛孩補血元氣滿滿!\r\n肉質相對細膩，腸胃較敏感的毛孩也能開心吃零嘴。\r\n嚴選品種櫻桃鴨，含有豐富鐵質與各種維他命。\r\n※選用天然原肉製成，受季節影響在外觀上會有些許差異，但不會影響產品本身品質，毛拔麻可以放心給毛孩食用喔！\r\n\r\n骰子牛/牛肉鬆:\r\n口感扎實、富含鐵質，滿足咬咬欲望兼顧補血！嚴選紐西蘭草飼牛腿瘦肉，富含鐵、鋅、B6 和 B12 等營養素。\r\n※ 選用天然整塊原肉切塊製成，因此可能包含原肉本身的筋膜，建議毛拔麻剝/剪成小塊再餵食毛孩喔！\r\n\r\n牛心丁:\r\n來自純淨大地的草飼牛心，含有豐富的牛磺酸與鐵質，守護毛孩心臟健康、養成好氣色！\r\n薄切小丁，貓咪、小型犬都能一口吃。免剝免剪輕鬆餵！\r\n\r\n牛肝丁:\r\n嚴選天然放牧的草飼牛肝，富含鐵質、鋅、錳、銅、維生素A＆D，幫助提升自然抵抗力！\r\n濃郁香氣勾起毛孩滿滿食慾，當點心、配主食都OK！\r\n\r\n骰子羊:\r\n擁有「陸地上鮭魚」之美稱，豐富 Omega-3 有助毛孩頭好壯壯。富含菸鹼酸、B12、硒、鋅、Omega-3、共軛亞油酸CLA、不飽和脂肪酸等營養素。\r\n※ 選用天然整塊原肉切塊製成，因此可能包含原肉本身的筋膜，建議毛拔麻剝/剪成小塊再餵食毛孩喔！', 'pro302.jpg', '2023-08-02 11:18:34', '2023-08-02 11:18:34', 1, 'DogCatStar 汪喵星球', '4.0', '5280'),
('BFSN0004', 'F', 'SN', 13, 'B', '汪喵星球-冷凍乾燥原肉小零嘴｜海味(貓狗零食)', '&bull; 不含任何人工香料、防腐劑\r\n&bull; 「冷凍乾燥技術」製作，可常溫保存\r\n&bull; 鮭魚尾巴肉質較強韌，更適合狗狗食用喔！\r\n\r\n台灣鮮脆捲:\r\n台灣產小卷，味道鮮美，極佳的適口性讓毛孩愛不釋手。\r\n豐富 EPA&amp;DHA 及牛磺酸，有助護心及腦神經機能健康，並富含鐵、維生素 A等營養素。\r\n\r\n日本大干貝:\r\n日本北海道生食等級大干貝水質純淨、水溫較低且洋流經過的「北海道野付灣區域」，是日本最佳的帆立貝生產地。產出的干貝口感Q彈，每一口都能嘗到大海的自然甜味，是富含蛋白質與 Omega-3 的珍貴小零嘴。※干貝本身的纖維質較高，容易裂成小肉塊或肉絲的狀態，不影響產品品質，毛拔麻可以放心給毛孩食用唷！\r\n\r\n紐西蘭綠貽貝:\r\n來自紐西蘭純淨無汙染海域的綠貽貝，富含天然葡萄糖胺、軟骨素和 Omega-3 (DHA&amp;EPA)等營養素，有益毛孩關節及心血管保健。除了征服貓咪味蕾，也是狗狗關節保養的零食首選！\r\n※ 綠貽貝脣上小小藍色的部分是綠貽貝本身的殼膜，是天然可以吃的哦！\r\n\r\n爆蛋柳葉魚:\r\n來自北歐挪威純淨深海，含有粒粒分明的飽滿魚卵，營養價值極高，有豐富的鈣質、DHA及維生素 E。滿滿彈牙潤口的營養魚卵，讓毛孩享用得愛不釋口，瞇起眼睛、卡滋卡滋 哺滋哺滋 、心滿意足地享受爆蛋小魚唷！\r\n\r\n柳葉魚雞鬆:\r\n連挑嘴毛孩都難以抵抗的「山味 x 海味 零食鬆」，拌入主食為單調的一餐增添食物香味，讓毛孩好感與食慾 UP！選用嗜口性超高，來自純淨深海且富含鈣質的柳葉魚，搭配低脂肪低熱量的雞胸肉。將食材打鬆、拌成細緻鬆粉，鎖住柳葉魚與雞胸肉的營養。&bull; 雞胸肉部位富含高蛋白質、低脂肪、低熱量、低膽固醇&bull; 柳葉魚含豐富的膠原蛋白、鈣質、DHA及維生素 E，保護眼睛、牙齒和強壯骨骼\r\n\r\n旗魚鬆:\r\n以百分百遠洋旗魚製成，含豐富優質蛋白質，運用凍乾與打鬆技術，保留最多食材營養價值與美味。細滑鬆粉伴隨天然清香的魚香氣，連挑嘴毛孩都拒絕不了，通過毛拔麻的一致好評，號稱是「帶有高級味的佐餐誘食鬆」！&bull; 旗魚富含Omega-3、維生素B6和B12、硒等營養素，且含豐富蛋白質、低膽固醇，是很好的維生素D來源，有助身體吸收和利用鈣質\r\n\r\n北歐鯡魚:\r\n水溫較低的波羅的海孕育了好品質的鯡魚，其體型小，毛孩容易食用。含有珍貴的 Omega-3，有助維護心血管健康和舒緩發炎，並富含維生素E、B12和 D等營養素。\r\n&bull; 鯡魚除了含有豐富營養的優點外，體型小、讓毛孩容易入口食用，且無須擔心重金屬累積問題，也符合環保永續海洋資源的理念。\r\n\r\n菇菇鰹魚鬆:\r\n「如何讓毛孩喝水，像喝湯那樣開心？」擁有日式湯底靈魂之稱的鰹魚，是家餘戶曉的美味代號。汪喵將新鮮鰹魚乾燥打鬆，並加入陸地上的免疫食補食材&mdash;有機姬松茸(俗稱巴西蘑菇)、高山猴頭菇，搖身一變成為養身又鮮美的鰹魚菇菇鬆。&bull; 鰹魚富含 Omega-3脂肪酸、維生素 D、硒、牛磺酸&bull; 嚴選養生菇類，豐富多醣體及微量元素，提高免疫力\r\n\r\n長盈虱目魚:\r\n長盈虱目魚是台灣第一個拿到歐盟認證無毒標章的養殖業者。以安全無毒的養殖方式，展現對生命的尊重與品質的堅持獲得歐盟的肯定。堅持以流刺網一尾一尾地抓，不用電擊捕撈因為會驚嚇到魚隻，肉質會不自主緊縮。且因為低密度的養殖，每尾壯碩肥美，沒有油膩小腹，『個個都是模特兒身材』。使用台灣最頂級的虱目魚，讓毛小孩吃得更好，陪我們一起慢慢變老。汪喵會繼續挖掘台灣用心有理念的好產品，除了給毛孩們最安心優質的零嘴，也希望毛拔麻和汪喵一起支持在地好產！&bull; 嚴選台南無毒飼養虱目魚，歐盟產銷履歷認證，採用肉質細嫩的里肌肉、無刺技術，方便又安心！&bull; 低膽固醇、低熱量、低脂肪、高蛋白質，肉質細膩，富含易消化吸收的蛋白質與胺基酸，豐富的天然牛磺酸來源。\r\n\r\n澎湖丁香魚:\r\n特地挑選約 6～7 公分最大尾、俗稱「大丁」的活凍丁香魚。富含鈣質、Omega-3，有助維護皮膚與心血管健康。讓毛孩吃得更好，陪我們一起慢慢變老，是汪喵唯一的堅持。&bull;富含鈣質&bull;豐富 Omega-3不飽和脂肪酸、DHA&amp;EPA\r\n\r\n府城火燒蝦:\r\n台南老字號的小吃店家，甚至會因為買不到火燒蝦，而乾脆歇業，有蝦才賣！儘管食材取得不易、價格高，但為了讓毛孩也能享受火燒蝦的鮮美，不斷尋訪台南後，汪喵終於找到船家取得珍貴食材！火燒蝦火紅的顏色，彷彿映照南部的陽光與熱情。希望毛孩們也能感受到汪喵的熱血，享用鮮美的海味呦！&bull; 含蝦紅素，具有良好的抗氧化能力，幫助身體對抗自由基。\r\n\r\n挪威鮭魚尾巴:\r\n挪威純淨海域、冰冷清澈的海水，是最適合鮭魚生長的環境。捕撈上岸、急速冷凍、產地直送，給毛孩最鮮甜的鮭魚尾。口感堅韌不傷牙，毛孩咬得開心也有助於護髮亮毛喲!※因鮭魚尾巴體積較大、質地較硬脆，若毛孩難入口，可將其切成小塊餵食哦！\r\n\r\n\r\n', 'pro312.jpg', '2023-08-02 11:40:33', '2023-08-02 11:40:33', 1, 'DogCatStar 汪喵星球', '3.8', '6111'),
