('BGOD0001', 'G', 'OD', 11, 'B', '馬斯與茉莉-寵物多功能牽繩-流行少女(貓狗戶外用品)', '．採用超強聚酯 (Polyester) 和潛水布料 (Neoprene) 製成，非常強韌及耐用。\r\n．質料柔軟舒適，不會弄傷寵物或引致皮膚敏感。\r\n．使用磨砂表面的合成金屬扣和環。\r\n．適合於攝氏 30 度的水溫下以洗衣機清洗\r\n\r\n* 7 種用法：\r\n-  1米短帶\r\n-  1.3 米中帶\r\n-  1.6 米長帶\r\n-  束腰帶\r\n-  斜背帶\r\n-  雙頭帶\r\n-  臨時綁帶', 'pro268.jpg', '2023-07-20 20:12:50', '2023-07-20 21:01:37', 1, 'Max＆Molly 馬斯與茉莉', '3.5', '84'),
