('BGOT0003', 'G', 'OT', 14, 'B', '貓與狗-寵物兩用窩墊(貓狗睡墊)', '● 柔軟舒適 親膚面料\r\n● 大面積想怎麼躺就怎麼躺\r\n● 內置扣子設計 可開可合隨心所變\r\n● 內墊可分離外罩和內芯 方便獨立洗滌\r\n● 底部配有防滑設計 睡得更安心\r\n\r\n尺寸 : 550 x 80 mm\r\n材質：聚酯纖維\r\n不要放重物或用力過猛\r\n注意火器\r\n禁止用途以外使用\r\n污染部位請立即用柔軟的布或溼巾擦拭\r\n根據測量位置的不同，產品的尺寸可能會有誤差\r\n產品顏色根據顯示器的規格，可能與實際產品有差異\r\n建議在溫水中使用中性洗滌劑，在手洗或乾燥的狀態下噴灑烘焙蘇打後抖落的乾式洗滌\r\n使用洗衣機時可能會損傷氣墊形態和面料\r\n千萬不要使用乾燥機\r\n晾乾後用手展開，弄出形狀\r\n襯墊是棉和蓋分開的，請參考後單獨洗滌\r\n對洗滌後發生的問題不負責', 'pro379.jpg', '2023-08-04 10:14:09', '2023-08-04 10:14:09', 1, 'Mao&Kou 貓與狗', '4.0', '200'),
