('CFCA0001', 'F', 'CA', 1, 'C', '希爾思-腎臟護理貓配方罐(雞肉燉蔬菜貓罐頭)', '◆降低蛋白質含量，有助於減輕腎臟的工作負擔\r\n◆降低磷含量，有助於維持腎臟健康並減輕腎臟壓力\r\n◆降低鈉含量，有助於維持正常的血壓\r\n◆增加Omega-3脂肪酸含量以維持腎臟健康\r\n◆增加維生素B群，有助於補償因腎臟病而從尿液排出損失的營養素', 'pro009.jpg', '2023-06-18 22:51:03', '2023-07-19 22:00:54', 1, 'Hills 希爾思', '3.7', '15'),
