('CFFE0001', 'F', 'FE', 1, 'C', '希爾思-早期腎臟病護理貓用配方(雞肉口味貓飼料)', '◆降低蛋白質含量，有助於減輕腎臟的工作負擔\r\n◆降低磷含量，有助於維持腎臟健康並減輕腎臟壓力\r\n◆降低鈉含量，有助於維持正常的血壓\r\n◆增加Omega-3脂肪酸含量以保護腎臟健康\r\n◆增加維生素B群，有助於補償因腎臟病而從尿液排出損失的營養素\r\n●產品成分\r\n啤酒大米，動物脂肪，玉米蛋白粉，大米蛋白濃縮物，脫水雞和火雞蛋白，脫水甜菜醬，脫水金槍魚蛋白（9％），豌豆蛋白，全蛋粉末，大豆油，礦物質，魚油，水解產物，左旋肉鹼，牛磺酸，維生素，微量元素和&amp;amp;amp;amp;beta;-胡蘿蔔素。具有天然抗氧化劑（生育酚的混合物）。\r\n\r\n●成分分析\r\n\r\n蛋白質27.8％；脂肪19.7％；碳水化合物（ENA）41.5％；纖維素（粗）1.5％; 粗礦物質5％; 水分4.5％; 鈣0.77％; 磷0.45％; 鈉0.23％; 鉀0.70％; 鎂0.08％; Omega-3脂肪酸0.97％；Omega-6脂肪酸3.46％；必需脂肪酸4.43％；可溶性纖維1.40％；左旋肉鹼525 mg / kg; 牛磺酸4,294 mg / kg; 硫胺素30.00 mg / kg; 核黃素15.20 mg / kg; 菸酸145.00 mg / kg; 吡rid醇10.60 mg / kg; 泛酸20 mg / kg; 葉酸3.10 mg / kg; 維生素B12 0.12毫克/千克; 生物素0.49毫克/千克; 維生素A10 9647 IU / kg; 維生素D10 1,025 IU / kg; 維生素E10 550毫克/千克; 維生素C10 90毫克/公斤; &amp;amp;amp;amp;beta;-胡蘿蔔素1.5 mg / kg', 'pro001.jpg', '2023-06-18 22:17:00', '2023-07-19 21:57:42', 1, 'Hills 希爾思', '4.5', '64'),
('CFFE0002', 'F', 'FE', 1, 'C', '希爾思-泌尿道舒緩緊迫(貓飼料)', '◆來自魚油的高量Omega-3脂肪酸，幫助皮膚健康使毛色健康亮麗\r\n◆控制鈣、鎂、磷及草酸鹽含量，有助膀胱健康\r\n◆抗氧化劑提高抗氧化力\r\n◆適合長期餵食及多貓家庭的理想選擇\r\n\r\n●產品成分\r\n雞肉，全穀物玉米，玉米蛋白粉，全麥小麥，啤酒米，豬肉油，雞肉粉，雞蛋製品，豬肉風味，大豆油，魚油，乳酸，L-賴氨酸，硫酸鈣，氯化鉀，氯化膽鹼，檸檬酸鉀，DL-蛋氨酸，L-色氨酸，維生素（維生素E補充，菸酸，硫胺素，泛酸鈣，鹽酸吡哆醇，維生素A補充液，核黃素，生物素，維生素B12，葉酸，維生素D3補充） ，牛磺酸，乾水解酪蛋白，礦物質（硫酸亞鐵，氧化鋅，硫酸銅，氧化錳，碘化鈣，亞硒酸鈉），碘鹽，新鮮混合維生素E，天然香料，-胡蘿蔔素\r\n\r\n●成分分析\r\n粗蛋白 30%、粗脂肪 13%、粗纖維 1.6%、水 8%、鈣0.57、磷0.5、鎂 0.04%', 'pro002.jpg', '2023-06-18 22:23:07', '2023-07-19 21:56:36', 1, 'Hills 希爾思', '3.7', '15'),
('CFFE0003', 'F', 'FE', 1, 'C', '希爾思-泌尿道護理貓用配方(貓飼料)', '◆來自魚油的高量Omega-3脂肪酸，有助於幫助健康的皮膚及亮麗的毛髮\r\n◆控制鈣、鎂、磷及草酸鹽含量，有助膀胱健康\r\n◆抗氧化劑提高抗氧化力\r\n◆適合長期餵食及多貓家庭的理想選擇\r\n●產品成分\r\n\r\n雞肉，全穀物玉米，玉米蛋白粉，全麥小麥，啤酒米，豬肉油，雞肉粉，雞蛋製品，豬肉風味，大豆油，魚油，乳酸，L-賴氨酸，硫酸鈣，氯化鉀，氯化膽鹼，檸檬酸鉀，DL-蛋氨酸，L-色氨酸，維生素（維生素E補充，菸酸，硫胺素，泛酸鈣，鹽酸吡哆醇，維生素A補充液，核黃素，生物素，維生素B12，葉酸，維生素D3補充） ，牛磺酸，乾水解酪蛋白，礦物質（硫酸亞鐵，氧化鋅，硫酸銅，氧化錳，碘化鈣，亞硒酸鈉），碘鹽，新鮮混合維生素E，天然香料，&amp;amp;amp;amp;amp;beta;-胡蘿蔔素\r\n\r\n \r\n\r\n●成分分析\r\n\r\n粗蛋白 8.5%&amp;amp;amp;amp;amp;uarr;、粗脂肪 3.5%&amp;amp;amp;amp;amp;uarr;、粗纖維 1%&amp;amp;amp;amp;amp;darr;、水 78%&amp;amp;amp;amp;amp;darr;', 'pro003.jpg', '2023-06-18 22:30:15', '2023-07-19 21:25:58', 1, 'Hills 希爾思', '4.3', '248'),
('CFFE0004', 'F', 'FE', 1, 'C', '希爾思-泌尿道護理舒緩緊迫貓用配方(雞肉貓飼料)', '◆來自魚油的高量Omega-3脂肪酸，幫助皮膚健康使毛色健康亮麗\r\n◆控制鈣、鎂、磷及草酸鹽含量，有助膀胱健康\r\n◆抗氧化劑提高抗氧化力\r\n◆適合長期餵食及多貓家庭的理想選擇\r\n●產品成分\r\n\r\n雞肉、全穀粒玉米、玉米筋質粉、全穀粒小麥、釀造米、豬肉脂肪、雞肉粉、乾燥蛋製品、豬肉香料、黃豆油、魚油、乳酸、左旋離胺酸、硫酸鈣、氯化鉀、氯化膽鹼、檸檬酸鉀、DL-蛋胺酸、左旋色胺酸、維生素 (維生素E添加劑、菸鹼酸添加劑、維生素B1、泛酸鈣、維生素B6、維生素A添加劑、核黃素添加劑、生物素、維生素B12添加劑、葉酸、維生素D3添加劑)、牛磺酸、乾燥水解酪蛋白、礦物質 (硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、碘鹽、添加綜合維生素E類以保鮮、天然香料、&amp;amp;amp;beta;-胡蘿蔔素\r\n\r\n \r\n\r\n●成分分析\r\n\r\n粗蛋白 30.0%&amp;amp;amp;uarr;、粗脂肪 13.0%&amp;amp;amp;uarr;、粗纖維 1.6%&amp;amp;amp;darr;、水 8.0%&amp;amp;amp;darr;', 'pro004.jpg', '2023-06-18 22:33:58', '2023-07-19 21:26:42', 1, 'Hills 希爾思', '3.0', '27'),
('CFFE0005', 'F', 'FE', 1, 'C', '希爾思-泌消化系統護理(雞肉口味貓飼料)', '◆高消化率，最佳可溶和不可溶天然纖維組合配方\r\n◆益生纖維及omega-3與omega-6必需脂肪酸\r\n◆富含電解質和維生素B群\r\n◆經臨床實證的抗氧化配方\r\n◆補充流失的養分並確保營養素易於吸收\r\n●產品成分\r\n\r\n雞肉、碎珍珠大麥、玉米筋質粉、釀造米、豬肉脂肪、雞肉粉、全穀粒玉米、乾燥蛋製品、雞肝香料、乳酸、脫水甜菜漿、氯化鉀、硫酸鈣、DL-蛋胺酸、氯化膽鹼、果寡糖、維生素 (維生素E添加劑、菸鹼酸添加劑、維生素B1、抗壞血酸多聚磷酸酯(維生素C 來源)、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、牛磺酸、碘鹽、左旋離胺酸、洋車前子殼、礦物質 (硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、天然香料、氧化鎂、&amp;amp;amp;beta;-胡蘿蔔素\r\n\r\n \r\n\r\n●成分分析\r\n\r\n粗蛋白質32%、粗脂肪 17%、粗纖維 4%、水 8%、鈣0.7%', 'pro005.jpg', '2023-06-18 22:35:46', '2023-07-19 21:27:05', 1, 'Hills 希爾思', NULL, NULL),
('CFFE0006', 'F', 'FE', 1, 'C', '希爾思-腎臟病護理貓用配方(海魚口味貓飼料)', '◆降低蛋白質含量，有助於減輕腎臟的工作負擔\r\n◆降低磷含量，有助於維持腎臟健康並減輕腎臟壓力\r\n◆降低鈉含量，有助於維持正常的血壓\r\n◆增加Omega-3脂肪酸含量以保護腎臟健康\r\n◆增加維生素B群，有助於補償因腎臟病而從尿液排出損失的營養素\r\n●產品成分\r\n糙米、玉米筋質粉、豬肉脂肪、海魚、碎珍珠大麥、全穀粒小麥、釀造米、小麥筋質、雞肝香料、乾燥蛋製品、黃豆油、豌豆蛋白、雞肉粉、脫水甜菜漿、魚油、乳酸、檸檬酸鉀、硫酸鈣、左旋離胺酸、左旋精胺酸、氯化膽鹼、碳酸鈣、維生素 (維生素E添加劑、菸鹼酸添加劑、抗壞血酸多聚磷酸酯(維生素C 來源)、維生素B1、維生素B6、泛酸鈣、核黃素添加劑、生物素、維生素A添加劑、維生素B12添加劑、葉酸、維生素D3添加劑)、左旋蘇胺酸、牛磺酸、碘鹽、DL-蛋胺酸、氯化鉀、左旋肉酸素、礦物質 (硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、左旋色胺酸、添加綜合維生素E類以保鮮、天然香料、&amp;amp;amp;amp;beta;-胡蘿蔔素\r\n\r\n●成分分析\r\n蛋白質：29.9%、脂肪：23.3%、碳水化合物(NFE)：40.2%、纖維：1.3%、鈣：0.75%、磷：0.52%、鈉：0.25%、鉀：0.75%、鎂：0.083%、牛磺酸：0.28%、維生素C：140mg/kg、維生素E：823IU/kg、Omega3：1.05%', 'pro006.jpg', '2023-06-18 22:37:45', '2023-07-19 21:27:21', 1, 'Hills 希爾思', '4.2', '114'),
('CFFE0007', 'F', 'FE', 1, 'C', '希爾思-雞肉特調食譜(幼貓飼料)', '源自魚油的DHA助益於腦部健康與視力發育\r\n優質蛋白質以建構精實肌肉\r\n強健骨骼與牙齒的均衡比例礦物質\r\n\r\n使用雞肉、糙米、小麥筋質、雞肉脂肪、蛋製品、全穀粒燕麥、全穀粒小麥、碎珍珠大麥、雞肝香料、亞麻仁籽、硫酸鈣、乳酸、魚油、左旋離胺酸、氯化鉀、碳酸鈣、DL-蛋胺酸、氯化膽鹼、三聚磷酸鈉、牛磺酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、泛酸鈣、維生素B6、維生素A添加劑、核黃素添加劑、生物素、維生素B12添加劑、葉酸、維生素D3添加劑)、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、碘鹽、磷酸二鈣、燕麥纖維、添加綜合維生素E類以保鮮、天然香料、氧化鎂、&amp;amp;beta;-胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豌豆\r\n\r\n含有粗蛋白質不低於33% \r\n粗脂肪不低於19% \r\n粗纖維不高於3.5%\r\n水不高於8%\r\n維生素E不低於525 IU/kg \r\n抗壞血酸(維生素C)不低於85 mg/kg\r\n二十二碳六烯酸(DHA)不低於0.1%', 'pro062.jpg', '2023-06-25 14:24:13', '2023-07-19 21:27:47', 1, 'Hills 希爾思', NULL, NULL),
('CFFE0008', 'F', 'FE', 1, 'C', '希爾思-均衡發育配方(幼貓飼料)', '源自魚油的DHA助益於腦部健康與視力發育\r\n優質蛋白質以建構精實肌肉\r\n強健骨骼與牙齒的均衡比例礦物質\r\n\r\n使用雞肉、糙米、小麥筋質、雞肉脂肪、蛋製品、全穀粒燕麥、全穀粒小麥、碎珍珠大麥、雞肝香料、亞麻仁籽、硫酸鈣、乳酸、魚油、左旋離胺酸、氯化鉀、碳酸鈣、DL-蛋胺酸、氯化膽鹼、三聚磷酸鈉、牛磺酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、泛酸鈣、維生素B6、維生素A添加劑、核黃素添加劑、生物素、維生素B12添加劑、葉酸、維生素D3添加劑)、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、碘鹽、磷酸二鈣、燕麥纖維、添加綜合維生素E類以保鮮、天然香料、氧化鎂、&amp;amp;beta;-胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豌豆\r\n\r\n含有粗蛋白質不低於33% \r\n粗脂肪不低於19% \r\n粗纖維不高於3.5%\r\n水不高於8%\r\n維生素E不低於525 IU/kg \r\n抗壞血酸(維生素C)不低於85 mg/kg\r\n二十二碳六烯酸(DHA)不低於0.1%', 'pro062.jpg', '2023-06-25 14:28:11', '2023-07-19 21:28:21', 1, 'Hills 希爾思', '3.8', '44'),
('CFFE0009', 'F', 'FE', 1, 'C', '希爾思-雞肉特調食譜(室內成貓飼料)', '天然纖維促進消化健康,以及優質成份能讓清理貓砂變得輕鬆\r\n精實肌肉所需的優質蛋白質\r\n天然優質、易消化的成份製作出美味營養食物\r\n\r\n使用雞肉、全穀粒小麥、玉米筋質粉、纖維素粉、雞肉脂肪、小麥筋質、雞肉粉、雞肝香料、脫水甜菜漿、黃豆油、硫酸鈣、乳酸、魚油、氯化鉀、碘鹽、氯化膽鹼、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、牛磺酸、左旋肉酸素、左旋離胺酸、礦物質(硫酸亞鐵.氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、天然香料、綠豌豆、蘋果、蔓越莓、胡蘿蔔、青花菜、&amp;beta;-胡蘿蔔素\r\n\r\n含有粗蛋白質不低於31% \r\n粗脂肪不低於13% \r\n粗纖維不低於6% \r\n粗纖維不高於12% \r\n水不高於8% \r\n維生素E不低於500 IU/kg \r\n抗壞血酸(維生素C)不低於85 mg/kg', 'pro065.jpg', '2023-06-25 14:35:11', '2023-07-19 21:28:38', 1, 'Hills 希爾思', '3.7', '126'),
('CFFE0010', 'F', 'FE', 1, 'C', '希爾思-敏感胃腸與皮膚 雞肉與米特調食譜(成貓飼料)', '益生纖維可促進腸道益菌生長並維持微生物相平衡\r\n高消化性有助於良好營養吸收並形成方便清理的糞便\r\n維生素E與Omega-6 滋潤皮膚\r\n\r\n使用雞肉、釀造米、雞肉粉、黃豆、碎珍珠大麥、全穀粒高梁、蛋製品、雞肉脂肪、黃豆油、糙米、脱水甜菜漿、雞肝香料、乳酸、豬肝香料、氯化鉀、亞麻仁籽、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑、碘鹽、氯化膽鹼、牛磺酸、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、燕麥纖維、天然香料、B胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豆\r\n\r\n含有粗蛋白質不低於21%\r\n粗脂肪不低於12%\r\n粗纖維不高於4%\r\n水不高於10%\r\n維生素E 不低於400 IU/kg\r\n抗壞血酸(維生素C)不低於85 mg/kg\r\nOmega-6脂肪酸不低於3%', 'pro068.jpg', '2023-06-25 14:38:31', '2023-07-19 21:30:21', 1, 'Hills 希爾思', '4.0', '8'),
('CFFE0011', 'F', 'FE', 1, 'C', '希爾思-泌尿道毛球控制 雞肉特調食譜(成貓飼料)', '優質纖維、脂肪酸和抗氧化物可促進消化健康、皮毛及免疫系統的強健天然纖維以和緩的方式清除體內毛球高消化性、優質蛋白質有助於維持精實肌肉\r\n\r\n使用雞肉、全穀粒小麥、玉米筋質粉、豬肉脂肪、纖維素粉、小麥筋質、雞肝香料、脱水甜菜漿、黃豆油、乳酸、硫酸鈣、魚油、氯化膽鹼、氯化鉀、左旋離胺酸、碘鹽、磷酸二鈣、牛磺酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、檸檬酸鉀、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、左旋肉酸素、添加綜合維生素E類以保鮮、天然香料、綠號豆、蘋果、蔓越莓、胡蘿蔔、青花菜、B-胡蘿蔔素\r\n\r\n含有粗蛋白質不低於 29.5%;\r\n粗脂肪不低於16%;\r\n粗纖維不低於6.5%;\r\n粗纖維不高於9.5%;\r\n水不高於8%;\r\n錢不高於0.09%;\r\n維生素不低於500 IU/kg;\r\n抗壞血酸維生素C)不低於85 mg/kg', 'pro070.jpg', '2023-06-25 14:42:05', '2023-07-19 21:33:13', 1, 'Hills 希爾思', '3.6', '154'),
('CFFE0012', 'F', 'FE', 1, 'C', '希爾思-口腔保健 雞肉特調食譜(成貓飼料)', '維持口腔健康對貓咪的整體健康至關重要。希爾思寵物食品口腔保健成貓乾糧提供精確均衡的營養，並運用經過臨床驗證的顆粒技術，強化成貓牙齒健康。此款貓用食品以天然原料製成，運用交錯纖維技術摩擦和清潔貓貓牙齒，每次進食都能維持清新口氣。除此之外，添加的Omega-6和維生素E可滋潤皮膚和毛髮。\r\n\r\n使用雞肉、糙米、玉米筋質粉、雞肉脂肪、纖維素粉、小麥筋質、雞肉粉、亞麻仁籽、雞肝香料、乳酸、氯化鉀、硫酸鈣、氯化膽鹼、左旋離胺酸、碘鹽、牛磺酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、泛酸鈣、維生素B6、維生素A添加劑、核黃素添加劑、生物素、維生素B12添加劑、葉酸、維生素D3添加劑)、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、DL-蛋胺酸、燕麥纖維、添加綜合維生素E類以保鮮、天然香料、&amp;beta;-胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豌豆\r\n\r\n含有粗蛋白質 不低於 29% ; 粗脂肪 不低於 17.5% ; 粗纖維 不高於 10% ; 水 不高於 10% ; 維生素E 不低於 450 IU/kg ; 抗壞血酸(維生素C) 不低於 85 mg/kg ; Omega-6脂肪酸 不低於 2%', 'pro073.jpg', '2023-06-25 14:44:34', '2023-07-19 21:33:42', 1, 'Hills 希爾思', NULL, NULL),
('CFFE0013', 'F', 'FE', 1, 'C', '希爾思-毛球控制 雞肉特調食譜(成貓飼料)', '維生素EOmega-3與Omega-6有助於皮毛亮麗\r\n精實肌肉所需的優質蛋白質\r\n以優質雞肉蛋白製作的美味營養食物\r\n\r\n使用雞肉、全穀粒小麥、玉米筋質粉、雞肉脂肪、纖維素粉、雞肉粉、小麥筋質、雞肝香料、脫水甜菜漿、硫酸鈣、乳酸、黃豆油、氯化鉀、魚油、氯化膽鹼、左旋離胺酸、碘鹽、磷酸二鈣、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、牛磺酸、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、添加綜合維生素E類以保鮮、天然香料、綠豌豆、蘋果、蔓越莓、胡蘿蔔、青花菜、&amp;beta;-胡蘿蔔素\r\n\r\n含有粗蛋白質不低於29.5% \r\n粗脂肪不低於15.5% \r\n粗纖維不低於6.5% \r\n粗纖維不高於11%\r\n水不高於8%\r\n維生素E不低於5001U/kg \r\n抗壞血酸(維生素C)不低於85mg/kg \r\nOmega-3脂肪酸不低於0.2%\r\nomega-6脂肪酸不低於2.5%', 'pro075.jpg', '2023-06-25 14:52:09', '2023-07-19 21:36:28', 1, 'Hills 希爾思', '4.6', '310'),
('CFFE0014', 'F', 'FE', 1, 'C', '希爾思-完美體重 雞肉特調食譜(成貓飼料)', '突破性的營養配方，幫助您的愛貓維持健康體重及改善生活品質。\r\n超過 70% 的貓咪於 10 週內減輕體重\r\n健康體重有助於生活品質與平均壽命\r\n臨床實證抗氧化配方不含人工色素、香料、或防腐劑\r\n減輕體重－擁有健康體重的貓咪不易產生體重相關問題，過得健康又快樂。\r\n維持肌肉結實－新鮮雞肉第一成分，幫助健康減重及維持肌肉結實。\r\n健康的免疫系統－臨床實證含維生素C+E的抗氧化劑，可促進健康的免疫系統。\r\n容易消化－容易消化吸收的原料，不含人工色素、香料、或防腐劑，為寵物提供美味營養的餐點。\r\n\r\n\r\n適合多貓家庭－在幫助過重貓咪達到健康體重的同時仍能提供結實貓咪平衡的營養，簡化多貓家庭的餵食過程。\r\n\r\n使用雞肉、釀造米、玉米筋質粉、小麥筋質、纖維素粉、雞肉粉、脫水番茄粕、脫水甜菜漿、亞麻仁籽、雞肉脂肪、雞肝香料、椰子油、乳酸、硫酸鈣、左旋離胺酸、氯化鉀、氯化膽鹼、胡蘿蔔、DL-蛋胺酸、牛磺酸、維生素 (維生素E添加劑、抗壞血酸多聚磷酸酯(維生素 C 來源)、菸鹼酸添加劑、維生素 B1、維生素 A 添加劑、泛酸鈣、核黃素添加劑、生物素、維生素 B12 添加劑、維生素 B6、葉酸、維生素 D3添加劑)、碘鹽、磷酸二鈣、礦物質 (硫酸錳、硫酸亞鐵、氧化鋅、硫酸銅、碘酸鈣、亞硒酸鈉)、左旋肉酸素、燕麥纖維、添加綜合維生素 E 及檸檬酸以保鮮、天然香料、&amp;beta;-胡蘿蔔素、蘋果、青花菜、蔓越莓、綠豌豆。\r\n\r\n含有蛋白質 40.1%、脂肪 12.8%、粗纖維 8.1%、碳水化合物 (NFE) 32.6%、鈣 0.98%、磷 0.76%、鈉 0.35%、鉀 0.74%、鎂 0.094%、牛磺酸 0.32%、肉酸素 540.8 ppm、維生素C 153 ppm、維生素E 695 IU/kg、Omega-3脂肪酸總量 0.97%、Omega-6脂肪酸總量 2.83%。', 'pro079.jpg', '2023-06-25 14:56:21', '2023-07-19 21:38:13', 1, 'Hills 希爾思', '4.0', '396'),
('CFFE0015', 'F', 'FE', 1, 'C', '希爾思-頂級照護系列(成貓飼料)', '希爾思&amp;reg;寵物食品成貓頂級照護配方，維持結實肌肉與保護維繫生命器官健康的精確均衡營養。經專業醫學認證的抗氧化配方，讓免疫系統更健康。同時含增量的牛磺酸，有助於維持心臟健康，且控制磷含量來維持腎臟健康。\r\n\r\n使用雞肉副產品粉、全穀粒玉米、釀酒用米、玉米麩粉、動物脂肪（以混合維生素E及檸檬酸保存）、雞肝香料、乳酸、氯化膽鹼、氯化鉀、硫酸鈣、蛋氨酸、維生素E添加劑、碘鹽、維生素（抗壞血酸多聚磷酸酯（維生素C來源）、維生素E添加劑、菸鹼酸、維生素B1、維生素A添加劑、泛酸鈣、核黃素、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑）、牛磺酸、礦物質（硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉）、以混合維生素E及檸檬酸保存、磷酸、&amp;beta;-胡蘿蔔素、迷迭香萃取物。', 'pro083.jpg', '2023-06-25 15:00:13', '2023-07-19 21:38:41', 1, 'Hills 希爾思', '4.0', '128'),
('CFFE0016', 'F', 'FE', 1, 'C', '希爾思-毛球控制 雞肉特調食譜(7歲以上老貓飼料)', '維生素EOmega-3與Omega-6有助於皮毛亮麗\r\n牛磺酸可促進眼睛與心臟健康\r\n精實肌肉所需的優質蛋白質\r\n\r\n使用雞肉、全穀粒小麥、玉米筋質粉、雞肉脂肪、纖維素粉、小麥筋質、釀造米、脫水甜菜漿、雞肝香料、乳酸、氯化鉀、硫酸鈣、魚油、磷酸二鈣、氯化膽鹼、碳酸鈣、牛磺酸、維生素(維生素E添加劑、抗壞血酸多聚磷酸酯(維生素C來源)、菸鹼酸添加劑、維生素B1、維生素A添加劑、泛酸鈣、核黃素添加劑、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑)、碘鹽、礦物質(硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉)、左旋肉酸素、燕麥纖維、添加綜合維生素E類以保鮮、天然香料、&amp;beta;-胡蘿蔔素、蘋果、青花菜、胡蘿蔔、蔓越莓、綠豌豆\r\n\r\n含有粗蛋白質不低於28.5% \r\n粗脂肪不低於15.5% \r\n粗纖維不低於6.5% \r\n粗纖維不高於10.7% \r\n水不高於8% \r\n維生素E不低於550 IU/kg \r\n牛磺酸不低於0.1% \r\n抗壞血酸(維生素C)不低於85mg/kg \r\nOmega-3脂肪酸不低於0.2% \r\nomega-6脂肪酸不低於2.5%', 'pro086.jpg', '2023-06-25 15:04:33', '2023-07-19 21:39:21', 1, 'Hills 希爾思', '3.8', '800'),
('CFFE0017', 'F', 'FE', 1, 'C', '希爾思-青春活力希爾思-青春活力 雞肉與米食譜(7歲以上老貓飼料)', '天然原料調製而成的精確營養，有助於：\r\n腦部功能－強效抗氧化劑幫助腦部健康，以促進與家人互動的欲望\r\n精力與活力－蛋白質與左旋肉酸素可改善活動力及行動力\r\n健康的免疫系統－含維生素C+E，促進強健的免疫系統\r\n健康的消化系統－使用美味好吃，且優質易消化的原料\r\n豐盈的皮毛－必須脂肪酸有助皮毛更亮麗柔軟\r\n不含人工色素、香料、或防腐劑\r\n\r\n使用雞肉、糙米、玉米筋質粉、全穀粒燕麥、豌豆蛋白、雞肉脂肪、雞肝香料、乳酸、黃豆油、脫水蕃茄粕\r\n\r\n具有粗蛋白質不低於 30.0％、粗脂肪不低於 13.0％、粗纖維不高於 3.0％、水不高於 8.5％、維生素 E 不低於 650 IU/kg、維生素 C 不低於 100 mg/kg、Omega-3 脂肪酸 不低於 0.25％、Omega-6 脂肪酸不低於 2.0％', 'pro090.jpg', '2023-06-25 15:09:14', '2023-07-19 21:39:50', 1, 'Hills 希爾思', '4.2', '126'),
('CFFE0018', 'F', 'FE', 1, 'C', '希爾思-活力長壽系列(老貓飼料)', '提供維持腎臟健康與保護維繫生命器官的精確均衡營養。經臨床證實可在30天內改善腎臟健康*。且同時控制鈉和磷含量，維護心臟及重要器官的長期健康。此外，消化性高可確保關鍵營養素於24小時內被充分吸收。\r\n\r\n使用雞肉副產品粉、玉米麩粉、釀酒用米、全穀粒玉米、動物脂肪（以混合維生素E及檸檬酸保存）、大豆粉、左旋離氨酸、乳酸、雞肝香料、氯化鉀、氯化膽鹼、維生素E添加劑、維生素（抗壞血酸多聚磷酸酯（維生素C來源）、維生素E添加劑、菸鹼酸、維生素B1、維生素A添加劑、泛酸鈣、核黃素、生物素、維生素B12添加劑、維生素B6、葉酸、維生素D3添加劑）、牛磺酸、天然香料、碳酸鈣、碘鹽、魚油、礦物質（硫酸亞鐵、氧化鋅、硫酸銅、氧化錳、碘酸鈣、亞硒酸鈉）、左旋肉酸素、以混合維生素E及檸檬酸保存、磷酸、&amp;beta;-胡蘿蔔素、迷迭香萃取物。', 'pro092.jpg', '2023-06-25 15:14:41', '2023-07-19 21:40:19', 1, 'Hills 希爾思', '3.8', '351'),
('CFFE0019', 'F', 'FE', 4, 'C', '極緻-無穀低鎂低卡配方(室內成貓飼料)', 'ORIJEN 以大量穀物餵食的新鮮雞肉、北部野生白鮭魚和新鮮雞蛋、提供了含高蛋白人類食用等級的肉 (至少75%)、符合貓之所需。不含不適合貓的糧食和碳水化合物。貓的天性會選食一些草。考慮到這一點、ORIJEN CAT含有草本植物葫蘆巴、金盞花、藥用屬葵、牛蒡屬葵根和水飛雉、它們複製了貓的天然飲食習慣、幫助潤滑、營養、調整消化道、強健肝功能及控制胰島素的分泌。ORIJEN保持最少量的碳水化合物並有各種蒸製的水果和蔬菜 (約25%)、提供了豐富的天然抗氧化劑和植物化學物質。雞油、三紋魚油、葵花籽油和亞麻籽油含有&amp;amp;Omega;6和&amp;amp;Omega;3必須脂肪酸、如 DHA和EPA同時營養您愛貓的皮毛。\r\n成份：新鮮雞肉(14％)、新鮮全蛋(6％)、新鮮完整鯡魚(6％)、新鮮火雞肉(6％)、新鮮雞肝(6％)、新鮮完整比目魚(4％)、新鮮完整鯖魚(4％)、新鮮完整太平洋鱈魚(4％)、新鮮火雞肝(4％)、新鮮雞心(4％)、雞肉(脫水，4％)、火雞肉(脫水，4％)、完整鯖魚(脫水，4％)、完整沙丁魚(脫水，4％)、完整鯡魚(脫水，4％)、阿拉斯加鱈魚(脫水，4％)、扁豆纖維、完整紅扁豆、完整綠扁豆、完整綠豌豆、完整鷹嘴豆、完整黃豌豆、完整花豆、完整白豆、雞軟骨(脫水，1％)、新鮮火雞心(1％)、完整藍鱈(脫水，1％)、雞脂肪(0.5％)、蘋果纖維、乾燥海藻(DHA及EPA來源)、南瓜 (脫水)、冬南瓜(脫水)、蘿蔔(脫水)、雞肝(冷凍乾燥)、火雞肝(冷凍乾燥)、新鮮完整南瓜、新鮮完整冬南瓜、新鮮完整櫛瓜、新鮮完整防風草、新鮮蘿蔔、新鮮完整五爪蘋果、新鮮完整巴特梨、新鮮甘藍菜、新鮮菠菜、新鮮甜菜、新鮮蘿蔔菜、棕海帶、完整蔓越莓、完整藍莓、完整薩斯卡頓莓、菊苣根、薑黃、水飛薊、牛蒡根、薰衣草、蜀葵根、玫瑰果、補充劑：營養添加劑：鋅蛋白：100mg；銅蛋白：11mg；氯化膽鹼：1200mg；畜產添加劑：屎腸球菌 NCIMB10415: 600x10^6 CFU', 'pro119.jpg', '2023-06-25 16:54:14', '2023-07-19 21:41:31', 1, 'Orijen 極緻', '3.7', '504'),
('CFFE0020', 'F', 'FE', 8, 'C', '大成狗貓-全齡貓無穀低敏化毛配方1.8公斤(貓飼料)', '由大成專業團隊精心研發，從#育種 到 #研發\r\n誕生全新機能升級的飼料\r\n給毛孩吃的美味・防護加倍！\r\n\r\n從頭到尾・給毛孩全方位呵護 \r\n\r\n✔ 水解低敏胜肽蛋白 \r\n獨家水解技術，打造健康好體質\r\n\r\n✔ 獨家專利複合益生菌 \r\n補充關鍵益菌，維持狗貓腸道平衡\r\n\r\n✔ 優質蛋白質\r\n可溯源鮮蛋，品質安全有保證\r\n\r\n✔ 茄紅素 ✔ 維生素A\r\n延緩愛寵老化，維持好視力\r\n\r\n✔ 高品質魚油 \r\n豐富DHA+維生素Ｄ，維持犬貓心血管健康\r\n\r\n皮膚毛色都亮麗！⠀⠀⠀\r\n\r\n我們堅持｜給飼主最安心的四大保證\r\n獨家自有原料，提供精準營養\r\n產地新鮮直送，溯源安全有保證\r\n專家團隊設計，健康全方位呵護\r\n國家認證品檢，為愛寵健康把關\r\n\r\n使用大成鹿野自由放養土雞、北海道鯡魚、北大西洋鱈魚、高蛋白水解酵母粉、水解低敏胜肽蛋白、完整豌豆、天然苜蓿、雞肉水解胜肽、精選番茄、德國天然纖維、阿拉斯加深海魚油(使用天然維生素E保存)、氯化膽鹼、羥丁胺酸、檸檬酸、L-離胺酸、牛磺酸、DL-蛋胺酸、氯化鈉(來自天然海鹽)、寵物貓專用膳食礦物質(胺基酸螯合鐵、胺基酸螯合鋅、硫酸錳、胺基酸螯合銅、亞硒酸鈉、碘酸鉀)、寵物貓專用綜合維生素(維生素E（&alpha;-生育醇）、維生素B3（菸鹼酸）、維生素 B5（泛酸）、維生素B7（生物素）、維生素B2（核黃素）、維生素B1（噻胺）、維生素A（視黃醇）、維生素D（膽鈣化醇）、維生素B6（吡哆醇）、維生素B12（氰鈷胺素）、維生素K（葉醌）、維生素B9（葉酸）)、維生素C、洋車前子、菊苣纖維、南美絲蘭萃取物。\r\n\r\n含有粗蛋白質38.0%以上 、粗脂肪15.0% 以上、粗纖維5.0%以上、灰分9.0%以下、鈣1.0%以上、磷0.8%以上、水分10%以下、熱量、代謝能(計算值)3700kcal/kg ', 'pro226.jpg', '2023-07-11 22:10:38', '2023-07-11 22:10:38', 1, 'GoMo Pet Food 大成狗貓', '3.8', '60'),
